		["0711173405ihnNK"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Equipment:",
						["IC"] = "inv_belt_armor_goblin_d_01",
						["TX"] = "Travel:\n\nLayers upon layers of leather straps, harnesses, padding and a fur inner layer, interspersed with iron buckles to clip it all together. Giving the impression that, while unorthadox and strange in fashion, these hand-made garments are nothing but efficient.\n\nWork:\n\nSeparated into two compartments - style & spikes. Vexel's jacket and pantaloons exhibiting the former; floral and elegant, with a slight goblin flare present in the raised collar and short sleeves.\nMeanwhile the boots and bracers/gloves built for protection and hard-hitting damage in a brawl. Made from tough leather and cheap but well-maintained metal.\n",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Misc Equipment:",
