		["0503182758hGE3E"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Bulky",
						["IC"] = "Spell_Nature_Reincarnation",
						["TX"] = "Naoru sports a grand width between his shoulders and a massive size, giving him a brutish and hulking appearance.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Storm and Earth",
						["IC"] = "warrior_talent_icon_thunderstruck",
						["TX"] = "The Elements of Wind and Earth come to life easily around this shaman.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Scarred",
						["IC"] = "spell_druid_bloodythrash",
						["TX"] = "Naoru is scarred across his chest in numerable places, a tapestry carved upon his thick hide with tales of vicious battle.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Warpaint",
						["IC"] = "inv_inscription_warpaint_red",
						["TX"] = "Naoru carries red and white warpaint. The most notable is a small Tauren handprint placed on his right chest. The worn paint is re-applied whenever available.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Rustic",
						["IC"] = "achievement_leader_cairne bloodhoof",
						["TX"] = "Naoru's lower body is often covered in dirt or mud and his mane tends to be dusty. He usually carries a smell of leathers, sweat and the herbs he smokes.",
					},
				},
				["ST"] = {
					["1"] = 0,
