			},
			["time"] = 1603398864,
			["link"] = {
				["Naoru-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 46,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Naoru Skychaser{/h1}\n{img:Interface\\PETBATTLES\\Weather-StaticField:512:128}\n\n\nArt: {link*https://66.media.tumblr.com/dced88caa1ccd69109565b764eb852df/tumblr_pni4iaov3Q1rn2mwlo3_1280.png*Naoru Skychaser and Sungaiah Soothespring}\n- By the lovely {link*https://xuza.tumblr.com/*Xuza - Tumblr}\n\nArt: {link*https://cdn.discordapp.com/attachments/572769054679367711/726468192595083304/Naoru.png*Prepared for battle}\n- By me!\n\n{h2:c}APPEARANCE{/h2}\n\n{col:ffffff}Naoru stands above the average height of a Tauren male, with a great mass defining him, his shoulders standing far apart. HIs body is that of a warrior, its muscles littered with scars of gashes and tears into his skin, through his coat of chestnut fur.\n\nThere is a brutish look about him, and his face could be considered square and stone-cut, much like the rest of his body. His mane, of slightly darker shade of his furcoat, does not rest flat on him, but is wild and shaggy, especially on top of his head, giving his mane a distinct style. Parts of his horns are chipped and his left ear is pierced by two golden rings.\n\nNaoru's most natural expression seems to be that of a resting scowl, due to his scarred muzzle and his evil-looking red-brown eyes, even if he is quick to break into a smirk.\n\nThe bull is often covered in dust and dirt from the many arid places of Kalimdor, and does not seem to have the habit of bathing often. The smell of sweat, leather and herbal smoke is dominant around him. To a Tauren, it may seem like a natural scent, but to a non-Tauren it may border on unpleasant.{/col}\n\n\n{h2:c}ATTIRE{/h2}\n\n{col:ffffff}Naoru has worn many suits of battle over the years. From full-blown Horde armor of tempered steel, twisted spikes and blood-red crests to the most traditional and humble of Tauren wear, not even proper armor by an outsider's standpoint, but a collection of furs and leathers covering not even the vital essentials. More likely the role of the outfit is ceremonial. The only recurring features has been Naoru's preference for a wolf cowl. There have been many, of different breeds and colors, but it has always been there, to properly demonstrate his spiritual connections.\n\nIn the aftermath of the Blood War, Naoru mostly seems to be dressing in representation of his people and his spiritual profession, rather than be associated with the Horde. His attire is simple, covering little of his body.\n\nNaoru is known to favor weapons that appeal to his vicious style of combat; dual weapons, either axe or hammer with a reaving or crushing quality respectively.{/col}\n\n\n{h2:c}ABILITIES{/h2}\n\n{col:ffffff}Naoru is a shaman and he makes no attempt to hide this fact. Much of his private time can be witnessed to be devoted to meditation or constant appeals for favor with all four of the Elements.\n\nHis most favored elements seem to be Wind and Earth, his struggle always to find a balance between these two, opposing forces.{/col}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:512:256}\n\nAdditional information:\n\nVoice reference: {link*https://youtu.be/CNWQhwgufaU?t=276*Tychus Findlay (Neil Kaplan)}\n\n\n\n",
				},
			},
