					["TX"] = "Al'danash was born in Ashenvale, as she is a half breed she isn't exactly accepted by the Horde or Alliance, It makes it hard to make a friend in the Horde or Alliance. Her eyes are pure blue. Showing a bit of her Night Elven side. She blends in with her surroundings with ease, and is very... fast pace for who she is. \n\nHer family had been found and killed since they had a half breed child, she was the only one to escape. Being left and eventually finding a boat to Pandaria where the Monks of Pandaria took her in, teaching her the ways of a monk.\nHer Night Elven traits - Pure blue eyes, blends in to her surroundings, very fast at attacking and moving. And posesses a little magic.\nHer Blood Elven traits - Body colour and body shape, the way she speaks, very observent.\nWeaknesses - Sword Combat, Her defence with sword on sword is very off and is using a spear because of it. Unique Smell, Any person with a sense of smell in combat can tell where she is, very easily since her unique smell gives her away.\nStrengths - Hand to hand combat, since shes a monk shes incredibly experianced with hand to hand combat. Calmness, She can calm down in the toughest of situations some times.",
