						["TI"] = "Trinkets and Travel Bags",
						["IC"] = "inv_misc_necklace_feather09",
						["TX"] = "Zulzi wears two elaborately embroidered bags of soft hide and leather while travelling; one a cross-shoulder back pack and the other bound to her belt. \n\nBoth possess either earthy scents or primal auras of voodoo magic.\n\nHer belt is lined with varied juju trinkets; prayer beads, voodoo fetishes, a vial of noxious-looking liquid and a worn doll.",
