					["2"] = {
						["AC"] = true,
						["TI"] = "Many Eyed Mask",
						["IC"] = "inv_helm_cloth_pvppriestgladiator_o_01",
						["TX"] = "Zulzi's ritual mask is shaped with coarse woven silks into the silhouette of a web, crowned with brilliant carmine feathers and has two false tusks which are pierced with a single gold ring each.\n\nWhen worn, the eight eyes come alight with an eerie green glow and dull when it finds a place to the back of her cross-strap pack when not in use.",
