					["5"] = {
						["AC"] = true,
						["TI"] = "Intricate Tatau",
						["TX"] = "In dark mahogany ink, Zulzi has various markings that are easily identifiable and unique to her.\n\nThey seem to be sigils with great significance to her faith and craft, featuring patterns common in vodoo conjure and abstract spiders. \n\nThey appear across her left eye, right shoulder, left forearm, right hip and left shin.",
						["IC"] = "ability_psychicassault",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Locomotion and Gaze",
						["TX"] = "The constricted pupils in her pale eyes give the impression that Zulzi is on high alert and lends a certain unpleasant, intrusive quality to her gaze. \n\nAware of this natural leer, she is prone to making deliberate, sustained eye contact for just a little too long.\n\nThe way she moves follows this practiced and intentional trend; her gait is an easy, fluid glide as she walks with purpose. It is the poise of a snake moments from striking when tested.\n",
