			["about"] = {
				["T2"] = {
					{
						["TX"] = "\n{h2:c}{col:169382}Zulzi of Shadowprey{/col}{/h2}\n{h3:c} {col:AAA340}The Whispering Witch {/col} {/h3}",
						["BK"] = 3,
						["IC"] = "INV_Trinket_Naxxramas04",
					}, -- [1]
					{
						["TX"] = "{h3} {col:169382}Description - {link*https://i.ibb.co/T052jyj/Zi-model.png*Model Edit} {/col} {/h3}\n{col:AAA340}While this Darkspear female is small and slight of frame, everything from the prideful air of a tribal queen to the grandness of her attire gives the impression that she is very much assured of her own personal power - and the way her pale eyes lock onto others both bewares and dares them to contradict her.\n\nHer visage bares an unusual blend of features; her angular, chiselled face is smattered by light freckles, retaining a look of youthfulness and her large, pale gold eyes are ringed with shadows, making her already intense stare seem intrusive.\n\nZulzi is all things that suggest her spiritual persuasions; intricate enspelled tatau markings decorate her body, obscure trinkets and items of power are bound to her belt, magnificent trims in the form of vibrant feathers frame her crown and spider motifs in veneration of her loa are present all about her. \n\nNo effort was spared to ensure her proclivity for voodoo was made abundantly clear.{/col}",
