						["TX"] = "Niohmi stands at average height, has amber eyes and a white pelt which fades to a deep gray colour around her hands and feet. Around her eyes are natural markings that take the form of singular stripes that run from her forehead to the start of her snout.\n\nHer outfit is something truly tribal, made with Alpaca leather and wool, Saurid scales and left over bones scavenged from around her home. She has a necklace that has a single emerald set in, adorned with teeth.\n\nHer weapon of choice is a staff, lovingly crafted from scuttled oak and is solidly built. Though often when the need calls for them, she is in possession of a pair of beautifly adorned axes.",
