		["0521191037FmkXL"] = {
			["character"] = {
				["CU"] = "Standin' guard.\nEasily distracted.",
				["CO"] = "Walk up an' whisper if ya want, more then open to start some trouble, unafraid to start a story",
				["RP"] = 1,
				["LC"] = "enUS",
