				["T2"] = {
					{
						["TX"] = "Art:\n{link*https://cdn.discordapp.com/attachments/427179910998523924/748151487091441684/20200826_140015.jpg*Quick Sketch}\n{link*https://cdn.discordapp.com/attachments/427179910998523924/748232474500268062/Capture_1.jpg*Another sketch}\n\nLinks:\n{link*https://www.youtube.com/watch?v=hJdF8DJ70Dc*Important}",
