					{
						["IC"] = "spell_frost_summonwaterelemental",
						["BK"] = 1,
						["TX"] = "{col:ffffff}Carefree at the sea.{/col}\n\nTahkeome is no stranger to faring all kinds of seas around Azeroth. Mostly on his own, with a strong will for adventure he often ventures in search of new fishing routes, often coming across various islands.\nGive this seemingly gentle tauren some ale, and for sure you'll be graced (or cursed) by many tales this one has to share. \nThe shu'halo is a chatterbox by nature, though without the grace his kin usually speak in. Tahkeome is rather blunt and often times gesticulates a lot when speaking.\n",
					}, -- [2]
					{
						["TX"] = "{col:ffffff}The blonde wonder{/col}\n\nThere is nothing remarkable about this tauren, if anything he seems to be somewhat thinner than the usual standard. His body is lean rather than the brawn his kind is associated with. It goes without say that he is still a tauren and does have a certain kind of preseance around him. He still rather seems to be emitting a rather calm and carefree kind of vibe.\nTwo things that are always constant though are his uneven horns and long fringe that completely covers his eyes. \nHis coat is pale by nature but it's been aditionally bleached by the salt and sun that he's exposed to.",
