			["time"] = 1603411318,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Appearance{/h1}\n\nWith a tall and lean frame, Soren is evidently well exercised, which would display the sheer focus he puts into his training. Brunette hair, cut much shorter than many of his bretheren, often rests above a scarlet bandanna which might adorn his forehead. Furthermore, glimmering golden eyes show his connection not only to the Sunwell, but to the Light as a whole.\nSoren often wears chainmail or light plate armour, making obvious to onlookers his path in life, as well as a tabard displaying the pride and solidarity he shares with his people- either by blood or by battle.",
						["BK"] = 1,
						["IC"] = "ability_paladin_beaconoflight",
					}, -- [1]
					{
						["TX"] = "{h1:c}Personality{/h1}\n\nWhile soren is generally amicable to be around, with an excellent sense of humour and healthy ability to take the brunt of jokes, he can be somewhat frustrating at times. Not only has he the strange talent for losing common sense or better judgement, sometimes to the point of naiveté, he is also clearly in love with both himself and the Light- a trait which he often makes known within at least the first few minutes of a discussion.",
						["BK"] = 1,
						["IC"] = "ability_paladin_gaurdedbythelight",
					}, -- [2]
					{
						["TX"] = "{h1:c}History{/h1}\n\nSoren's history, like all Sin'dorei, is greatly tethered to the scourge's rampage through Quel'thalas.\n\n While beforehand, Soren might have had more of a life of his own, and planned to settle down with his partner Larynah, he has since yet been searching for his own purpose in life. \n\nFinding little solace in vengeance, neither in becoming a Blood Knight or  an Argent Crusader, Soren now attempts to carry on his late partner and best friends' goal of discovering more of the Light and how other cultures began their faith within it, and make up for the hole that was left by her passing.",
						["BK"] = 1,
						["IC"] = "inv_misc_tournaments_banner_bloodelf",
					}, -- [3]
					{
						["TX"] = "{h1:c}Abilities{/h1}\n\nSoren has a strong connection with the Light, and has been trained in the ways of martial uses of it. While he can smite, judge, and protect like any Paladin can, Soren does try to focus now on sharing the same blessings that the light provides him. Soren is also able to emit a variety of auras, which would provide useful effects to those around him.\n\nSome auras include:\nCrusader's Aura: fortifies the stamina and strength of his allies' living mounts.\nDevotion Aura: shares his devotion of the Light, allowing recipients to be greater resistance to all harm.\nConcentration Aura: steels the will of his allies, improving their defences against mental attacks and interrupting effects.\n\n\nSome blessings include:\nBlessing of Protection: shields the target from any and all physical harm for a short time.\nBlessing of Might: allows the target's attacks to sear undead and judge the guilty with the strength of holy energy.\nBlessing of Wisdom: stimulates the blessed's mind with holy light, relaxing it, and imparting on them greater wisdom and mental acuity.\n",
						["BK"] = 1,
						["IC"] = "spell_holy_greaterblessingofkings",
					}, -- [4]
				},
