			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "{h2:c}{icon:racial_orc_berserkerstrength:25}{/h2}\nAt first glance, it becomes obvious that Gutgrinder has very little regard for peace and quiet, as his body is covered in mostly dead scar tissue, burn marks, cuts and bruises and scars of all source. Not a pleasant sight in the least.\n\nWith a fit and muscly physique, he has the perfect body built for an avid brawler/fighter.\n\nHe was born with bone density that much higher of an average orcs, and when his wrist was supposed to be cut off to replace his hand the first 3 attempts failed, the decision stayed that his hands -are- the weapons and no further attempts were made.\n\nAnyone unfortunate to have a glimpse on his face would spot the disturbing detail about both his facial hair and hair, they've been torn off by force, and his face has slightly deformed from all the beating he've received, again covered in bruises and scars of various sizes. \n\n\nHe is a masochist to the core.\n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "{h2:c}{icon:spell_shadow_brainwash:25}{/h2}\n\nPhysically strong, but mentally dull witted - Gutgrinder is unable to both write or read any language, it havent helped him much for being beaten up in the head few too many times...\n\nOften slow to reply, he struggles at speech as his vocabularity is shallow. \n\nBut even when he might be considered stupid by many, he does understand fighting and often displays smart and quick witted strategies in combat with baiting the opponent into striking first or dodging before the attack has been made.\n\nHe is violent when in combat, but even so he has a sweet spot in that dim mind of his. And there have been rumors he've been able to pet little birds, chasing butterflies and other very \"not orcish\" things, like fishing with no bait and no hook.\n\nHe especially shows affection to his pet rock, but apart from that he is hard to read.\n",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "-Heavy Wip-\n\nAt a very young age before names were given (Not an infant, just a child who havent done any feats of significance yet, and being a slave was no good either.) Gutgrinder was forced to fight in an arena against others of his age, for everyones dissapointment he dropped his weapon at first unwilling to fight anyone. \n\nSeen as a sign of cowardice and weakness, he was seen as easy picking. But for everyones surprise as soon as he was inflicted with pain he went into berserking state - this has never been seen before, as he lived day by day in apathy, barely spoke or did anything.\n\nShockingly, he beat all his peers to a bloody pulp with nothing but his bare fists, showing extraordinary strenght while the crowd simply cheered \"Gutgrinder Gutgrinder!\"\n\nAfter that his life has been nothing but one challenger after another, and when the orcish slaves grew weary and rebelled, he was unable to cut his own hand due to his extraordinary bone density.\n(Honestly, give us permanent fist weapon choiches so i dont have to make this horseshit up)\n\nEventually he found his way to Azeroth among other Mag'har. \n\nThis new world is confusing with its \"unlikely\" orcish traditions and new races, being a rather dull witted orc instead of him adapting he spends most of his days lurking around Brawl'gar arena fighting new opponents.\n\n\n\n",
						["BK"] = 1,
