				["PE"] = {
					["1"] = {
						["IC"] = "inv_misc_pelt_13",
						["TI"] = "Mane:",
						["TX"] = "Isaiah's best feature may very well be his mane. \n\nIt stretches skyward before falling sideways in an elegant curve.\n",
						["AC"] = true,
					},
					["3"] = {
						["AC"] = false,
						["TI"] = "Dawn's grace. ",
						["TX"] = "Isaiah is an avid follower of the Light and its teachings.\n\nHe may effortlessly call upon its power, but still struggles when it comes to applying it to certain spells. \n\nHe has little rapport with puritan Sunwalkers, whose power he believes is synonymous with the Light; a parable which they often aren't too keen on. ",
						["IC"] = "ability_priest_ascendance",
					},
					["2"] = {
						["AC"] = false,
						["TI"] = "Bad habits:",
						["TX"] = "When his nerves get the better of him, Isaiah often lights a smoke.\n\nAs he is prone to daydreaming, Isaiah may appear inattentive at times.\n\nBeing somewhat vain, Isaiah tend to prioritize looks over functionality. \n\nFor a Tauren, Isaiah is quite impatient and sometimes even a bit rude. \n\nIf you are in a position where you can order him around, Isaiah will almost exclusively act and sound like you are inconveniencing him.",
						["IC"] = "spell_nature_heavypolymorph1",
					},
					["5"] = {
						["IC"] = "ui_chat",
						["TI"] = "Conversation starters: ",
						["TX"] = "\n\n",
						["AC"] = false,
					},
					["4"] = {
						["AC"] = false,
						["TI"] = "The Cosmopolitan Bull: ",
						["IC"] = "inv_drink_22",
						["TX"] = "\nDue to his mother's long career in the Argent Crusade, Isaiah did not enjoy a traditional Tauren upbringing.\n\nSome may say he behaves and talks more like a human socialite than a Tauren. Even his attire bears testament to this. ",
					},
				},
				["v"] = 66,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{img:Interface\\QuestionFrame\\answer-PaladinProt:256:128}\n{h2:c}{col:FDFFBB}Isaiah Cloudsgale{/col}{/h2}\n\n{img:Interface\\PETBATTLES\\Weather-Sunlight:222:4}\n\n\n{p:c}Isaiah isn't much, if anything like his mother. \n\n\nUnlike Udina Cloudsgale, who endured excruciating campaigns against foes from Azeroth and beyond, Isaiah much prefer the easy life granted by nothing less than sheer nepotism. \n\nYet, despite all his objections... Udina now wills her son to take on a more active role in steering his life into the right direction, and finally confront his carefree ways with grit and diligence!   \n\nAs a result, Isaiah is now a member of the prestigious {col:FFE383}Light Watch Order{col:ffd100} - a neutral aligned organization with ties to the Argent Crusade that is dedicated to protecting Azeroth and its denizens.\n\nAnd so, a new chapter of his life begins. \n {/p}\n\n\n{p:c}{col:ffffff}Isaiah Cloudsgale:{/col}{/p}\n{p:c}{link*https://imgur.com/a/9pqN8fJ*Gallery}{/p}\n{p:c}{link*https://www.youtube.com/watch?v=3O1_3zBUKM8&ab_channel=NaughtyBoyVEVO* Song ref }{/p}\n\n{p:c}{col:ffffff}Crusader Udina Cloudsgale:{/col}{/p}\n{p:c}{link*https://i.imgur.com/zFHfme5.png*Portrait!}{/p}\n\n{img:Interface\\Pictures\\artifactbook-priest-lightswrath:512:256}\n\n\n{h3}{col:FDFFBB}{icon:inv_helm_plate_raidpaladinmythic_q_01:28} -  Appearance:{/col}{/h3}\n\nIsaiah is built for the buffet rather than the battlefield.  \n\nHis upper body displays the most signs of exercise, the rest has not enjoyed quite as much effort.\n\n- Overall, he is smaller than an average bull but slightly larger than an average heifer. \n\nA short, wild beard outlines his chin and jawline. \n\nHis eyes are large and heavy-lidded.\n\nHas no visible scars aside from a small notch in his left ear.  \n\nIsaiah's coat is remarkably well maintained.  \n\nHis hands are smooth, they do not seem to have experienced much, if any, manual labour. \n\n\n \n\n{h3}{col:FDFFBB}{icon:ability_paladin_empoweredsealstruth:28} - Weapons and armor:{/col}{/h3}\n\nIsaiah's weapon of choice differs depending on the task at hand, however, he does seem to have a fundamental grasp of the most common weapon types.  \n\nA hefty tome is chained to his armor, its gilded cover depicts writing in the Common tongue and is decorated with runes and red wax sigils. \n\n\n\n\n\n ",
						["BK"] = 1,
						["IC"] = "ui_rankedpvp_03_small",
					}, -- [1]
					{
						["TX"] = "\n{h3:c}{col:FDFFBB}OOC:{/col}{/h3}\n\n• I use {link*https://www.curseforge.com/wow/addons/listener*Listener}  to keep up with text in large crowds, so it helps if you target me while addressing my character - or simply use their name!\n\n• ADD debuff. \nIf I go quiet = doesn't mean I am disinterested. I am probably just processing, reading or spacing out. In large battle events, expect me to miss some turns.  \n \n\n• I use {link*https://www.curseforge.com/wow/addons/total-rp-3-extended*Total RP 3: Extended} for custom made items. If you have questions surrounding it, I can give some advice. I mainly create gear / tomes / fliers / food & trade goods. \n\n\n\n{img:Interface\\PETBATTLES\\Weather-Sunlight:412:3}\n\n{h3:c}{col:FDFFBB}Guild Recruitment:{/col}{/h3}\n\n{p:c}Petty faction politics getting you down? Interested in fighting evil forces who seek to destroy all life on Azeroth? Opposed to genocide of factions that can be negotiated with? \n\nThen perhaps {col:FFE383}The Light Watch Order {col:ffd100}is your cup of tea.\n\n{link*https://www.argentarchives.org/node/60095*Link to more information!}\n\nGot questions? \n\nWhisper me! \n {/p}\n\n",
						["BK"] = 1,
						["IC"] = "tracking_warboard",
					}, -- [2]
				},
