				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Rahkira Bloodrinker{/h1}\n\n{link*https://imgur.com/a/rfvSfG4*Art}\n\n{h3:c}Appearance{/h3}\n\nRahkira stands tall for an orcess, making her stand out more in groups. She is visibly aged, her skin both heavily scarred and wrinkling. Despite her age, she mantains a strong physqiue. \n\nHer greyed violet hair reaches down towards her hips when untied and is decorated with various small bones. Currently, she has tied her hair back into a long ponytail, displaying the shaved sides of her head. Attached to the leather band holding her hair back are four large orange feathers. \n\nThe right eye of Rahkira is a fiery shade of orange while the left has been removed. There is little scarring left around the left eye, perhaps indicating it was carefully removed at some point. She does not conceal the remaining eyesocket, leaving it for all to see. \n\nJutting out from her lips are two sets of very long, sharpened tusks. \n\nPainted on to Rahkira's skin is a thick layer of white warpaint, the pattern is fairly inricate in design consiting of a mix of lines and small decorative dots.\n\n{h3:c}Jewellery{/h3}\n\nRahkira's ears hold a few piercings, two small pieces of bone pierce through the top of both of her ears. While stretching her ear lobes are two large fangs. \n\n{img:Interface\\QuestionFrame\\answer-Tanaan-ZethGol:256:128}\n",
