					["TX"] = "{h1:c}First Impressions{/h1}A peculiar Sin'dorei who is unfitting with others of his race. He has an extremely messy appearance as well as a style of speech that would be foreign on the streets of Silvermoon.\n\n{link*http://www.argentarchives.org/files/imagecache/gallery_main/gallery_image/D59EE544-3FC3-4167-8810-5E007852D532.jpeg*Art}\n\nHis hair is a short, unkempt mess, and he supports a branding scar down his left cheek that zig zags creating a \"W\". His eyes are notable for glowing less fel-green than other Sin'dorei which hint at a lack of fel usage, and he carries a silver ring that hangs from a piece of string around his neck.\n\n{img:Interface\\Calendar\\Holidays\\Calendar_HordeWarCampaign:128:128}\n{h2:c}Combat Experience{/h2}\"Thorn\" has spent his combat years working for numerous organisations as a scout,assassin and quick fighter. His skills have been utilised by many a warband under the Horde, however it is noted that he doesn't seem to stay with one unit for long.",
