				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-classic-Silithus:512:256}\n\n\n{h1:c}{col:ff0800}\"Fuck you looking at me for? Find someone else to stare at.\"{/col}{/h1}\n\n{h3:c}Laezel, an abrasive and argumentative young \"monk\", a clear problem with people who wish to tell her what to do. Her strong form and stare bring forth tha assumption she's used to fighting, professionally or otherwise. Her attire suggests she's a monk but to others it may be a tad difficult to formulate that idea by her brash and aggressive nature.{/h3}\n\n{h1:c}{col:ff0800}How She Came To Be{/col}{/h1}\n\n{h3:c}Born to Sin'dorei and human parents, Laezel found a small portion of her time within the Cenarion Hold, being shipped away however once it became too dangerous for a child to be around, which you can imagine was fairly soon.\n\nLaezel was sent to a school, confused as of why her parents didn't wish for her to be with them. Such a school taught the discipline to fighting and the importance to keeping knowledge. Laezel was a student of great promise but fell to her own emotions, refusing to conform to the strict and restrictive nature being placed upon her by the school, ultimately becoming an \"agent\" for the school. (A poor excuse to make the poorly achieving students learn some \"life lessons\"){/h3}\n\n{img:Interface\\QuestionFrame\\answer-warboard-classic-Duskwood:512:256}",
