		["[MSP]Zekalkhan-ArgentDawn"] = {
			["character"] = {
				["CU"] = "Listening to the world go by with a slightly scrunched up face, trying to make out the blurry shapes around him.",
				["CO"] = "Taxi Dino! Feel free to hitch a ride, let me know where you need to go. Open for this in dungeons, as well. Just hop on!\n\nLeveling. Slowly.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 1,
				["v"] = 55,
			},
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 1,
					["5"] = 1,
					["4"] = 1,
					["6"] = 0,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Modest Man [Appearance]",
						["TX"] = "Unlike a majority of other Zandalari Trolls, Zekal'khan lacks the money to have his clothes properly repaired, let alone the money to snag himself some fancy threads, and instead wears the easiest to repair with a simplistic sewing kit clothes he can find.\nThough not ugly, it doesn't exactly scream.. \"Zandalar Forever!\"\n\nWhile one eye remains covered by a crudely made patch, crafted from leather from an old pouch, the visible one is darkened and dull, another sign of many years of battle and mistakes. He is mostly blind, unable to see as good far away as he does up close. For this reason, he mostly relies on his hearing in combat and travel.\n",
						["IC"] = "inv_pants_leather_07",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Limpin' Along",
						["TX"] = "Zekal'khan relies on a staff always at his side for easier travel that glows a beautiful gold, blessed by a Priest before taking his leave from Zandalar, having suffered an injury many years ago that left his right leg permanently screwed up.\n\nIt doesn't affect him as much as he makes it out to, but it's always nice having the upper hand.\n\nOne will also notice he's always walking just a tad bit slower than others, and needs extra breaks now and again.",
						["IC"] = "inv_staff_21",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Worn, but not very old",
						["TX"] = "He keeps himself looking as proper as he possibly can, as he retains at least a smidge of pride, but he's nowhere near as prim as he should be.\n\nHe's worn from his travels from head to toe, with scars and bruises and scrapes littering the surface of his skin.\n\nBut he seems to love it.",
						["IC"] = "achievement_profession_fishing_oldmanbarlowned",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Words of the World",
						["IC"] = "vas_namechange",
						["TX"] = "Thanks to years of travel, Zekal'khan can speak words from many different lands, but has difficulty with certain terminology, and can't speak all of them.\n\nHe tends to forget some words from his own land, and will jump back and forth from using various terms.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "What's with the hair?!",
						["TX"] = "His hair is a horrible mess, filled with dirt and sticks and leaves.. Everything you'd find in nature.\n\nBesides that, his hair is starting to go white in certain spots, really showing his aging.\nThough he tries not to bring attention to it, it's distracting enough.\n\nThough he'll joke that \"years of frights make ya hair stand up, mon\".",
						["IC"] = "inv_misc_nativebeastfur",
					},
				},
				["v"] = 39,
			},
			["time"] = 1603141422,
			["link"] = {
				["Zekalkhan-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "\n\n\n\nEverything featured here is a WIP, and parts are subject to change!",
						["BK"] = 1,
						["IC"] = "vas_guildnamechange",
					}, -- [1]
					{
						["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:512:256}\n\n[Brief History]\n\nZekal'khan was born into a small family of merchants, in the heart of Zandalar, many years ago.\nFor most of his life, he lived in the lap of modest luxury, and never wanted anything. When he became a young adult, greed consumed him after the loss of his parents to an unfortunate raptor swarm while traveling.\n\nHis greed drove him to scour the entirety of Zandalar, searching for any gold and valuables he could find, hoarding it all like a demented dragon.\nIt was only until he met the love his life that he awoke from his greed infested nightmare, and learned to enjoy returning to the life he'd once had.\n\nThings went well, or.. As well as they could for someone who was basically a gold addict being surrounded by gold yet again.. And Zekal'khan recovered himself many years later with the help of his love.\nBut apparently, by some cruel magic, he's not exactly favored when it comes to luck.. After the loss of his love to an unknown blood disease, he set off to find a different place in the world. Perhaps even a possible cure for what took his love.\nHe's been traveling ever since.\n\n[This also applies in dungeons! No need to ask for a ride, just go for it ^^]\nAs a small time money making job, Zekal'khan provides a service he calls \"Da Dino Taxi\", allowing folks to ride on his back to places they otherwise couldn't get to or were too lazy to walk to, for a very modest price.",
						["BK"] = 1,
						["IC"] = "inv_misc_book_09",
					}, -- [2]
					{
						["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:512:256}[Additional information]\n\nAs a result of his untreated.. Past experiences, Zekal'khan is pretty closed off, offering few words when spoken to and will rarely do a task without a reward, but is more open once he's got a bit of the fine mojo in his gullet.\nThough he offers a warm smile when he can.\n\nWhile he was still young and living in Zandalar, he took an interest in the concept of Druids, but after the loss of his parents, and his descent into a gold based greed, he completely forgot about his interest.\nAfter the loss of his love, he chose to return to his studies to become stronger and travel the world. He takes comfort in the scale soaked forms, and prefers to lounge about in them.\n\nHe's not very old, but stress and a lack of care has begun to turn his hair slightly white. If this keeps up, he'll wind up having hair whiter than snow.\n\nThough his homeland is not a place he visits often, anymore, he still feels pride being a part of the Zandalari Empire, and wears the insignia proudly on his chest.",
						["BK"] = 1,
						["IC"] = "inv_misc_book_03",
					}, -- [3]
				},
				["BK"] = 3,
				["TE"] = 2,
				["v"] = 21,
