						["TX"] = "A tall, strong and muscular Zandalari, with a body fit for both strenght, agility, endurance and the ruthlessness of the wilds, his torse, toned, with a broad chest, his stomach toned showing clear defined abs upon it. Both his upper and lower arms would muscular, along with his legs, which is both built for agility and running. His skin, would be slightly darker gray than appearing upon his character model.\n\nHe would gaze around with light blue eyes, his face stern, and his tusks large, yet the right one, missing its tip.\n\nHe would often be seen, proudly wearing his Zandalari equipment as he would wander through any place outside of Zandalar, along with his bow and at each side of him.\n\nMost obvious scar upon him, which hasnt fully healed by his regenerative trait, would be a long scar from the lower of his right shoulder, down across his chest close to where his stomach would begin, likely from one of his dinosaur tamings.\n\nFiercely loyal to the Zandalar throne, ready and eager to fight to the death for Zandalar and the allies of the Horde.\n\n(( WiP May change a few things. ))",
