				["Kheenah-ArgentDawn"] = 1,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{link*https://www.youtube.com/watch?v=lf6gcBoj_38*Voice reference}\n\nOf average height for a Vulpera, which is to say pretty small by most races' standards. \nScruffy and uneven short red fur, showing the hardships of the nomadic lifestyle, yet does not smell as if dirty. \nDamaged ear and multiple burn marks, likely from corrosive venom.\n\nMultiple coloured braids dangle from her clothes, made from dyed alpaca wool\n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Ascetic and generous with her allies due to the survivalist lifestyle of Vol'Dun, if not outright motherly. \nUneasy with attention, will tend to close off and try to slip away if too much is given. \nIf something is not bolted down and looks unattended, she WILL yoink it. \n\nExtremely vicious and feisty with her enemies, not hesitating to indulge into torture or abuse, both magical and physical. \n\n{link*https://youtu.be/jZ29ieE2NLE*Combat theme : DOS2 OST - Symphony of the Void}",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "{link*https://www.youtube.com/watch?v=ezAB4fF4u9w*Theme song : Runescape OST - Elder Daughter}\n\nBorn in the harsh climate of Vol'Dun, Kheenah has spent all of her life as any Vulpera would ; going from burrows to hideaways, running caravans, and scavenging all the sands had not yet swallowed. At any stop, she never failed to entertain her comrades and siblings through tricks and allegedly reading the future in the movements of grains of sand.\n\nHer affinity with Light and Shadow, the Sun and the Shade as she called them, came at a young age from her desire to improve the life of her kin. And through them did she come to earn the title and nickname of \"Cinderclaw\", calling to her fiery fur, the smothering embrace of her shadow, and the scorching rays of her light. \n\nWith the arrival of the Horde on Zandalar, she delighted in turning the tide on the Faithless alongside their temporary allies, and she even came to share their distaste for the Alliance when they started to persecute her people. Needless to say, after the Vulpera were welcomed into the Horde, the armistice did not sit that well with her. ",
						["BK"] = 1,
					},
				},
