				["BK"] = 5,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\nIllethiann, with his impeccable, well-groomed appearance, is the epitome of Sin'dorei grace. His straight-backed, proud posture, coupled with his impassive stern-ness, makes him difficult to read. Nevertheless, there is an air around him that sets him apart from other noble elves. It may be the way his expression lapses and becomes distant and dreamy, on occasion. It may be in the details of his robes, or the accessories he dons, or the precise elegance of his every movement, that is less reminiscent of a typical blood mage and tactician, and more that of an artist.\n\nHis long hair is usually styled in a top-knot. His eyes possess an intense, fel green glow, lined with long dark lashes. A single straight scar traverses the top of his left brow down to his cheek, as if made by a weapon slash. Regardless, it takes nothing away from his well-sculpted, ageless, facial features.\n\nHis voice is a deep, slightly husky bass. His tone of voice is as formal as his demeanour. His laugh - should he laugh - is deep and rich.\n{img:Interface\\TALENTFRAME\\bg-mage-fire:512:512}\n\n\n\n\n\n\n\n\n",
