						["IC"] = "inv_legendary_gun",
						["TX"] = "Millie never went anywhere unarmed. Carrying a revolver upon her hip, and a rifle slung over her shoulder. She was skilled with a gun, that much was for certain.\n\nShe was left-handed. Both her Revolver and her Rifle had a pecular indent near the trigger, covered by her hand while shooting.\n",
