						["IC"] = "inv_helm_cloth_shadowmoonclan_b_01",
						["TI"] = "Attire & Equipment",
						["TX"] = "Myroh is often seen with his a hood protecting him from the weather.\nHe's commonly clad in airy, purple silks.\n\nMyroh rarely carries weapons bigger than an ornamental staff, with the occasional dagger thrown in the mix.",
						["AC"] = true,
