					["3"] = {
						["IC"] = "inv_offhand_1h_nazmirraid_d_01",
						["TI"] = "Myroh's Mystical Tome",
						["TX"] = "A thick, gold-bound tome rests on Myroh's side, adorned by a blue gem.\n\nIt's weatherproof & in perfect condition.. albeit messy. Many new pages have been added over the course of the years, containing his compiled knowledge.",
						["AC"] = true,
					},
					["2"] = {
						["IC"] = "inv_trinket_80_zandalrari02b",
						["TI"] = "Trinkets & Jewelry",
						["TX"] = "Various baubles adorn his person.\n\nEven his ears are decorated with golden rings, tufts of feathers, and an ancient Zandalari gold coin. It's enchanted!",
						["AC"] = true,
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Specials (player-given!)",
						["TX"] = "An inky black feather is tucked by his vest's front pocket. It shimmers with oily shades of purple and blue. Enchanted!\n\nA carved vulpine mini-totem hangs from his neck. It radiates with the heat of a minor fire-sprite. Cozy in cold climates!",
						["IC"] = "ability_racial_vulperasurvivalkit",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Vials & Pouches of 'Dust'",
						["TX"] = "Vials and pouches line the vulpera's belt, all filled to brim with coloured dust.\n\nThe pouches themselves are remarkably ornate with various patterns. Pretty!\nSome of them smell suspiciously spicy..",
						["IC"] = "achievement_guildperk_chug a lug_rank2",
					},
				},
				["v"] = 77,
			},
			["time"] = 1603142359,
			["link"] = {
				["Myroh-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 81,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-VindicaarCrystal-ShroudofArcaneEchoes:256:128}\n{h3:c}{col:ffffff}{link*https://imgur.com/gg4clsh*Myroh, Master of Mirages}{/h3}\n{img:Interface\\QuestionFrame\\answer-warboard-wotlk-Dalaran:512:2}\n{p:c}{col:E791FF}Mystic, mirage-maker, mage, Myroh has many monikers.\n\nHe peddles in hand-crafted goods, flaunting his wealth and craftsmanship openly with the dazzling array of shiny glass trinkets and beads that he wears on his person. He's awfully ostentatious for a 'humble' vulpera.\n\nA pair of shrewd, darkly-lined eyes glimmer with a lovely shade of sky blue under his hood, smaller-than-average ears poking from the holes he's cut on the fabric. They twitch attentively to any sound around, curious and alert.\n\nMyroh's coat has a sandy tone to it, dense but silky smooth fur covering him from head to toe without a scar in sights. His clear pride and joy is the fluffy tail of his, long and soft as a pillow. Whenever he walks, he makes sure to keep his tail raised, never touching the ground. He's definitely a bit.. vain.{/p}\n\n{img:Interface\\QuestionFrame\\answer-warboard-wotlk-Dalaran:512:2}\n\n\n{h2}{col:E791FF}RP hooks & character tidbits{/h2}\n{col:ffffff}- Lived near the Whistlebloom Oasis with his family\n- Always had access to water, food, etc, 'fancy noble vulpera'\n- Spent time with the Tortollans at Tortaka Refuge\n- Hoarder of texts and knowledge, has stolen magic stuff\n- 'Mirage-Merchant', has sold illusion trinkets made of glass\n- Occasional visitor to the Zocalo and Zandalari markets\n- Rumoured to be favoured by Jani, possible follower?\n\n{h3}{col:E791FF}OOC info & RP style{/h3}\n{col:ffffff}- Lighthearted roleplay mixed with heavier story aspects\n- 'Slow burn', takes time to warm up!\n- Open to past acquintances / friends for connections\n- Relationship RP is not a priority, sorry!\n- Flourishes in small groups, big crowds are scary\n- Appreciates spontaneous adventures\n\n\n\n{img:Interface\\QuestionFrame\\answer-warboard-wotlk-Dalaran:512:2}\n",
				},
			},
