						["TX"] = "A recent acquired taste in cologne and Nero's current choice:\n\n\"A popular choice among connoisseurs. The strongest notes in this sweet and woody scent are pineapple, birch and musk. It provides with a mature and masculine scent, without being over-powering.\" - Excerpt from Real Goblin, Real Style Magazine.",
