						["IC"] = "inv_jewelry_ring_07",
						["TX"] = "Pierced ears. A silver ring in each lobe and two small, black studs in the upper part of his left ear.\n\nHe wears a silver ring shaped into a skull, as well as a silver ring with a black diamond on the fingers of his right hand.\n\nHe wears a black, metallic engagement ring with a bizarrely prismatic gem in blue-ish black sitting on top in the shape of a sphere, worn on his engagement ring finger.\n\nA locket hangs around his neck.",
