				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://eu.forums.blizzard.com/en/wow/t/h-rp-the-family-and-companies-open-for-business-criminal-guild/49002*Bar Menu & Shop Stock}\n\nSomewhat taller than the average Goblin, Nero maintains a good physique. His green skin boasts a few scars here and there to compliment his rugged appearance - tattoos, even more so of which are plentiful:\n\n- A full backpiece with a hooded Goblin skull designed in a \"Grim Reaper\" fashion with two knives, the logo of the Dust Devils MC branch in Drudgetown.\n\n- Two skulls on his pectorals, decorated with additional roses and leaves.\n\n- A serpent that coils in between several skulls on and around his upper right arm, extended to connect with the tattoos on his right pectoral.\n\n- On the inside of his left forearm, the name \"Krystinne\".\n\nFrom the rougher parts of Bilgewater Harbor, Nero exemplifies the \"Outlaw Look\", with his raven black hair slicked back and a neatly trimmed, boxed beard. Likely in his late twenties with lively, crimson eyes and a crooked, cheeky smile that'd make the girl's parents love to hate him - or the opposite.\n\nHis ears are pierced with silver earrings, one in each lobe as well as a pair of black studs in the upper part of his left ear alone - seeing as the upper part of his right ear is missing.\n\nHe always wears a black, metallic engagement ring with a bizarrely prismatic gem in blue-ish black, shaped like a sphere, on his engagement ring finger.\n\n\n\n{p:c}\"Some call me a renegade, the enemy.{/p}\n{p:c}Throw your hands up if you feel the same.\"{/p}\n\n\nOne weapon of choice is a handgun made out of stainless steel; the appearance brushed chrome. 6.0'' barrel length, threaded to permit muzzle breaks, suppressors, etc. It is stored in a shoulder holster which he has a tendency to wear.\n\n{link*https://thefamiiy.enjin.com/*Interested in joining 'The Family'? - Applications Here}\n\n{link*https://eu.forums.blizzard.com/en/wow/t/h-rp-the-family-and-companies-open-for-business-criminal-guild/49002*Forum Post Here - Information}\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nNote:\n\nI have been made aware that someone uses the Neeroz \"Nero\" Grimshiv name on suspect sites, and impersonates the character. I do not utilise any of the sort, nor does the content of this imposter reflect any of my thoughts or interests.\n\nTLDR - That guy isn't me. That guy is disgusting.\n\n",
