					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:512:256}\n\n{h2:c}Physical Description{/h2}\n\nBahn'zala, a Zandalari Devotee, spending most of her time worshipping Hir'eek, even after his corruption and downfall. She stands at around the average height for most Zandalari trolls, so this usually indicates that she's rather tall, she also has a thin frame, which indicates her lack of experience in combat and other such roles, dedicating all of her time to worshipping the Loa and her Priest studies and duties.\n\nHer skin is a dark-ash like color, coating her entire body with small black patches of hardened skin across the shoulders, forehead and hands, this would follow different patterns for most Zandalari and all share the same patterned black skin across the body. From first glance her eyes are a beautiful shade of blue that would show similarities to High Elves in color, with the right eye being blue, and the other being a hazed gray, showing her blindness in one of the eyes.\n\nAcross the hands would be several scars that resemble slices from a blade, this would display blood offerings to her dedicated Loa, Hir'eek, who is renowned for primal blood-lust style instincts, and such has offered her blood several times as offerings to him.\n\n{img:Interface\\LFGFRAME\\LFGIcon-Zandalar:256:256}\n\n\n",
