				["T1"] = {
					["TX"] = "{h1:c}{col:ca0c23}Kuruk Son of Watahiki{/col}{/h1}\n{img:Interface\\QuestionFrame\\answer-AlliedRace-Highmountain:256:128}\n{h1:c}{col:ca0c23}Appearance{/col}{/h1}\n{col:307f58}Kuruk is Young Highmountain Tauren. He have casual horns but he decorates it with carved runes.  He have Healthy brown fur and green wild eyes. He usually wears a simple loincloth. He attaches oak trunks to the shoulders. The entire Garment is covered with feathers and amulets.{/col}\n\n{h1:c}{col:ca0c23}History{/col}{/h1}\n{col:379f58}Kuruk is a druid who has mastered the form of a bear to perfection. He was helped in this by the spirit of the ancient bear Galikun who live in Kuruk's body. After the ritual of summoning of Galikun, Kuruk was degreaded by elders. The ritual was illigal and very dangeours but Kuruk Had to do this to safe the nature from the legion. He found redemption in Vidar's clan where his uncle Tiquanna was trusted advisor.{/col}\n\n{h1:c}{col:ca0c23}Abilitties{/col}{/h1}\n\n\n{col:379f58}-Mele weapons    …/50\n-Range Weapons   …/50\n-hand-to-hand fighting,     50/50\n-Magic,      …/50\n-Bullying,     …/50\n-Will power,  30/50\n\n-Str,                50/50\n-Agi,    …/50\n-Int,    20/50\n-Observation    30/50\n-Languages   …/50\n\n\nHealing,        45/50\n-necroscopy,        15/50{/col}\n\n",
