					["1"] = {
						["AC"] = true,
						["TI"] = "Attire",
						["TX"] = "Edijaru's attire is tailored to provide protection, versitility, stealth and of course the most important part. Style. \n\nAlthough it is primarily leather armor, there are notable spots on the attire where Metal is provided to protect the vital areas of the body. Even then, the leather appears to be layed multiple times so its clear it offers decent protection in itself\n\nFrom the waist below, Edi has multiple pouches containing a variety of different tools, gadgets as well as basic stuff such as gold, small meat portions and so on. He is clearly well prepared for any kind of situation he gets himself into.\n\nEven after all of that, the armor provides a LOT of style to it with its well placed colours on each armor piece as well as the small details to give it that extra eye candy to look at",
						["IC"] = "inv_leather_raidroguemythic_s_01_helm",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Gauntlet of Gadgets",
						["TX"] = "Edijaru, ontop of everything else he has, has his gauntlet that provides a few extra tools forextra situations.\n\nFrom first glance, the only noticable thing is a ring. A ring that has the same coloured gem that his dagger has. Wether they are connected are not is not something that can be told from first glance but rather from asking Edijaru about it himself.\n\nWether or not he answers is also unknown",
