					["3"] = {
						["AC"] = true,
						["TI"] = "Bag of supplies",
						["TX"] = "Being a survival Master. Edijaru carries around a bag of supplies he needs to survive in the wilds. The bag pretty much has everything you can think off. Water, meat, rope, books of questionable tastes. Pretty much anything!\n\nIf you were to ask Edi for whatever, nine times out of ten he will pull out that item. He has pretty much anything for any situation!",
						["IC"] = "inv_misc_coinbag_special",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Weapons",
						["TX"] = "Edijaru has 3 main weapons. An Axe, a Dagger and a Bow. Each providing different uses for different situations. \n\nHis Axe and Dagger are his melee weapons. Although there have been a few times where Edi has used both, he usually uses one weapon at a time since he often uses the Axe with two paws for extra slashing power. His dagger is more for quick follow up attacks or as a means to throw it to either get in a hit at the start of a fight OR to cause a distraction. The dagger seems to have some kind of Gem insterted into the hilt that glows slightly.\n\nHis bow is well... A bow. Its used for ranged attacks from afar. Its however specifically designed for medium to close range. With its easy to draw string it can be used for quick attacks if he can't use his melee weapons",
