				["TE"] = 1,
				["T1"] = {
					["TX"] = "Lokria is just Ghrik in disguise who is a short, frail example of an orc; clearly a runt from the very first sight. Most of her body is underdeveloped, particularly in terms of strength; looking like she could have trouble wrestling an average human girl around her age. \n\nAlchemcally dyed hair, the sides of her head shaven. Her face is youthful, with a small nose, somewhat narrow eyes, thin lips and teeny-tiny tusks at the corners of her mouth.\n\nThe rest of her body is what really makes her stand apart from the more muscular and healthy orcs. Almost everything is narrow, thin, lithe; but actually not looking to be from malnourishment; although most could say she should eat more anyway. \n\nHer physical traits won't impress many, but nor does it carry with it anything ugly by normal standards. Her runtiness has left her short and weak, but somewhat fair for those less concerned about physical prowess. Her clear green eyes betrays some intellect, perhaps she's making up for her lacking strength with something else.\n",
