			["about"] = {
				["v"] = 2,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ffb69a}Often clad in a mantle and an imp-skull adorned loincloth, this tauren bull might well be attributed as a shaman. Blue and red tattoos cover parts of the bull's upper body, mostly decorative or accentuating his features.{/col}\n\n{col:ffb69a}Beneath the mantle is a shaggy-furred, lean tauren of brown belly and black coat. He's clearly not one for appearances, hairs of his fur often standing on end or in tufts, uncombed. Mane often droops over his head, covering his eyes in large part.{/col}\n\n{col:ffb69a}He doesn't stand tall for a tauren bull of maturity, perhaps a touch smaller than average at a rough nine feet and eight, but his build is athletic and trained, with a good degree of muscle; This gives him the apparent look of a warrior of some measure, or perhaps a brawler as the sharp knuckles resting in sheaths on his belt suggest.{/col}",
