			["about"] = {
				["vote"] = {
					[2230672592] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://imgur.com/a/4PFmGXF*Portrait by me!}\n\n{link*https://imgur.com/a/P6jAkqR*Whole Body but way less detailed}\n\n{link*https://imgur.com/a/Xlce1cL*Sketches and unfinished pieces} (To be updated)\n\n{link*https://www.youtube.com/watch?v=JVsuPsM1-ZE&feature=youtu.be*Rude - Forever Lotus} - Theme song (Because apparently it's cool to have one these days)\n\n{link*https://www.argentarchives.org/node/225556*Kindred Spirit Cocktail Menu and Blood and Water Stock List!}\n\n\n{h2}General Attributes{/h2}\n\n{col:2aa876}Kylerane is a character beaming with energy and emotion. Any monk could tell about her Chi, and a sign of discipline within. For one who channels the mist to heal anyone suffering, she's been taught the selflessness of helping at the price of her own life energy. Her gestures and energetic personality often resemble her mood, hence she can be easy to read in these circumstances.\n\nTrained under the wisdom of Yu'lon, the Jade Serpent, she takes all teachings at heart, and holds them dear to herself, for they shaped her for what she is now up to this day. Her fighting style obviously resemble those of a mistweaver's.\n\nWhenever speaking Orcish or Thalassian, there is a weak, but noticeable Pandaren accent following through every sentence.\n\nHer body is well trained, and she does keep an active lifestyle to maintain it as such. One could say she might even be passionate about that, which makes her far from the usual feminine figure most of the time.{/col}\n\n{h2}Yu'lon's teachings and the Journey of the Mistweaver{/h2}\n\n{col:2aa876}Trained under the wisdom of Yu'lon, the Jade Serpent, she takes all teachings at heart, and holds them dear to herself, for they shaped her for what she is now up to this day. Her fighting style obviously resemble those of a mistweaver's.\n\nAfter several years of training, she is ready to take her rightful title of Mistweaver. Pursuing the trials under Master Hyu'ji Jadesong's guidance, she takes the test to prove herself and the skills she's been taught up until that moment. Upon succeeding, Kylerane is given the staff she gets to hold today; the ironwood infused with the Chi make a powerful ally against steel or can grant her the vitality whenever she seeks it most to heal her allies. Among other students alike in the Temple of the Jade Serpent, Kylerane is known for becoming the next follower of Yu'lon.{/col}\n\n{h2}Inventory{/h2}\n\n{col:2aa876}Medical Supplies: Surgical gloves, surgical masks, syringes, suture kit, injecting needles, scalpel, scissors, forceps, bandages, clamps, intravenous cannulas, tubes, tweezers, splint, oxygen mask, gauze, cotton balls, tourniquet, thermometer, stethoscope, aneroid sphygmomanometer, band aids, tape, small knife, clinical swabs and tubes.\n\n\nMedicine: Anesthetic (localized), activated charcoal, Betadine (povidone-iodine), painkiller (ibuprofen / acetylsalicylic acid), antiemetic flask, hand sanitizer, disinfectant, sterile saline solution, ointment (burns, irritations), salve (wounds), distiled water, isopropyl alcohol.{/col}\n\n\n{h2}Ring Details{/h2}\n\n{col:2aa876}Kylerane wears a dark, metallic ring, probably shaded silver, inlaid with jaded fillings polished to a spit shine for contrast. The ring resembles a wind serpent coiled into a circle, and holding a flawless ruby with a burning ember captured within the gem, in it's mouth.\n\nIt's safe to assume she takes good care of it and makes sure to keep it safe. A piece of jewelry with high sentimental value.{/col}\n\n\n{img:Interface\\QuestionFrame\\answer-warboard-mop-JadeForest:512:256}\n\nBut wait, there's more to come! Keep scrolling.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nkeep going~\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nInterested in an art trade? Whisper me <3\n{link*https://imgur.com/a/bnSEDrA*Art Portfolio} - to be updated!\n",
