				["T2"] = {
					{
						["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-AmberFly:512:256}\n{h1:c}Curios, Cookery and More!{/h1}\n\nBelow you'll find a list of items that Rak'shira more often than not brings with her to the markets and festivals. Bringing Zandalari culture through the world in form of various curios, potions and objects; and 'fine' dinning.\n\n{p:c}{icon:inv_archaeology_80_zandalari_idol:80}{/p}\n{h2:c}Curios and Jewelry{/h2}\n\n{icon:trade_alchemy_potiond6:40} Draught of Regeneration\n\nA specifically brewed small potion, that allows the imbiber to gain the regenerative properties of the troll races for a temporary period of time. The time varies from the individual from 2-7 days.\n\n\n{icon:inv_potion_27:40} Dragon's Breath Elixir\n\nSupposedly, this potion gives the imbiber the ability to expunge a few seconds of raw dragon's fire. (maybe it's just really hot alchemically induced fire...); Buyer beware! Once the potion has been drunk you'll have approximately 5.3 seconds to turn to the target; or targetted area before you're spewing flames everywhere.\n\n\n{icon:inv_misc_necklace15:30} Loa Necklaces\n\nThree designs of the Zandalari Loas has been gracefully crafted into small idols upon a leather string. Several golden beads are hung upon the string as well. ({link*https://www.argentarchives.org/files/gallery_image/LoaNecklace3_aav1.jpg*Link to the artwork} - The necklaces are bought through in-game gold OOC'ly of 5000 gold per necklace. You will receive an inididual image of the necklace to use on your decired medias!)\n\n\n\n{icon:inv_misc_food_legion_fishbrulspecial:80}\n{h2:c}Zandalari Style Cookin'!{/h2}\n\n\n{icon:inv_misc_food_draenor_grilledgulper:30} Grilled Serpent\n\nGrilled, skewered, and seasoned with hot spices, these tail pieces of Zandalar's Wind Serpents are a juicy bite of goodness that's easy to carry with you.\n\n\n{icon:inv_misc_food_legion_saltpeppershank:30} Singular Devilsaur BBQ Rib\n\nIf ribs are your thing, the giant singular rib of a Devilsaur should be right up your alley. Dripping with BBQ sauce, it comes with the giant bone as a 'handle' But you're bound to get some greasy fingers for sure!\n\n\n{icon:inv_cooking_80_mondazi:30} Mon'Dazi\n\nDesert is never late, and never should be. It's a part of every good meal and by golly the Mon'Dazi is a beautiful tradition; fried sweet dough with a dash of powdered sugar and a drizzle of honey.\n\n\n{icon:inv_misc_food_cooked_fishcake:30} Raptor/Pterrordax Fried Egg, or Scramble\n\nChicken eggs are one thing... so what about raptor eggs?! Share an entire, huge fried raptor egg with your buddies, or maybe a bit of scrambled pterrordax egg is more your speed!",
						["BK"] = 1,
						["IC"] = "inv_misc_coinbag_special",
					}, -- [1]
					{
						["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:412:156}\n{h1:c}APPEARANCE AND PERSONALITY{/h1}\n\nRak'shira is a druidess past the prime of her life, and her face bears the signs of age to testify it. She does however often boast of how her physical appearance looks much younger than she really is. Despite her age, her head is adorned with mossy green hair, and her tusks holds their fair share of cracks with its yellow-ish tone. One of the most noticeable features is her eyes - one a bright almost glowing cyan, while the other is a hazy white, indicating her blindness in that eye. Rumours goes that she made a bargain with one of the Loa for her normal sight, to be granted something else in return. She adorns herself with various trinkets, all from skulls to earrings of bone and wood, bearing the markings of the Loas. Including a golden necklace that has all the totemic designs of the Loa.\n\n \n\nEven at her age she seems to at least try and carry herself with the dignity of a respected 'Loa Priestess' or 'Loa Speaker' as she was raised to be. Rak'shira looks remarkably youthful, the reason to this she claims being her strong connections to the Loa.\n\n \n\nShe outfits herself simply, but not unlike most Zandalari that also adorns themselves with golden decorations. Much of her 'armor' is made from skins and hides, as well as bones and platings from animals. When on the move she always carries a bag over her shoulder that rattles with vials and potions, as well as emit a strong odour of fresh and dried herbs. She always comes prepared.\n\n \n\nDon't think she can't put up a fight however, when angered she's spiteful and with her mastery over the druidic forms it's probably not a good idea to anger her further. Even so she's friendly by heart to most, although her trust is something to be earned, she's one of the first to rush to a fallen and do whatever she can to mend their wounds.\n\n\nAlot of those who knows her however can testify to the fact she can be very grumpy at times, and makes great use of her walking stick to beat sense into others with shallow minds.\n",
						["BK"] = 1,
						["IC"] = "achievement_alliedrace_zandalaritroll",
					}, -- [2]
					{
						["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-DinosaurSkeleton:376:156}\n{h2:c}DRUIDIC FORMS{/h2}\nOne thing Rak'shira is often known for is having immensely enormous druidic forms, being a good deal larger than the average. So much so she'll often dwarf both druid and humanoid, especially when she takes on the shape of a raptor or a pterrordax.\n\nOne way to recognize her in her druidic forms are of course her different coloured eyes, and the three golden rings that are pierced through any of her nasal horns. Except her pterrordax form, where the rings are instead imbedded in the thin skin on the fin upon the back of her head.\nIn all of her forms she is also decorated in one way or another, often with gold bracelets or armor as well various feathers.\n\n{h3:c} {icon:TalentSpec_Druid_Feral_Bear:25} Aspect of Torga and Torcali  {/h3}\nWhen taking on the aspect of the two giant Loa known as Torga and Torcali. Rak'shira becomes a great big ankylodon with immensely thick plates of armor. Virtually a living, organically armored tank.\n\n{h3:c}{icon:TalentSpec_Druid_Feral_Cat:25} Aspect of Kimbul{/h3}\nEven though this form is not a tiger or cat, it still carries much resemblance to the Lord of Beasts in a slick and nimble Sabertusk form with harsh bone spines across her back, as well as raptor-like talons on her back feet.\n\n{h3:c}{icon:INV_RaptorTravelForm:25} Aspect of Gonk{/h3}\nThe first of her forms which looks more like the Loa than the others. Rak'shira's Aspect of Gonk is enormous, being even larger than the normal Zandalari raptors.\n\n{h3:c}{icon:INV_DruidFlightZandalariTroll:25} Aspect of Pa'ku{/h3}\nThe second of Rak'shira's forms that take mostly after the Loa. Where most druid's forms look most like a juvenile pterrordax, Rak'shira's closer resembles a sub-adult in size and coloration.\n\n{h3:c}{icon:Ability_Druid_AquaticForm:25} Aspect of Gral{/h3}\nThe last of her forms, and also one of the largest is the form she takes underwater. A great big shark-like saurid with a huge gaping maw of teeth and plenty of fins to propel her through the waters.\n",
						["BK"] = 1,
						["IC"] = "spell_druid_wildcharge",
					}, -- [3]
