		["[MSP]Fifonzz-ArgentDawn"] = {
			["character"] = {
				["v"] = 49,
				["CO"] = "-Art in the about <3\n\n-Tendency to afk, so i can miss your /say or emotes, try whisper\n\n-Target = probably checking out your TRP or tmog UwU",
