						["AC"] = true,
						["TI"] = "Knapsack",
						["TX"] = "A small knapsack she carries with her, seemingly filled with more knicknacks, herbs, a few small vials and a small box.",
						["IC"] = "inv_misc_bag_15",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Elemental affinities",
						["TX"] = "Usually spotted with a minor infusion on her current choice of arms, be it a fragment of earth, a small spark or a flickering ember.",
						["IC"] = "ability_shaman_echooftheelements",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Adornments",
						["TX"] = "A few steel loops on one ear.\n\nMost prominently noticeable would be two earrings, made from a darker form of mithril, one on either ear, the left one etched with the details of a wyvern while the right one depicted a hyena. Mithril in make with a small added copper filigree to keep them sturdy. They seem to be of elven make.\n\nHer left ear seems to be slower to flick than the right, two small silver bolts pierced through the near-tip and base.\n\nOn her left arm is an actual bracelet, crafted by a kit, the shells on it all sporting differing colourful hues before turning bright white outwards.",
						["IC"] = "inv_jewelry_amulet_05",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Attire",
						["IC"] = "inv_chest_armor_vulpera_d_01",
						["TX"] = "Seemingly fashioned for mobility with bits of bone reinforcing the chainmail and leather bits on some spots, especially on the ridged bone gauntlet she bears, the ridges tipped with what looks to be gold for conductivity.\n\nHer Order-attire sports more protection with an intricate scalemail chestpiece of white and minimal gold, crowned with her finest shiny bracelet, followed by her usual gauntlet, recoloured to match her new garb. Seemingly coded by color as per to a request.\n\nNeatly pinned to the chestpiece is no other than a pin of the Unbound Brotherhood, right next to it, a small silvery star, both which she seems to treasure quite a bit!",
					},
				},
				["v"] = 54,
			},
			["time"] = 1603197560,
			["link"] = {
				["Niiris-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sandstorm:512:128}\n\n[Summary]\n\nNiiris. A name known to many a kin. Wave-weaver while still living in Vol'dun, nowadays a title she remembers, but still cannot connect. After the horde's arrival she wandered along with many others to expand her horizons beyond that of dunes and old ruins. But that was not the only aim at all.\n\nArriving into Orgrimmar her eyes were set on all the places horde would inhabit. Helping some, stealing from others, dependant widely on the disposition and shininess of the object in question. Regardless, Niiris considers many her friend, and may just let you keep your goods to yourself if she likes you.\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-DraeneiRelic:512:256}\n\n\n\n[Past History]\n\nBe as it may, her upbringing was turbulent to say the least. The sole survivor of a caravan heading across struck by faithless, she was taken in by a small group of freedom fighters and slave liberators, growing end experiencing the dunes in a whole different light, the time that shaped her into a Wave-weaver, mender of kin.\n\nBut that was not to last.\n\nAlienated from the one she depended on after a task gone wrong as well as captured by a rogue mage far too curious for their own good, she escaped, but not without a cost. The arcane prison within had a failsafe, that of which locked most her prior memories away.\n\nHence she scrambled in the dunes, scavenged and survived, even if the dunes now ran red in conflict of new visitors, slowly turning to the vulpera she is today.\n\nPerhaps some times are best left in the past.\n\n\n[A tune known to some vulpera, in a time since passed.]\n\nWave-Weaver, by dune or by sand, her tides wash the land,\nBy dawn standing, watching over, by dusk protects,\nWashing away the wounds, the shackles and regrets,\nAs a new days dawn, even if the tides ebb and wane,\nSome flow forever, for kin to relish, draw from and seek mending in their embrace again.\n\n",
				},
