						["TX"] = "{h1:c}Elilyntra Graveguard{/h1}\n{h1:c}|TInterface\\Icons\\inv_mace_116:20|t{/h1}\n{h3:c}Behold the almighty Queen of Death Metal.{/h3}\nRisen out of her metal casket that sank into the burning depths of hell from an eternal slumber. \n\nWoken up by the earth trembling, opening up a breach for her longing escape. Penetrating the stones around with her razor sharp claws as she pulled herself up from the soil. A demon taking on the form of the first intelligent inhabitants she lays eyes upon. Becoming a hybrid from her former self and the Shal'dorei race.\n\n{h2:c}|TInterface\\Icons\\ability_deathknight_heartstopaura:20|t{/h2}\n\nA highly attractive body is hidden under the heavy armour the Knight is wearing. Having luscious curves Lights reflecting off Elilyntra’s voluminous seemingly ebony hair reveal blue low- and highlights. A mix of light grey and blue silky smooth skin decorated with glowing white lines all over her body, having only white freckles as her only blemishes along with a few scars. \n\nEletric-blue flames coming out of her already glowing eyes completed by perfectly trimmed dense eyebrows and black eyeliner finished off by long eyelashes. Adorned with several facial piercings including a nose ring, labaret and one added to her split tongue along with her ears full of steel. As clothing is stripped away more piercings can be found as both her nipples are pierced with rings and a christina.\n\nThis is the appearance of a queen locked from the world for centuries. Now roaming Azeroth, looking for followers to restore her Metal Empire. Avenging those who put her inside the casket she called a prison.\n\n|cff003ec3{p:c}https://imgur.com/a/a75QMBP [NSFW~ Pixel Boobs Ahead]{/p}|r\n\n{img:Interface\\Pictures\\artifactbook-deathknight-cover:256:256}",
