		["0630222648JJgXP"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Requiem",
						["IC"] = "INV_Sword_2H_ArmyOfLight_C_01",
						["TX"] = "Attached to the woman's back is a sheath containing her great sword - a family heirloom wielded by the strongest members of the House Dawnfury - those truly worthy of carrying its name. \n\nThe sword owns a golden taint - with a simple design. Of course - it was her ancestors that forged the blade, but through the years each wielder has reforged it to adapt the weapon to its fighting style and the new traditions. This is what happened when Eris obtained it. Named Requiem - she engraved an inscription on the blade : 'Selama ashal'anore' which means 'Justice for our people' in Thalassian. \n\nWhen it Eris's allies and family helped her reforged the blade - they made sure that it would fit her own fighting style. Basing herself on counter-attacks, the length of the weapon serves her to gain an advantage when ever she needs to close the gap or even cleave multiple enemies.\n\nWhen she doesn't drag along her family blade, she is otherwise noted to wield two one handed swords.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["IC"] = "70_inscription_vantus_rune_light",
						["TX"] = "Faint Aura of Light\n\nEris was a Blood Knight - through the teachings of the Knight Master Emberheart, she is learning to bend the Light to her very own will - using its power to either strengthen herself, heal her allies or protect them. \n\nThis results in a faint and weak but present aura around her. Calm and welcoming - she glimmers with hope and warmth. She is a beckon of Light - thus, any undead or fallen creature may not feel 'at ease' around her, or even 'disgusted' by the very contact of this Knight - just like some Shadow users. \n\nBut living may feel welcomed - or at ease. Even if it is barely distinguishable as she is an adept within the arts of bending the Light.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Achievement_Character_Bloodelf_Female",
						["TX"] = "Dawnfury is the typical Sin'dorei young woman - adorned with a golden, white and red armour, those of house's colours, she carries with her the tabard of the Order she is serving - the Shattered Sun.\n\nExcept from her plated armor, she can also be seen at times wearing green-leather gear with some pieces having fur for extra warmth. \n\nHer once blue eyes that would mark a certain affinity with magic have changed after her consumption of the fel energies to not become a withered - have now turned into emerald-green eyes. Long and blond hairs, she seems to take of her appearance. \n\nHer skin, slightly tanned by the Sun bears no scars neither bruises - no imperfections. Yet, the curves of her body shows that she is no stranger to battle neither to war.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "(OOC) Glance",
						["IC"] = "inv_misc_enchantedscroll",
						["TX"] = "Glances are Work In Progress.\n\nTheme: The Vestige - Final Fantasy XIII\nVoice ref: None currently.\n\nMore to come eventually on the glances..\n",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Trinket",
						["IC"] = "INV_Trinket_Firelands_01",
						["TX"] = "Trinkets\n\nRing: Under her right heavy plated gauntlet - Dawnfury carries a ring that is carefully placed. The ring is in itself a family trinket that pass through each generation of her house. \n\nWithin the inner circle of said ring - one may read the moto of their house (W.I.P) and on top of the jewelry, the symbol of the Dawnfury house - one that Eris carries with pride and never let it go, no matter what.\n\nNecklace: From time to time, Eris seems to take a look at her necklace which carries a picture. The picture shows a part of her family - her father, mother and of course beloved sister. \n\nIf given some attention - one could easily notice an inscription near it which says 'Elo bindel felallan morin'animor' which means 'Sleep forever in quiet serenity' in Thalassian. Perhaps it would not be the wisest idea to talk about her family - or house.",
