		["[MSP]Dreadflare-ArgentDawn"] = {
			["about"] = {
				["vote"] = {
					[2611484726] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}Appearance{/h2}\n\n{h3:c}{link*https://imgur.com/a/CFpPBNM*Art}{/h3}\n{h3:c}{link*https://www.argentarchives.org/node/232874*Argent Archives}{/h3}\n\n{col:ffa71a}Once, long ago, when warm blood surged through her veins and a smile painted her face, she was a thing of beauty - like most High Elves. Now, though, she's far from it. With an emotional range so shallow as to make Maiev Shadowsong appear kind and caring her grey and slightly emaciated visage is nearly always twisted into a vicious sneer. Undoubtedly undead, once blue eyes burn a bright crimson in stark contrast to her palid skin and the flesh of her lips has turned an icy blue. A natural hourglass shape due to her feminine skeletal structure, her body has lost it's lushness in undeath and she appears a touch on the gaunt-side.\n\nIt is rare for her to be seen without the tell-tale trappings of her vocation worn for all to see. Invariably, with it's hood pulled up, the undead ranger dons a lengthy cape that is more than a little ragged. The hem of it displays damage with the threads fraying whilst the main body has a few holes. Alongside this, matte black armour clings to her form consisting of chainmail and thin plate that affords some modicum of protection despite leaving her midrift exposed in classic, elven, style.{/col}\n\n{h2:c}History{/h2}\n\n{col:FFA71A}In life, Valestra Emberflare was a ranger of Quel'thalas. Day in and day out she stode through the enchanted woodlands to keep her home and kin safe and sound, keeping the Amani in check and honing her skills in the wilds. And now, in death, she is a Dark Ranger fanatically loyal to the Banshee Queen.\n\nWhen the orcs came to burn Eversong to the ground she had her first taste of true war but it was not until Arthas came that her world was turned upside down. The Farstriders lead the defence of Quel'thalas and fought a desperate rearguard action but the tide of shambling corpses could not be stopped. Her arrows found eyesockets and rotting hearts but still the Scourge came to ravage Silvermoon. Though brave it was for nought and her broken body was piled onto a corpse wagon just like so many others. She knew the peace of death, for a time, until her tortured soul was raised as a banshee to serve Arthas and her old superior Sylvanas in undeath.\n\nOvertime however, the Lich King's grasp weakened and waned and many of the undead regained their freewill. Sylvanas and her banshees lead the rebellion against the dreadlords and the Forsaken reclaimed their existence. Valestra however was less than happy. Just as the Ranger General had done she sought out her own body and possessed it, wandering the world as a pale skinned and red eyed monster. All too keen to inflict her agony upon the living she turned to mercenary work - all the better to spread terror.\n\nIt look many years for her to come to terms with what she was but eventually she did. She bent the knee to Sylvanas and became a Dark Ranger, joining with the Forsaken and the Horde to enact her vengeance upon Arthas in Northrend. She has served faithfully ever since.\n\n... Until Sylvanas betrayed her, and the Horde.{/col}",
				},
