				["CO"] = "Art in\n About. (New and spooky, go check it!)\n  Adorable.\n   Attackable.\n    Approachable. \n     At times wondering where to ilde Viri to trigger someone into talking behind my back on a discord.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["CU"] = "Elf. (Doesn't have eyes on her back. Yet.)\n Elated. \n  Ecstatic.\n   Esoteric.\n    Energetic.",
			},
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 2,
				},
				["PE"] = {
					["1"] = {
						["IC"] = "ability_mage_coldasice",
						["TI"] = "Appearance/Smell",
						["AC"] = true,
						["TX"] = "TLDR:\n-As her in game model.\n-More toned body.\n-Usually with shimmery make up made from starlight rose, purpleish lipstick and eyeshadow.\n-Eyes glowing in frost blue, tainted with arcane purple.\n-Over her body, one could see very subtle arcane runes that would take the role of both protection and decoration.\n\nHer perfume can vary at times, but her prefeer scent would be the one made from Starlight Roses. ",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["IC"] = "ability_warlock_burningembersblue",
						["TX"] = "Around Viriami, one could notice a strong arcane aura, for some, the unestable and wild nature of pure arcane magic might feel unconfortable, for others, it could seem even atractive, almost an adictive feel.  She seems to have a total control over her aura, reducing it to a mere breeze when needed, just out of politeness.\n\nIs not easy to find Viri on an unhappy estate, the elf seems to always live on bliss, however, a cold frost aura would be a clear signal of wanting to be left alone, becoming stronger the more bothered she is.\n\nThere is also a third notable aure, an aura of heat, of the elements of fire, raising. This is a rare one, only some individuals have felt it coming from Viri.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Armor and general gear:",
						["IC"] = "spell_magearmor",
						["TX"] = "Armor:\nUsually seen with cloth or leather.\nAn almsot invisible layer of arcane would cover her.\n\nWeapons:\nTwo fist channeling devices.\nA dagger on her back.\nHer Ale Pole. \n\nMostly on the pouches around her belt and her backpack:\n-3 arcane scrolls.\n-3 blue vials (Icecap + Dreamfoil flowers)\n-2 Bruiseweed+Briarthorn vials.\n-Writting instruments.\n-12g 90s \n-Several arcane artifacts.\n-A Dalaran Seal.\n-Some Starlight Rose powder.\n-Some extra chocolate.\n-10 grams of shimmerweed.\n\nOn the Ale Pole (if equiped):\n-Mug: Empty.\n-Bottle: Arcberry juice.\n-A thong. (not my fault sorry)",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Wounds and scars",
						["IC"] = "spell_fire_blueimmolation",
						["TX"] = "Wounds:\n-No open wounds!\n\nScars:\n-Nothing important!\n\nOIder scarrs:\nSeveral small old cuts around her body.\nOld burn scars on the sides of her arms.",
					},
					["4"] = {
						["IC"] = "inv_fistofthewhitetiger",
						["TI"] = "Unconventional casting:",
						["TX"] = "Is usual to see Viriami's fists glowing with different auras, at times intentional, others, just residual power still attached to her knuckles.  Rather than usual spell casting, she seems to prefeer infusing her fists and at times feet with arcane, frost or fire magics, making her a deadly force in close combat.\n\nIs not unusual to see Viriami's fists covered with a pair of fist weapons of variable sizes and designs, usually helping her focusing the magic, pack a bigger hit, or just protect her knuckles.\n\nShe also seems to be able to do the same with her staff, the Ale Pole. However, this tends to be rare.\n",
						["AC"] = true,
					},
