				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\n{h3:c}{col:ffc5f5}\"I'm not scared of many things, but at times, feels like Viria is scared of nothing. Call it stupidity, call it knowing her habilities well. But this one is a trouble that should have never been let out of Suramar. \"{col:ff99d3}-Quote by Elewynd Wintermoon{/col}{/h3}\n\n\n{h1:c}{icon:pet_type_magical:25}{col:ba65ff}Lady Viriami \"Arcanefist\" Arcaneblossom{/col}{icon:pet_type_magical:25}{/h1}{h3:c}{col:24b3ff}The youngest and rascal sister.{/col}{/h3}\n\n\n{h3:c}{col:742cba}\"Her Sweet Kiss.\"{link*https://www.artstation.com/artwork/1nzeZL*Art}{col:742cba} \n\n{col:742cba}\"Suramar meeting\" {link*https://www.artstation.com/artwork/mqXW21*Render}{col:742cba} \n\n{col:742cba}\"Ice queen\" {link*https://www.artstation.com/artwork/rAJvPm*Render}{col:742cba}\n\n{col:742cba}\"Elder love.\" {link*https://twitter.com/Elewynd/status/1290264391661703168*Render} {col:742cba} Ft. Kai \n\n{col:742cba}\"Warcraft Hawk Pro Skater 2.\" >>{link*https://twitter.com/Elewynd/status/1301675900715630592*Render} {col:742cba} \n\n{col:742cba} \"Sister's selfie.\" >> {link*https://twitter.com/Elewynd/status/1310551618937597952*Render} {col:742cba}\n\n{col:742cba}(Newest) \"The spooks\"{col:ba65ff} >>{link*https://twitter.com/Elewynd/status/1318137315831631872*Render} {col:742cba}\n\nElewynd's commissions are finally open and her art has improved a lot! {link*https://twitter.com/Elewynd/status/1265707775990140934*Go look!}{/col}{/h3}\n\n\n\n{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:5}\n\n\n{h2:r}{col:d388ff}Appearance:{/h2}{col:d388ff}\nSpeaking about the appearance of someone that enjoys vanity as much as Viriami does can be a challenge on itself, as a description of her hair would usually end up outdated in days. However there are a few things that -usually- remain the same. \nStarting for her skin, it would glow on a mixture of azure and saphire, depending on the light refracting of her skin a shade of blue would seem more prominent than the other. However, no matter the light around her, it would seem rather soft, something one could expect on an elf, and it suffices to say that, it would also be soft to the touch, even on some of her old scars. \nHer skin would also carry a distinctive glow, under the right conditions, one could see a shimmer, as if the stars reflected on her skin, soft sparks of light faintly covering the night shade of her body almost if she was covered by a gentle amount of glitter. Only she knows the cause for this. \n\nHer hair would be one of those things that she loves to experiment with, diferent hairstyles and dyes to switch colors. Rumors say that her natural one is also her favourite one, white, as cold as the snow on Winterspring, tinted on a rather gentle touch of pink. It would be perfectly cared, even if at times she might show little regard for it and run around with it ruffled, she would take a good care and usually carry it around tied on a ponytail, mostly a case of confort over looks.\n\nWhen one reaches her face, then again one could find an espectaccle of vanity, using the powder from the Starlight Roses to accentuate her face, adding a faint shimmer when light reflects on it. A soft eyeshadow to make her eyes glow even further would also be noted, at times also helped by a sharp eyeliner. The final piece of make up clearly visible would be a fine layer of lipstick, helping her kissers light up on a soft purple shadow. Very ren'doreish of her.\n\nHer facial structure, as oposed to her make up, would denote royalty and youth, with not very marked jaw bones and a non to destacable chin. Her nose by contrast would seem sharp, as if sculpted on a statue, along with her cheeks. Lip ways, they would seem to be fleshy good kissers, even if shaped by sharper lines.  Her orbs of vision, more comonly known as eyes, would also follow the sharper tend, even if its curves would remind one of an almond, carryng their own frostly blue, cold glow, with a very distinctive arcane glow on them, that would only be even more accentuated when feelings take over her, sparking like uncontroled electricity.\n\nBehind her clothes, if she wears them, one would be able to find the rest of her skin wraping around a perfectly sculpted Shal'dorei body. One that has clearly not suffered much arcane withdrawal, instead, she would seem stronger, more toned than the usual Shal'dorei. Her muscles not as big, not making her a bulky elf, but toned enough to be followed with the eye, or with the fingers, for those lucky enough to feel a certain toughness on her muscles. Her more -womanly- curves would seem to mostly be there, even if her chest is rather small, her clearly extensive training has given her a nice bottom, clearly something that will hurt one's hand if you try anything.\n\nCovering most of her body, she would have some faint runes, inscripted with arcane magic, they doesn't seem to glow much on their own, except when on use. They would mostly seem to bounce back light on a softer arcane pink tone, closer to white. This runes mostly serve for protection.{/col}\n\n\n{img:Interface\\PETBATTLES\\Weather-Rain:600:6}\n\n{h2:r}{col:41ecff}Personality:{/h2}{col:41ecff}\nSpeaking about one's personality is hard. There are many the ocasions when two people might have different experiences with one person, due to how that person reacts to them or its general mood that day, but once again, Viriami is a simple one.\n\nViriami, even for her age, is what her older sister would call an stupid kid or what some other swould call a teen. She acts without thinking much, usually for her own benefit, seeking what makes her happy or what she can enjoy, a seek for that thrill and fun that has caused her so many nights imprisoned on Suramar. She is a rebel, quick to speak up for anything, even if what she says might make no sense. Quick to approach those who catch her absurdly high curiosity. Quick to pat.\n\nShe, most of the time, keeps a wide, rather playful smirk curled on her kissers, tainted by a michevous look on her eyes, showing off how good she feels, living in pure bliss, all the time. She is happy with her lack of seriousness, no one can ever doubt that.\n\nHer uncaring attitude might have won the bad side of some, specially her parents and elder sister, who want to force onto the -boring- life of poltics.\n\nHowever, even if generally uncaring, she is fast to care about those she feeld derserve it, or those who she has close on her heart. She is a loving, cuddly elf, when the arcanes on her doesn't tilt onto doing dumb things or trying to befriend bats. However, her sharp, childish sense of humor might ruin what could be a warm loving night.\n\nShe also is -highly- flirty. Mostly as a tease, as a joke, wanting to cause a reaction that usually gets her in trouble.\n\n\nHowever, one musit never forget when speaking with Viriami that, she is, after all, thousands of years old. She is not a kid, even if childish, she is an smart one, full of knowledge, both from her -forced at times- instruction on the arcane and the cleverness requiered to survive on the street, avoid legions of guards and general problem solving.\n\nShe also seems to dislike crowds, usually keeping to herself on them, not out of shyness or not having much to say, just general overwealmth that turns fast into boredom. On small crowds, at times, she also seems to rather be the center of attention, or not be noticed at all.\n\nViriami is one quick to speak, but not to attack. She knows damn well how absurdly strong she is, and how much the arcane can corrupt her, so she tries to resolve problems with her tongue, going for her staff if the situation requieres it.\nIs distinctive and notable that, the elf seems to have no fear at all. Overconfidence, stupidity or just a good pair of female balls might be the cause of this, but usually, she seems to not give a single crap about danger.\n\n\nHowever, all of this is subject to change, if one gets her on a specially good or bad mood, she can react unrpedictivly. {/col}\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Mud:600:5}\n{h2:r}{col:bb6822}Backstory:{/col}{/h2}{col:bb6822}The story of her family can be found if one knows in what books to look for, this is not the place to talk politics. \nHer particular backstory is harder to trace, harder to find, as she has spend most of the time on the streets, stories speak of that weird elf that has punched every royal family known behind the shielding barrier of Suramar. \nBut if you want to know, you will have to ask.   {/col}\n\n\n\n\n\n\n\n\n\n\n{img:Interface\\QuestionFrame\\answer-warboard-wod-FrostfireRidge:512:3}\n{h1:c}{col:55d3ff}Not your kind of archmage.{/col}{/h1}\n{h3:c}{col:55d3ff}An exploration of a different use of the arcane arts.{/col}{/h3}\n\n{col:55d3ff}Even if her looks might not show it, Viriami is a powerful arcanist, someone that has ner nose deep into the study of the arcane magics for a big part of her several thousand years of life. Starting as something imposed by her parents, seeking to raise a second arcanist. The study of the arcane grew on Viriami. As most mages know, magic is powerful, magic is adicting. This adiction to her new found powers being the only thing able to catch her attention and keep her focused, sudyng, learning and at times, impressing her instructors, just to mocke them, she, after all, is an idiot.\n\nThe part of her life that haven't been dedicated to the study, has been spent on the streets. Viriami is an elf known for getting herself into fights, to have no fear of a broken nose, or leg. This seek for trouble, to give herself a bad reputation and put her older sister to shame, has been a big move towards training her body. Would be easy to see that she is rather more toned than most Shal'dorei and even kaldorei. Her skills fighting unarmed or with some basic and even improvised weapons is something well known on the streets of the elven city.\n\n\n{h3}{col:ff78cc}Schools of magic:{/h3}\n{col:ff78cc}Viri's favoured and close to mastered schools are: Abjuration, Conjuration, Illusion and Transmutation. The schools of Enchantment and Divination are the one she is still seeking to improve, but can also give them a good use. \nAs for elements: She seem to rather harness the arcane itself more than frost or fire. However she is more experienced on the frost than the fire.\n\nShe clearly seems to favour an offensive, blunt approach when fighting with magic, but is not dependant on it. Abjuration to protect herself from hits, conjuration to get herself off a pinch, a fast fireball, a fast frostbolt for those trying to get her from a distance.\n\nShe can close some small wounds with her experience on transmutation, however is not something that will be seen during combat, as it hits heavily on her pool. \n\nShe is capable of opening portals but due to some events one might learn about ICly, the Kirin Tor doesn't allow her to do so.\n\nThose who know Viri well, can guess that Illusion isi clearly her favourite, she enjoys creating small illusions to help herself explain things or show things easier or bigger ones, adapting a new identity to get herself where she is not welcomed. Her illusions can be really strong, depending on how much time, effort or even reagents she puts into it. Her strongest one are also shielded from those with truesight, but not indetectable. (For those who believe that truesight is a real wow thing and edgy DH teens, they can see an illusion, but not what is behind it)\n     {/col}\n\n{h3}{col:7bff76}General combat:{/col}{/h3}\n{col:7bff76}Viriami is rather good in close quarters combat. She has many decades of experience on brawls, generally fighting with her punch or even an staff. Her wits and agility overtake her strengh, with is decent enough, more than an average elf, but clearly not to the point of an orc. Most of her expertise comes from street fighting, running or facing guards, nobles or whatever she got in trouble with at the time. \n\nHer way of fighting is most often improvised on the fly, adapting to whatever she is facing. What doesn't change is her prefference for punch and kicks focusing arcane on her fists to pack a bigger punch, at times even explosive. But this is not limiteid to arcane, she has also been seen with flaming fists or big blocks of ice. \n\n\n{h3}{col:8a8a8a}Armor, gear, weapons and things:{/col}{/h3}\n{col:8a8a8a}{icon:inv_shoulder_armor_nightborne_d_01:25}Armor: \nViria seems to rather leather armor, clearly not optimal for casting, but her usual preference for a fight. However, she is also seen with cloth, or a mixture of the both, having just some reinforcements added to it. \n\n{icon:inv_hand_1h_artifactstormfist_d_01dual:25}Fist weapons:\n Viri is usually seen carryng a pair of fist weapons. They can take different shapes, from simple brass knuckles to rather complex desings. She usually tends to use plate over her hand, at times with the shape of a claw. All of this, is used to protect her hands when punching and help with focusing her casts. \n\n{icon:inv_staff_2h_artifactmonkeyking_d_01:25}The Ale Pole:\n \"Every renowed mage needs an staff\" That's, how Viri's Ale Pole was born, taking the name after the most common thing hanging from its top. Alcoholic drinks and her own sealed jar, She can keep liquids inside without worryng too much or even use it to hit someone, as its reinforced, but usually remains empty. It can be used for many things, including mixing elixirs. \nThe staff itself is a dense tube of Ironroot, clearly gifted by a druidic friend. Its ends, even if not needed, are reinforced with her old spiked plate bracers. Yes, she was edgy once. The rest is decorated by different cloths, the color not always the same. She is a girl that likes to change style.\n\n{icon:inv_helm_inv_leather_raidmonk_s_01:25}Hat:\n Is not unheard of mages using a carpet to fly around with style. Viri's favoured method of transport is... well, portals, but, to fly around, she uses her a huge, clearly pandaren inspired hat. This hat is clearly made with enchanted materials, as the magic carpets would, and reinforced with metallic on the edge, just in case she crashes or just wants to toss it. \nThis hat seemingly is able to also change size. For easier transport or just not have a fucking huge disc over her head. \n\n\n\n\n{h2:r}{col:7effab}OOC notes:{/col}{/h2}\n{col:7effab}I was planning on adding some RP hooks but I guess people can only know her from Suramar or the Kirin Tor. So yeah, no point on doing it a category.\n\nViriami is a very serious RP character but not a serious elf, she knows when to take things seriously but most of the times she rathers not doing so. Being an idiot is on the nature of the character itself.\n\nMimimimimimimi. At least she is not one of those who go around torturing and doing gross things for fun :) \n\nViri's orb shoulderpads are actually ice orbs if blue and arcane if purple. The other colors doon't really make sense given she is a mage and i don't have the mogs -yet- so that's that.\n\nZen flight = She sitting on her carpet or an arcane cloud. Depends on her mood.\n\n\nSeriously, don't try anything towards her if you aren't willing to accept that a several thousand years old elf is going to be quite strong. You all have been warned, here is my disclaimer.\n",
