						["TX"] = "{col:14ff00}A vicious Troll, towering over the majority of the other races he encounters, Dro is a true example of the Warrior Caste.\n\nHis muscles appear carved out of stone when he stands still. His armour is expensively tailored to fit him perfectly, allowing for minimal noise when he moves.\n\nHe carries an expertly made belt and bandolier system filled with smoke bombs, thrown knives and poisons extracted from the most savage beasts of Zuldazar.  {/col}",
						["BK"] = 4,
					},
					["PS"] = {
						["TX"] = "{col:ffb600}A conniving, cunning, ruthless assassin from a long line of conniving, cunning and ruthless assassins, Dro has spent little of his life in the forests and jungles of his homeland, instead travelling the world disposing of threats to the glorious Zandalari Empire.\n\nHaving joined the Horde and returned to his homeland to fight the Fourth War, a toll has been taken on the soul of this hardened 'diplomat' as his Loa and King have fallen. {/col}",
