				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Top Heavy",
						["TX"] = "Her broad shoulders along with her well-toned, bulky muscles in contrast to her narrow hips paint an unusual, even \"brutish\" picture of a young pandaren woman.\nNot to mention the notable pair of twins on her chest, but those may be well-hidden by her armor.",
						["IC"] = "inv_chest_mail_panda_b_01green",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Laughing Skull Mask",
						["TX"] = "Bian is in the posession of a mask which quite obviously should belong to one of the roaming lunatics, the only difference being that hers is made out of wood, painted according to the fashion of her own people, black and red paint dancing along it.\n\nIf it is not worn, it usually hangs from her belt.",
						["IC"] = "inv_helm_laughingskull_01",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Physical Condition",
						["TX"] = "A strong, healthy pandaren girl. Albeit, she might seems way too slim for her kin. Her muscles and overall strong build tell of a harsh daily training.",
						["IC"] = "pandarenracial_innerpeace",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Suibian and Other Equipment",
						["TX"] = "The pandaren's main means of defense and offense is the heavily \"upgraded\" staff she carries around. Painted black with several metal spikes added to each end for maximum lethality. The shaft has pandaren sign carved into it all over -- a keen eye might recognise the mantras of Niuzao.\n\nShe also carries a decorated dagger on her belt.",
						["IC"] = "inv_staff_75",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Attire",
						["IC"] = "inv_chest_plate_pvppaladin_o_01",
						["TX"] = "A plate set as black as night, with the chestplate having the pandaren signs for 'Courageous Fortitude' painted on the black.\nWhile it is not the traditional attire for a Niuzao Sentinel, she still takes pride in serving her Celestial.",
					},
				},
				["v"] = 30,
			},
			["time"] = 1603307109,
			["link"] = {
				["Liubian-ArgentDawn"] = 1,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "achievement_character_pandaren_female",
						["BK"] = 3,
						["TX"] = "{col:5563b9}A female with average height, but a rather uncommon build for her kind. Unlike most of her kinswoman her hips are rather narrow in contrast to her broad shoulders and she generally lacks the staple chubbiness of her people. This in turn puts more emphasis on her well-toned muscles and her overall strong, brutish build, taking away some of her feminine qualities.\nHer fur is black as the moonless night sky which is contrasted by light grey, the dark parts creeping up on her arms and legs, breaking up into bigger spots going upward. The fur on both her arms and legs is dappled with small, white spots -- the remains of a serious injury.\n\nDespite her \"disadvantageous\" build she seems rather confident in her womanly charms, not at all afraid to show off what mother nature has given her. Apart from her rather large breasts which she is more than happy to flaunt if her current attire permits it she also visibly puts a lot of effort into her makeup -- her lips usually painted in a mulberry shade with additional black paint putting more emphasis on her facial markings, as well as her light brown eyes.\nHer face is overall pretty, albeit a tad slimmer than others' of her kind, matching her build.\n\nClaws are kept long and sharp, always ready to be used if the situation demands it.{/col}",
					},
					["PS"] = {
						["IC"] = "spell_nature_focusedmind",
						["BK"] = 3,
						["TX"] = "{col:5563b9}At first glance she is a carefree, free-spirited young pandaren who is very passionate about her patron Celestial and is always up to something.{/col}",
					},
					["HI"] = {
						["IC"] = "inv_offhand_1h_pandariatradeskill_c_01",
						["BK"] = 3,
						["TX"] = "{col:5563b9}Even if her current attire hardly represents it, Bian is not too shy to confess her loyalty to Niuzao, trained in the Townlong Steppes at the very own Temple of the Black Ox.\nHow such a devout priestess ended up so far from her Celestial's side is a story you will have to find out for yourself.{/col}",
					},
				},
