				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-StaticField:712:108}\n{h3}{col:a24836}{col:a6f0ff}A proud example of an orcish female stands before you, her skin colour a light green.\n \nStarting at the top, her hair is long and dark brown, held in a wolftail at the back of her head. It doesn't appear extremely well-kept, but is by no means ugly or unkempt. Moving down her face, you see her wide brown eyes, usually gazing about in a somewhat lazy manner, yet she seems aware of her surroundings to some extent. Her nose is straight and fine, nothing of note about it, except the ring pierced into it. Her mouth sits below her nose, not much of note to be seen there either. She has the standard orc tusks protruding from her lower jaw, causing her to jut slightly. On the sides of her head are her ears. Pointy and with two rings pierced each. Her chin is strong, as is to be expected from orcs.\n \nMoving on from her face, we come to her body. She has broad shoulders, leading down to her arms, which are quite thick and muscular, although not overly so when compared to other members of her race. Still, her biceps and triceps bulge out on her upper arms. Her hands are fairly standard, and free of scarring.\nWhat might catch one's eye is her quite large chest. A pair of rather huge breasts extended from her torso, being quite noticable indeed. Beyond her chest is her stomach. Flat, and with the faint outline of a sixpack apparent. Her back is also fairly muscular, outlines of muscles visible down the length of it.\n \nMoving on to her lower body. She has wide hips, and a fairly large, yet firm bum, wiggling lightly as she strides. Her legs are also quite strong, as with the rest of her body, big thighs and muscular calves. Her feet are nothing extraordinary, they get her where she needs to go.\n \nHer lips have a tendency to curl into a crooked smirk or grin as she talks to people. Perhaps she's easily amused, or perhaps she hides a devious mind.{/h3}\n\n\n\n\n\n",
