			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-warboard-bc-Nagrand:512:256}\n\nGarmmash Steeljaw was born in Garadar, a small village in Nagrand. As a child Garmmash was treated no different than the other kids, he would endure the spartan-like culture of the warsong clan. Weakness and cowardice was frowned upon since your reputation and honor meant everything. His daily routines would consist of physical training as well as combat. Once Garmmash became of age he joined the garadar guard. This was at the time the closest thing to a military Garmmash could be a part of, something he would learn to thrive in. Days turned to weeks, and weeks to months. One fateful day an Orc with the skin color of Nagrand itself came to visit. He would speak to Garrosh of his father, of his bravery and sacrifice. After that day everything changed, Hellscream their leader was no longer depressed and suffering from inner turmoil. The day after that all Orcs within garadar was called to the town hall. Garrosh now standing besides Thrall made an announcement. All Orcs where now to follow this “Son of Durotan” to a new world and join forces with Grom’s Horde. Garmmash who had gotten a thirst for military power eagerly agreed on joining forces to become even stronger.  \n\n{img:Interface\\QuestionFrame\\answer-warboard-classic-Durotar:512:256}\n\n\n\n When Garmmash first arrived in the deserts of Durotar his first reaction was scepticism. “How could this possibly be a good place to build a city?” He thought to himself. He quickly had to shake those thoughts out of his head as they finally spotted the massive gates of Orgrimmar. The gate itself was a colossal structure made out of wood, stone and iron. This was something that Garmmash had never seen the likes off. The rest of the Mag’har were as stunned as he was. Once inside Orgrimmar, the city of Grom’s Horde Garmmash saw a community that somehow westwood the terrible living conditions that this desert was providing. Though it was strange that the majority of the orcs had green skin He’d never deny them his respect. Garmmash and the rest of the warriors of garadar were dropped off before an orcish commander. The orc would speak “ Welcome my brethren! my name is Tarrog, commander here in Orgrimmar. I understand you’ve traveled far and with hope to join your people who left you in garadar so many years ago. For all the trouble you went through I will personally make sure you keep your ranks as defenders of the Horde!” he said with a welcoming smile. \nAll the warriors including Garmmash would salute Tarrog with respect. Tarrog would speak once more “Oh and here you will not only maintain your rank as defenders of the Horde, you will advance to the rank of Kor’kron. This is requested by the Warchief himself, consider yourself lucky. You will follow me to the barracks in the Valley of Honor, there you will dawn the armor of the Kor’kron.” Tarrog would gesture for the warriors to follow. Garmmash would do so with excitement. while on the way to the barracks together with his brothers and sisters he would see races he’d never seen before. One kind were long and thin, they had ears as long as a short-sword while missing a couple of fingers and toes. Their skin were also blue just like the Draenei. yet another race would draw Steeljaws attention, the creature was spotted carrying wood on his shoulder. The creature was harry like a clefthoof with the horns that of a rylak tooth. It also had no feet, instead they were replaced with hoofs again just like the Draenei. “What are these creatures?” Garmmash would ask his commander. “Creatures? oh right, you’ve not fought with them like I have. Good question warrior everyone should hear this anyway. Listen up warriors these are your new allies. the tauren and the trolls. Their races has served our Warchief more than once so be respectful.”\n\n Garmmash would Display annoyance thinking “I’d fight and bleed alongside these races? They even look like the Draenei in one way or another!” A problem for another day since the party had arrived to the barracks. Tarrog would pause before with a now more serious voice say “Now then, women has their armor in the right corner and men can find theirs in the left side of the barracks. Open the chests, put it on and meet me outside.” The warriors would do as told under some chatter about this new world and it’s races. The armor itself was of a yellow tint mixed with some blackened and dark areas. “The armor of the Kor’kron huh?” Garmmash would think to himself as he joined the rest outside. “Look at all of you!” Tarrog would say with pride. “You are the backbone of the Horde and will act like such, homes for all newcomers has already been provided, simply come to me for your house key.” \n\nOne by one the newly enlisted Kor’kron would receive their house keys. Seeing as Garmmash was last in line he’d take his chance, before accepting the key offered he’d speak “Commander Tarrog, how does one advance within the Horde?” Tarrog would laugh before grinning. He would then lay a hand on Garmmashes shoulder “You’ve just arrived in a new world with so much to explore and learn, and the first thing you want to do is advance in the military? What is your name warrior?” Garmmash would stand at attention and salute his commander “Garmmash Steeljaw of the warsong clan” Tarrog then sighed with a smile. “I guess you’re the fighting type, tell you what...meet me at the barracks tomorrow and we can talk about advancing. Oh, and here is your key. I have a feeling you and I will become great friends.” Garmmash without a word would take the key and walk away towards his new home.. \n\n\n\n{img:Interface\\QuestionFrame\\answer-zone-WrathoftheLichKing:512:256}\n\n    ”You seem more excited than usual Garmmash'' Tarrog would say while putting down his drink. The zeppelin they were on was carrying their whole regiment alongside provisions and ammunition. Garmmash would tighten the grip of his axe and speak “You know me well Tarrog. We can finally be rid of this Lich King and once again set our focus on the Alliance'' He'd almost spit out the last word. Tarrog sighs before looking at Garmmash with a serious face “Just make sure you keep it that way” The Zeppelin finally docked at Warsong Hold where the Kor’kron was to be stationed. The sound of 20 soldiers would be heard marching on top of the wooden floor. Once they the reached ground floor Tarrog would halt their advance and say \n\n“Soldiers of the Horde, my Kor’kron elite! our mission here will be part of Orcish history! We together with Highlord Saurfang’s son Dranosh, will rip and tear through the Lich King's minions and burn Icecrown to the ground! For the Horde!” And in unison the warriors shouted “For the Horde!” Tarrog smiles and exhales “I love the spirit brothers and sisters, for now however I must give you a not so exciting order. You will stay here and rest till the morning, it is then we meet up with the Kor’kron at Angrathar.” The group would disburse, tending to their things. Garmmash would be the last one left still standing at his commander's side. “Soldier, I gave you an order” Tarrog said, showing off his big smile, mocking Garmmash’s battle hungry self. \n\n“I know, I decided to ignore it. I am way too excited for Angrathar! tell me Tarrog what will it be like?” Tarrog grins showing his teeth before laughing at his friend. “Probably like the time you and I were on that scouting mission, remember we ran into a horde of demons.” Garmmash would now smile back once reminded “Of course, I clearly remember saving you from that Fel hunter.” Tarrog would scuff at Garmmashs comment “Saved me? I had everything under control!” Now it was Garmmash turn to laugh “Under control? it was about to bite your foot off!” Tarrog would just wink at Garmmash in response, then instantly becoming serious “But really, this fight will take a lot from us. We’re practically knocking on the Lich King's front door. but thanks to the Alliance we have a fighting chance.I know you do not like the Alliance Garmmash and for good reason, but swear to me that you will work with them this time.” Garmmash would take off his helmet and now share Tarrog’s seriousness “Of course commander, I would not stand in the way of the Hordes best.” Tarrog silently nods at his friend “Now do as I said and get some rest, we’re marching at dawn.” Garmmash would follow his commander's orders this time “Will do old man.”  Tarrog would laugh at the comment made, then his face would turn neutral. Tarrog watches Garmmash leave with worry. “What if he is too unstable and turns on the Alliance as soon as we break open the gates to the Lich King's stronghold…”\n\nBorean tundra would always supply you with unforgiving weather conditions, but for some reason it was almost completely silent...besides the happy War Drums of the marching Kor’kron. With his axe on his back Garmmash would happily play his drums. Behind him Thorek synced in with his flute, and to Thorek’s left Nash’rah like a gong struck her shield matching that of the drums. The rest of the soldiers including Tarrog would sing and let the music carry their voices. The march covered both rock and snow, forests and puddles. The party of warriors finally reached their destination and the martch would come to a halt. “Before you’re instructed about the coming battle your armor shall be replaced to match the current Kor’kron design.” Tarrog said as each of his breaths would create a small cloud of condensation around his mouth, much like a frostwyrm ready to exhale. “You will find all that you need here at the Kor’kron Vanguard.” Tarrog said pointing towards the base that would shine like a red jewel in this cold wasteland. The group of warriors would find assigned boxes with their regiment name on it. Inside these boxes the party found themselves a brand new set of armor, this time covered in spikes and red plate. Along with that a white and red tabard representing the Horde as a hole. Now, equipped accordingly Tarrog would gather his soldiers once more. “During this fight I will hand over the command to Saurfang’s son, Dranosh. To make it easier for you just pretend he’s still me” Tarrog would grin at his own joke. Tarrog then turns towards Garmmash, Lieutenant Garmmash you’re with me. Garmmash mentaly preparing himself for the fight simply nods and says “Yes Commander Tarrog”. \n\n“I cannot stress how important this is, we’re fighting alongside the Alliance in today's battle. You will do so with respect and nothing else.” Tarrog looks around at his troops making sure they heard what he said. Garmmash instead of nodding or giving any sign of understanding looks down at Angrathar, Bolvar has arrived. All of the Kor’kron, Taunka and Darkspear trolls would just stand silently atop their hill awaiting orders. Meanwhile the Alliance had raised their shields and drawn their swords. It was fast and loud, Bolvar led the charge. Undead, ghouls and abominations fell by the hands of the Alliance, but they were struggling. The hellish gate guarding Icrown suddenly opens, out of it comes frozen Vrykul screaming and cursing in their ancient tongue. It was then that the call of Dranosh could be heard “Rise up sons of the Horde, blood and glory awaits us!” This would shock  Garmmash as he was already too focused on the Alliance’s combat movements. He’d join in on the rush to their wolves. The Horde armada stormed the Wrath gate with Dranosh spearheading the attack “Lok’tar Ogar, for the Horde!” \n\n“Combat” Garmmash thought to himself as his axe alongside Tarrogs would invite itself into the legs of an abomination. “It’s what defines us, makes us strong.” Once the thought had passed Garmmash gave into his rage. The Orc would roar and free his axe from the abomination, now directing it to the monster's belly. Garmmash hacks away at the fleshy construct with all his strength only to have his axe get caught in the chains that decorate it’s arms. Just in time however Tarrog would splinter the rusty chains with his sword, this act gave Garmmash time to raise his axe and block the killing blow. While the undead now focusing on Garmmash, Tarrog took his chance. The commander climbed up on the monster’s exposed ribcage and with a single thrust impaled the undead's head through it’s chin. “You’ve got to be faster than that Garmmash” Tarrogs laughs. At that exact moment Garmmash throws his battleaxe at Tarrog, the commander would duck of course only to hear the dying screech of a ghoul. “Fast enough for you, commander?” Now they’d both share a smile with each other, recognizing the irony. Garmmash would run up to the now corpse and retrieve his weapon. The battle would not last long before Azeroth's overwhelming strength would prevail. The path to the gate was now littered with corpses. Highlord Bolvar would speak “ARTHAS! the blood of your father! of your people, demands justice! Come forth coward and answer for your crimes!”\n\nAt first you heard nothing, then the hellish gate opened it’s dirty jaw and spew forth the Master of undeath. Intimidating as he was tall, the Lich King steps forward with a hard grip around his cursed blade. The Lord of the dead holds his monologue, but before he could finish it Dranosh cries out “Enough talk, let it be finished!” Life and death balances on a double edged axe, today that axe was broken by one swift strike of the Lich King. Dranosh’s body would fall to the ground. Everyone in the crowd held their breath as they witnessed how Arthas claimed the fallen Orcs soul. Angered by the demise of his new found ally Bolvar states “You will pay for all the lives you’ve stolen TRAITOR!” This time Garmmash stands ready, ready to charge the Lord of undeath, perhaps knowing his demise. That faith would never be put to the test however. As soon as the bringer of cruelty tried to respond to what Bolvar had said a distant explosion could be heard. On top of a black hill dressed in a black robe stood the creature who would deliver many free souls to the afterlife. “Did you think we had forgotten, did you think we had forgiven? Behold now the terrible vengeance of the forsaken. Catapults hurld barrels filled to the brim with toxins at both the scourge and the living. Bolvar calls for retreat, Garmmash turns around and runs for his life. for a moment he turned back knowing that he would be one of the lucky few that came out of this alive. Even the Lich King could not withstand the toxins, the lord of undeath slowly starts to make his way back inside his stronghold. What was supposed to be the final push to bring Arthas on his knees had done nothing but litter the path with Orcs and humans alike.\n\nGarmmash turns to his commander and shouts “We’ve been betrayed by the forsaken! their people as well as their leader will suffer my wrath!” With that being said Garmmash thrusts his axe into the cold earth. Tarrog in a more controlled manner would try his best to make sense of it. “He must have acted alone...she’d never dare to actually...we lost almost our whole regiment…” with thoughts of vengeance filling his head Garmmash states that “We should siege their capital and burn it to the ground!”  Tarrog would finally meet the Lieutenants face, although not with a face of understanding but a face of terror. “This should be handled by the Warchief, not his soldiers.” Garmmash, angered by this, opens his mouth once more, “THE COWARDLY FORSAKEN LAID WASTE TO ALMOST OUR ENTIRE REGIMENT!“ Tarrog not raising his voice only narrows his eyes. “That was an order! Lieutenant! Form a small group and count the dead...I will do my best to make sure this information reaches Saurfang.” Steeljaw takes a hold of his axe still buried in the ground, he rips it out of the earth and points it towards Tarrog “I would die for the future of my people, avenge their deaths. What if I were not one of the lucky ones? My spirit would not rest knowing you would do absolutely nothing!” With that Garmmash slowly starts making his way back to what remains of his regiment. Garmmash turns his gaze with narrowed eyes at Tarrog one final time before carrying out his orders.  \n\n\n{img:Interface\\QuestionFrame\\answer-zone-Cataclysm:512:256}\n\n*Thud* The old taurens body hits the ground, leaving the arena filled with dust and blood. Hellscream after looking at what now remained of his opponent quickly moves on and raises his axe in triumph. Garmmash who had been on the edge of the railing the entire mak’gora, would together with the younger Orcs share their victory cires. Orcs like Tarrog sat down and looked at their hands, questioning their life. The tauren on the other hand would have none of it, some booed, some cried and some even yelled out insults. Finally the newly appointed warchief turns towards the cheering Orcs in the crowd and joins in on the roaring. This would only amplify their excitement. Because Garmmash was too caught up with cheering for his warchief he would not notice Tarrog sneak away from his seat. Tarrog finally reached the outside, he’d feel his heart pounding in his chest. The Kor’kron commander would falter to the closest pillar that held the arena on steady legs, he’d let his hand fall on his chest in order to attempt to calm down the anxiety. “What is happening to the Horde, killing our own. On what grounds did Cairne challenge the warchief to Mak’gora?” all these questions were casting back and forth in the commander's head, his state of confusion would not last long as his Lieutenant came running. “Tarrog what are you doing here? You missed the great news!” Garmmash said with enthusiasm. Tarrog would do his very best to sound honest and believable in front of what he considered to be the son he never had. “I am but gathering some air, I'm just trying to melt it all. What will happen to the tauren now? Perhaps they’ll stop trading with Orgrimmar?”. Garmmash would laugh and proudly state that “Even if that were the case it would not matter, the warchief has announced an invasion of Ashenvale to claim their resources. As you might recall they stopped all trading after what happend at the wrathgate”. “Not only that” Garmmash would proclaim “The Kor’kron are leaving the military in order to honor our new position as Hellscream’s personal guard!” \n\nGarmmash smiles at his commander and tells him that “It will be an honor to serve you in Hellscream’s name Tarrog. I will not let you down, with this newfound strength we shall take what the Horde needs!” Tarrog would try to smile back while thinking of the next thing to say. “What of Nash’rah and Thorek?” Garmmash turns around and points towards the valley of honor and tells his friend that they went home to tend to their children. “Nash’rah almost roared louder than me” Garmmash laughed. “You honor me with your loyalty Garmmash, I’ve not said it enough but you’ve been loyal as a wolf since the day that I met you. You’ve earned my respect a hundred fold.” Garmmash was taken by surprise by the comment and resorted to double tap his right side of his chest. “Thank you commander, now with Hellscream as our warchief we can finally ensure a glorious future for the coming generations. I’d love to stay and talk but Nash’rah and Thorek invited me to join them for dinner.” WIth that Garmmash with a kind face nods at his friend and walks towards the Valley of honor. \n\n“Warriors of the Horde, the Legendary Kor’kron! YOU have been chosen by the warchief himself to act as his personal guard and wrath. With such an honor comes recognition and respect. YOU are the Horde’s finest! Lok’tar Ogar!” Tarrog could hardly muster out the words of encouragement without thinking of his tauren brethren. The Kor’kron cheered and saluted their commander. “At ease soldiers, know your purpose as we march upon Ashenvale, the forestland of the night elfs.” Garmmash smiled “ Finally a challenge worthy of the Horde’s attention” he thought to himself as the Kor’kron together with the Horde’s main army left the gates of Orgrimmar. While marching Thorek would give Garmmash a friendly punch on his shoulder “Me and Nash’rah will be at your side when the battle begins, lieutenant. We trust that you will lead us well” Garmmash would look back and with an ensuring tone reply “It honors me friends, I trust you as much as I trust your cooking” all of them would laugh together. Garmmash then became serious and looked at his two friends “What are you two going to do once the war is over?” Thorek would be the one to reply “Raising our child of course. Me and Nash’rah have been thinking of having another one.” Nash’rah would grin at her mate stating “Another one? Thorek you better at least claim ten kills in the coming battle before you even bring up the subject.” Both Thorek and Garmmash would once again burst out in laughter. After the two of them were done laughing Nash’rah adjusted her shoulder pads and said “In all seriousness we are thinking about having another one, we would not want our firstborn to be without same aged company as it grows.” Garmmash nods and then asks “What professions will you be teaching them?” Nash’rah looked at Thorek who would nod back at her “We have decided that we want one warrior and one shaman, who will learn what is something we’ll figure out later.” Thorek then shifts the conversation by asking “I am curious about something, and no Nash’rah it’s not what provisions will be served at the camp” He smiled at his mate before continuing “Since we three fight in a unit Garmmash, what tactics are we going to be using?” Garmmash then points behind him. At the end of the marching army a group of what seemed to be at least 20 magnataur dragged along with ropes. To accompany them was a company of Proto Drakes taken from the Horde’s adventures in Northrend. “Besides the obvious, our Warchief will be joining us in this battle. Unlike that coward Thrall who let us do all the work while he played ruler in “His” throne room.” Nash’rah looks at Garmmash and says “Indeed lieutenant, it is nice to see a change of leadership. Then he killed that peace craving Tauren too!”\n\nAshenvale though being enemy territory had always fascinated Garmmash. The trees that decorated the lush forest were taller than five grons stacked upon each other. The Horde base located within the heart of the forest stuck out like a sore thumb because of its blood red colors. Garmmash had been tasked with making sure that his regiments' axes were in good shape before the battle. Steeljaw had almost finished his task before a familiar voice could be heard calling for him. “Lieutenant!” It was Tarrog. Garmmash would drop his axes and run towards his commander. “At your side Tarrog, i’m almost do-” Tarrog would interrupt Garmmash by holding up his hand as to stop him from talking “There is not need for that, I need to show you something important” Garmmash without questioning his commander would walk with him towards a white tent. “Why place a Tent this far away from the rest of the army? Doesn’t that seem a bit foolish.“ Tarrog quickly looks back at his lieutenant “That’s the point Garmmash, you’ll see in a minute. Tarrog opens the white tent with his right hand and gestures for Garmmash to go inside.The temperature inside the tent was way hotter than outside, it was hard to breathe. The first thing Garmmash could see was Orcs sitting on ammunition boxes. They were not excited or nervous like the rest of the warriors, insted sadness was painted across their faces. The tabards that’s usually crowned with the Horde’s icon, was seen ripped out it’s place. “Commander why have these warriors ripped out the Horde icon from their tabards? whatever game they’re playing, we do not have the time for this. The battle is abou-” “Garmmash” Tarrog would stop him with. “They have deserted...just like I have. It took a lot of thought, but we can no longer serve the Horde as long as the son of Grom is it’s warchief. We found out that in order to control the magnataurs, Garrosh has taken their children under control. Of course in normal situations this would be okay, but he plans not to return them to Northrend but rather release the children in Azshara. Azshara is crawling with predators, they’ll stand no chance. Not only because of that though, it turns out that Garrosh’s axe Gorehowl was poisoned by Magatha Grimtotem when he killed Bloodhoof.” Garmmash could not believe what he was hearing. “You’d desert the Horde because of some magnataur children?! They are nothing! And his axe was poisoned by Magatha, not himself. Poisoned or not he would have won the fight anyway! Stop this foolishness before it’s too late, don’t do this to yourselves. Think of all that you’ve built within the Horde!” Tarrog raises his voice and replies with “That’s exactly why we’re leaving the Horde. Hellscream is taking us down a dark path that we refuse to follow.” Now all the deserters stood up behind Tarrog as if to look intimidating. “Garmmash I brought you here because I know you’re better than this, unlike Hellscream you value honor and kinship.” Garmmash looks down at the ground breathing quickly as he narrows his eyes. “You’re my commander no longer Tarrog, I will inform the rest of your betrayal.” Tarrog tries to reach out with his hand to place it on Garmmash’s shoulder. Garmmash quickly smacks it away and screams “YOU ARE AN ORC NO LONGER, I WILL ENSURE THAT YOU AND YOUR PATHETIC BUNCH OF WARRIORS WILL BE MARKED FOR DEATH. Garmmash takes a deep breath before he continues. “If I ever see you again Tarrog I will kill you myself” With that being said Garmmash bursts out of the tent. \n\nGarmmash did not want to believe it, did he just mark his own commander for death. Tarrog had been like a father to him since day one. He would not care, Tarrog had always displayed a sense of weakness anyway. He was always held back by his peace craving ways. After running for about 5 minutes Garmmash reached Thorek and Nash’rah. “Nash’rah, Thorek to my side!” The two would come running “Yes, Lieutenant?” they’d say in unison. “I have some bitter news to inform you of. Comma-Tarrog has abandoned us!” Thorek  would speak “What are you talking about Garmmash?” Garmmash then looks at his friend “Tarrog together with a group of our own regiment has deserted us and decided to leave the Horde. He said it was because Garrosh will leave the magnataur children to fend for themselves once the battle is over. Also because Garrosh killed Bloodhoof with a poisoned weapon, apparently Magatha Grimtotem had coded it with toxins.” Now it was Nash’rah’s turn to speak “He would have killed him anyway!” Garmmash then replied with “That’s what I said! Although I am saddened because of what happened, I will not let this discourage us. I am assuming the rank of commander. Thorek, Nash’rah. Will you serve me as you once served Tarrog?” They both saluted the new commander of the Kor’kron “With my life” Nash’rah said, “With my life” Thorek said. “Good, I am making you both my lieutenants. My first official order as your commander is to eat harty, for today we shall bathe in elven blood. LOK’TAR OGAR!”  \n\n\n{img:Interface\\QuestionFrame\\answer-zone-MistsofPandaria:512:256}\n\nIt’s been 165 days since the Horde armady set their foot in the strong hold known as Domination point. Domination point served as a strategic point from which the Horde would launch attacks on the Alliance fortress, their foes had constructed their keep “Lion’s landing on the other side of the shore of Krasarang Wilds. However, the two forces clashing had proved to be equally matched. This would therefore not result in any victories, but destructive skirmishes that would paint the very land red with blood. Since day one Garmmash had been commanding together with Nash’rah and Thorek a much larger portion of soldiers ranging up to 3,000. Of course Garmmash being the orc who loves fighting as it is, he would be among one of the first to meet his enemies on the front lines. When the slaughter commenced, Nash’rah and Theorek would always be at his side. This is what it would be like for days, weeks, months, until one fateful day. \n\n\nNirash had just docked at the Domination point’s shore together with a small detachment of soldiers. Unable to admit it, she was a bit nervous. Nirash was not used to interact with such high authority. Nonetheless she would honor her orders given, escorted by two Kor’kron marines she’d walk the bridge that led to the stronghold. decorating the outskirts of the base was corpses painted yellow and blue. Nirash instantly thought to herself that this was a common tactic used by Steeljaw to scare and disgust his foes. The atmosphere inside the base itself was dry and silent as if abandoned. Nirash took a more careful hold of the letter she had been entrusted with as she came close to the Kor’kron. Nirash had never been in the presence of the Horde’s elite before. She was used to instruct and inform initiates back at home, these soldiers were something different. Since the Kor’kron was the spearhead of the Horde’s army they had to act as such. These warriors had therefore undergone a way more harsh physical training then the rest, explaining their huge stature and body mass.\nAnother way the Kor’kron differed from the main army at home was that they were not that talkative, they showed little interest in anything that would not advance their strength or glory. \n\nNirash would let her eyes wander over to her left, sitting under the cover of a spiked tent she could make out one male and female enjoying some arm wrestling. Once turning her gaze to the right she could see someone dawning the mark of a Lieutenant. She’d quickly rush towards the distant figure before two large Kor’kron stepped in her way. “What do we have here?” said the first guard in a joking manner. Guard number two would not join in on his friends attempts to be funny but rather show annoyance “Looks like someone is trying to get the attention of the Lieutenant. Listen here she is not interes-” Nirash had enough of these games and would hold up the letter in front of the guards, giving them a sharp glare. The letter would display the mark of Nazgrim, General of the Horde army. Both the guards would instantly back off and salute her while apologising profusely. At this Nirash would just roll her eyes and proced. Nash’rah was informing a squad of soldiers about today’s attack strategy when she was interrupted. “Lieutenant, I am sorry to disturb you but I bring with me urgent news from General Nazgrim” Nirash held forth the letter. Nash’rah shocked at first by the General's mark quickly composed herself infront of her troops “Men I must leave you in the hands of the less experienced Lieutenant Throek” She’d point at her mate with a mocking grin, her troops would laugh along her while doing as told. \n\n“What is your name scout?” “Nirash, Lieutenant.” After skimming through the letter Nash’rah would rise one of her eyebrows while looking at Nirash with confusion “Nirash, this should have been directly delivered to Commander Steeljaw.” Nirash realising her mistake would open her mouth to explain herself, but before she could she would be stopped by Nash’rah’s hand. “A sorry Lieutenant will do just fine. Tell you what, today is your lucky day, I will personally make sure this reaches Garmmash. You can stay the rest of the day since the next ship arriving here will be in the morning. Guards! Make sure you give Nirash here a nice tour of the place.” Nash’rah would gesture to the same guards that tried to mock Nirash earlier to accompany her. They would salute their Lieutenant and rush to Nirash’s side. As the three were leaving the scene, guard number one would open his mouth “Sorry for my behaviour earlier, I’ve been extremely bored these past hours. Why don’t you show me your strength in a game of arm wrestling?” Nirash with the intent of matching his confidence would look him into his eyes and reply with “Show me what you’ve got then big guy”. Nash’rah overhearing their conversation would just shake her head at their childish behaviour. \n\nNash’rah would make her way to the main building, her thoughts drifted as she conquered the many stairs that the construction had to offer. Thoughts about the end of the war, thoughts about Thorek, thoughts about their child. She had to snap out of it however since she approached the top. Garmmash was found to the left discussing something with warlord Bloodhilt, Nash’rah without saying anything would just wave in Garmmash’s direction, he would instantly see her and excuse himself from the conversation. Nash’rah watched as the commander left the war table. Once Garmmash came close she started to walk down the stairs, Steeljaw would do the same. “Commander I have a letter assigned to you, it’s Nazgrim.” Garmmash nods understandingly as he rips open the paper while still standing in the middle of the stairs. While reading Garmmash noticed how Nash’rah looked at him, perhaps she too longed for a solution to this war. Garmmash would then out of nowhere raise his head as if he was in a hurry. “Nash’rah, find Thorek and meet me behind the building at once”. “At once commander” Nash’rah finds her husband overlooking his soldiers physical training. She stopped for a second to admire his passion and confidence. Thorek would see nothing but blue corpses on the battlefield this day. his troops shall be in shape before the ensuing battle, before he could finish his training program however, a hand would fall on his shoulder. The hand would drag him backwards followed by a whisper. Thorek after hearing what Nash’rah had to say immediately announced that the training would be put on hold until further notice. Together the pair walked to their usual meeting spot, Garmmash was waiting there with an open fire and some drinks. \n\n“Good, you’re here. Take a seat on these tree stumps. The letter given to me by Nazgrim explains a situation that both angers and excites me. What would you like to hear from first friends?” Thorek takes a sip out of his drinks and, lower his hug and says “give us the bad new Garmmash.” Garmmash adjusts his posture and stands up “Because of our absens and isolation here in Krasarang Wilds we could not have known but…” Grammash hesitates for a moment. “We have been betrayed by the other races of Azeroth, they have joined the Alliance in order to destroy everything we have sought to build. They have taken Razor Hill and are using it to launch their offensive. This Darkspear rebellion is led by their blue skinned frogkisser of a leader, Vol’jin. We have been called back to Orgrimmar to defend our home and prepare for the coming siege.” Garmmash gave pause to let his friends comment on the matter, Nash’rah was the first one to speak “Morons! I will personally rip them to shreds! I will not see my life's work be undone by weaklings!” Thorek took a hold of his mate’s side and pulled her close, trying to dampen her rage. “Save that for our enemies.” Thorek then turned towards his commander while still holding Nash’rah. “Garmmash just like you I have secretly hated these disgusting races since we first came to this world all those years ago. This finally gives us the opportunity to silence their mewling, forever. I see this as good news.” Garmmash narrows his eyes and nods “You and me both then Thorek. there is more, Nazgrim has sent us a juggernaut large enough to carry our entire army, it will dock at our port in the morning. we will then arrive at ratchet and be escorted by caravan to the gates. Durotar is already under heavy control with Kor’kron scouting party’s killing everything that moves, we should be able to pass without any problems.” Thorek would finally release Nash’rah from his hug, she’d look Garmmash into his eyes and ask “And what was the good news?” to which Garmmash responded “Nazgrim says that if we successfully defend Orgrimmar the war will be over.”\n\nAs the three friends kept talking about the matter, the sunlight would vanish. The open fire was now the only source of light. All the other soldiers and officers had immediately gone to sleep upon hearing the news. Garmmash stood in front of his troops with a new kind of fire ignited within his soul, as rage fueled the orcs the promise of a swift end to the war made the crowd roar with excitement. Hours later Garmmash, Nash’rah and Thorek were sitting outside at their tree stumps once more discussing the matter. While Thorek was in the middle of discussing tactics Garmmash would interrupt him “How is your son old friend?” Thorek kind of shocked by the question relaxed his shoulders and let a huge sigh escape his mouth “He’s doing good as far as I know, Nash’rah and I decided he would be a warrior like his mother and father”. Garmmash would then look down in the grass while resting his left arm on his left leg and reply with “By ending this war you will successfully have created a future that he can prosper in...who knew our final fight would come so soon, and with so little preparation.” Nash’rah picked up a log and broke it in half before tossing it into the fire “We shall do anything to ensure a glorious future for our son, giving our lives if we have to.” Everyone stayed quiet for a couple of seconds before Garmmash broke the silence “Rest well now friends, tomorrow we shall finally see Orgrimmar again, and if need be...giving our lives to preserve it.\n\nThe familiar heat of the Barrens would for once be a welcome feeling as the juggernaut docked at ratchet harbor. The Orc waiting for the higher ranks to arrive would offer more than what was promised by General Nazgrim “Commander Steeljaw, it’s an honor I have been instructed to give you these three Wyvern’s to you and your friends.” Garmmash would quickly dismiss the offer with his hand, stating that he would suffer together with his soldiers. “You may take them back to Orgrimmar soldier, and do not venture out here again unless given the order.” The orc would salute and do as told. Garmmash, Nash’rah and Thorek would along with a group of Kor’kron mount a caravan dragged by a Kodo. \n\n During the ride home the warriors would finally get to see this reforged Barrens. Kor’kron slaughter houses, oil rigs and lumber camps had been constructed. It was glorious. The soldiers already out patrolling recognized their ranks and saluted the commander and his lieutenants, Garmmash took huge pride in this. He had really made a name for himself within the true Horde. Once the caravan had passed Nozzlepot’s outpost the kodo started to grow uneasy, the chauffeur would notice this and looked behind him for what he thought could be a Savannah Prowler scaring the creature. The Kor’kron was sitting in silence as they heard the chauffeur scream “Rebels!”. The Caravan stopped immediately as the kor’kron dropped on to the ground, these fools had messed with the wrong transport. In the distance a group of trolls riding their traditional raptors came at dangerous speed, what disgusted Garmmash the most was seeing that they were led by an orc. Garmmash alongside his warriors quickly reaches into the caravans storage and pulls out their war axes “This will be the first of many treacherous primitives to fall on orcish soil, crush them in the name of Hellscream!”. Once in range of the caravan one of the trolls fired an arrow instantly piercing the throat of the chauffeur. They had stopped the kor’kron supplies from reaching Orgrimmar , now all they had to do was finish off the soldiers.\n\nLike a wolf stalking its prey the raptors surrounded the warriors with murderous intent. In order to avoid this situation Garmmash ordered his warriors to perform a counter attack only known to his regiment. This counter attack involved charging left and in the last second switching stance with a spin and striking right, Steeljaw used their coded language in order to confuse his foes “ Flay them like dogs!”  As one unit the Kor’kron selected and started running towards one of the raptor riders knowing exactly what to do. The lone orc leading the rebels during this whistled once and clapped twice, the sound of steel meeting plate filled the field as all the orcs attacks were paired simultaneously. Garmmash was in shock as to how this orc had knowledge of a tactic he invented alongside his regiment. “Who are you traitor, and how do you know my tactics?!”. The orc would give the trolls a motion that in their code language ment “Give space”, he’d the hop of his raptor and start moving towards Garmmash. Hellscream's soldiers would watch with caution as this unknown orc step by step came closer to their leader. Once a meter away the Orc would stare Garmmash dead in the face “I know more than just your tactics, I invented them.” Tarrog threw his helmet to the ground exposing his true identity. Upon seeing this Nash’rah wanted to do nothing more but to charge the fool into the ground, Thorek however just as rage filled as she stayed her hand. “You dare show your face here traitor!” Garmmash screamed. Tarrog however was calm and collected. “Can you not see what your warchief has done? his drive for orc supremacy has taken so many innocent lives.” Garmmash was not amused by the way Tarrog was disrespecting the warchief. “Hellscream has shown us what I knew from the day I came to this world. There is but one Horde, THE TRUE HORDE. IT IS ORCISH BLOOD THAT COURSES THROUGH ITS VEINS”. Tarrog would take a step back and point to his troll friends and speak, these people have done nothing to deserve this fate and you know so. Order your warriors to lay down their weapons Garmmash, I know you’re better than this.” Garmmash would expose his tusks and narrow his eyes “THOSE CREATURES WILL DAMN US ALL, I CHALLENGE MAK’GORA”. Tarrog would turn towards Thorek and Nash’rah “Look at what this Horde has become! Nothing but bloodlust and meaningless war.”  Nash’rah had enough of this weakling running his mouth so she spat him right in the face followed up with “If I was in the commander's place I would gladly take your life, but that honor does not belong to me.” Thorek would be the next one to speak “Know that before you lose your pathetic life, that you tried to destroy everything our people have built up over YEARS! something I will give my life defending.” Tarrog now understanding that he could not change anything, not Garmmash, not his friends wiped the spit out his face and raised his shield “Challenge accepted” \n\nWithout wasting a single moment Garmmash lets his warcry ring across the Barrens as he charges his former commander. Tarrog quickly raises his shield in order to block his former lieutenants axe. “You were like a son to me!” Tarrog cried out, while thrusting his sword towards Garmmash’s gut. Steeljaw quickly dodged to the side and lending all his strength to his arms allowing his axe to fall upon Tarrogs shield “DIE!”. The shield would break under Steeljaws might, cutting through the material into Tarrog s left hand. Tarrog screams as he drops his shield, but through the pain he noticed that Garmmash left himself open for an attack. Tarrog swung with what little strength he had left and dug his sword into Steeljaws leg. This however proved to be Garmmash’s breaking point. The kor’kron commander had not suffered and bled for his Horde just to die now, something clicked and Garmmash roared “AAAAAAAARRRRGHHH” his eyes turning red. Garmmash took a hold of Tarrog’s throat and lifted him up at least a meter, he then proceeded to pull out Tarrogs sword from his own leg, ignoring the pain that followed. The Darkspear trolls and Kor’kron watched as Tarrog was gutted over and over and over again. It was so unrealistically beautiful, like a child telling a story of how strong he was. Tarrog would fall to his knees, blood pouring out of his mouth. His eyes were almost black due to the damage. “Kill me and you will lose the little integrity and honor you have left. You destroyed the Horde…” Garmmash having dropped Tarrog’s sword now circled the old orc like a wolf all the while holding the edge of his axe at his throat. “As far as I can tell, out here…” Garmmash took a pause to look at Thorek and Nash’rah who nodded at him “I AM THE HORDE”. The sound of steel cleaving through flesh was a sound now so familiar to Garmmash, much like a wolf howling. Garmmash revels as his grin gets coverd in the blood of his mentor, laughing while killing him, manically. Tarrogs head would lose all attachments it held to the body and paint the red desert of Durotar even more so. The trolls' faces were horrified. The Kor’kron shared their victory cires before rushing the trolls. One of Garmmash’s soldiers knocked into his arms while he ran past him, he didn’t mind it, not at all. “With their newfound moral the kor’kron made quick work of the darkspear, screams and cries could be heard all across Durotar. Once all of them laid dead Garmmash ordered his warriors to push down all the corpses into the Southfury River “Send their bodys back to Vol’jin as a warning for what happens to those who would rise against our Horde!”\n\n\n{img:Interface\\LFGFRAME\\LFGIcon-OrgrimmarDownfall:256:256}\n\n\n\n\n\n",
