		["[MSP]Zhoka-ArgentDawn"] = {
			["character"] = {
				["CU"] = "Looking over others with a polite smile on his face.",
				["CO"] = "Shadowform is IC\n\nThis character is intentionally strong. He exists to help drive narratives and offer alternative viewpoints, he's not here to lord anything over you. Feel free to challenge his religion and beliefs.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 75,
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Ritual Garb",
						["TX"] = "Zhoka is adorned in ceremonial attire befitting a worshipper of Death. Though it leaves little to the imagination he claims that the primal connection it gives to Death strengthens his resolve and belief.\n\nThe garb (or lack of it in places) offers little in the way of physical protection, however he seems unconcerned with the potential dangers it brings.",
						["IC"] = "inv_shoulder_cloth_zuldazarraid_d_01",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Presence of Death",
						["TX"] = "To those attuned to the magical and spiritual world they might feel the unsettling presence of death itself around Zhoka.\n\nTo those more educated in these matters they may perhaps be able to identify the source as Bwonsamdi himself.",
						["IC"] = "ability_racial_embraceoftheloa_bwonsomdi",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "\"The Black Harvest\"",
						["TX"] = "This colossal scythe is as big as Zhoka himself.\n\nHeavy and weighty the scythe's blade shimmers with dark shadow magic, wisps of purple smoke coming from the blade when it's in Zhoka's hands. It is most certainly more than just a ceremonial instrument.\n\nThe scythe itself burns anyone who tries to wield it, save those who are blessed by Death.",
						["IC"] = "inv_polearm_2h_battledungeon_c_02",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Perpetually tired",
						["IC"] = "spell_nature_sleep",
						["TX"] = "Zhoka constantly looks like he hasn't had a wink of sleep. His eyelids are always drooping as if he's about to fall asleep and the bags under his eyes show how little he does manage to sleep.",
					},
					["4"] = {
						["IC"] = "ability_warrior_intensifyrage",
						["TI"] = "Tall and imposing",
						["TX"] = "Zhoka is quite tall for a Vulpera, towering over his kin and standing a full head above them with a rather broad figure.\n\nHe certainly takes good care of himself as well, strongly built and developed musculature makes him rather physically impressive and imposing.",
						["AC"] = true,
					},
				},
				["ST"] = {
					["1"] = 0,
					["3"] = 3,
					["2"] = 1,
					["5"] = 0,
					["4"] = 2,
					["6"] = 2,
				},
				["v"] = 42,
			},
			["time"] = 1603284953,
			["link"] = {
				["Zhoka-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-deathknight-cover:256:256}\n\n{h2:c}{col:a32466}“Do not worry, death is a natural part of the cycle.”{/col}{/h2}\n\n{p:c}Not many Vulpera dedicate themselves to the service of a Loa, fewer still dedicate themselves to the Loa of Death, Bwonsamdi. Zhoka is one such Vulpera, born into a long line of loyal servants who enact their Loa's will, shepherding souls to The Other Side and ensuring that no spirits are lost to memory, lingering where they do not belong.{/p}\n\n{p:c}In order to better enact the will of his Loa and see his duties to completion Zhoka has taken to travelling the wider world, exploring new lands with new companions as he seeks to bring rest to any and all spirits; be they followers of Bwonsamdi, the enemies of his allies or simply a lone wanderer who was lost and forgotten.{/p}\n\n{h3:c}In the end death claims us all. It is simply inevitable.{/h3}",
				},
