						["TX"] = "Usually seen in the colour of her kin, red and gold, Tae shows off the pride she has for her people. Usually seen in a mix between leather and mail variants for armour.\n\nUsually equipped with her trusty bow and sword on her person at all times, and if not, she can be seen with a small dagger in her boot.",
