						["TI"] = "Piercings  / Jewellery",
						["TX"] = "Tae would have an assortment of Jewellery and peircings, the most obvious being a golden feather dangling from her left ear. Golden cuffs cover up most of her ears as well.\n\nA fabric rope made into a bracelte adorns her right wrist, showing off two blue beads.",
