				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h3:c}{link*https://imgur.com/a/zLlOh1V*~Tae's Best Bits~}{/h3}\n\n{h3:c}{link*https://imgur.com/a/JcSLwDs*Full Art Gallery}{/h3}\n\n{h2:c}Appearance{/h2}\n\n{p:c}Standing infront of you would be a 5ft 7 sized, slightly tanned and toned elf, keeping herself fit and healthy. No scars would on this elfs body, seeming she was either new to the whole experience of war, or just that good. \n\nHer hair, a mixture of blonde and brunette, would look as soft a silk, seeming to keep it well groomed and cared for, looking after it well,although seeming to be a tad scruffy when coming to the style, some tied into plats, being held together by what looks to like an emerald encrusted hairband. The rest being set free to flow in the wind.\n\nThis Fel green eyed elfs facial features seemed one of grace and beauty. Her features showing off a few assortments of jewelry, being that of what seems to be golden cuffs covering most of the upper and lower ear on each side. As well as the cuffs Taeralith would also have a small golden feather dangling in the top of her left ear.{/p}\n\n{h3:c}Abjuration - Fundamental Awareness\n Conjuration - Advanced\n Evocation - Novice\n Divination - Novice\n Enchantment - Intermediate\n Illusion - Intermediate\n Transmutation - Intermediate\n Necromancy - Unknowing\n Rune-Casting - Advanced\n{/h3}\n",
