			["about"] = {
				["v"] = 5,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Challenges\\challenges-gold:256:256}\n\nAumellia was never the most attractive of Elves. Like all Sin'dorei, she is beautiful by human standards but it's unlikely she'd ever turn any heads on the streets of Silvermoon. Just by looking at her, you can see she's been around a while. She's no young woman, but she's no hag either.\n\nAs a result, she was always seen as the \"older, uglier one\" when compared to her younger sister, who had always adapted to the social niceties expected from the upper-crust of society with much more ease.\n\nDeciding that being married off to some lesser nobleman was not what she wanted out of her life, Aumellia served her people as a soldier for many years, much to the chagrin of her family, before becoming one of many who could bend the Light to their will by siphoning the Light from the then-imprisoned M'uru, causing a faint warmth to radiate from her, which others can feel if they are close enough.\nShe keeps her blond hair tied in a bun fashioned so it will not be a hindrance to her during battle. Battle being something she has seen for many years, and has led her to collect a rather extensive collection of scars on her sun-kissed skin, the most notable of which being the one that runs vertically down her right eye, permanently closing the once shining Fel-green orb that is now hidden beneath a simple eyepatch.\n\nBesides being just a tad taller than the average female of her kin, she is fairly curvateous and sports a reasonable bust that compliments a body marked by toned muscles developed after almost a lifetime of battle. More often than not, her body is encased in her suit of armour, which she sports whenever necessary, along with an expertly crafted greatsword resting inside a scabbard upon her back, and a rather simple looking dagger at her hip. \n\nDespite this, she is not opposed to more casual attire when off duty, along with a few small, simple golden rings on her long ears for decoration.",
