				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGICON-CAVERNSOFTIME:256:256}\n\nStanding at average height, weight... Actually she doesn't really stand out at all in any of those departments... Hm. Anyway! Buxtwit Boomnozzle! Something of a peroxide blonde bombshell (although you might spy the odd dark purple root here and there) usually ties her hair up in a messy bun so that her pale brown eyes can see what's up. Her make-up game is usually on-point; tastefully minimalist by goblin standards, save for a luxury smattering of chocolate lipstick. Her large ears are peppered with colourful gems of all kinds. You might spot a rare wrinkle or crow's feet when she smiles, but I wouldn't draw attention to it...\n\n{img:Interface\\LFGFRAME\\LFGIcon-TheVioletHold:256:256}\n\nBuxtwit prefers to don herself in oranges, browns and most importantly, golds. Her clothes are finely stitched and don't seem to suffer any wear and tear whatsoever. Huh. Weird. Her gloved fingers are tipped with no less than six gaudy rings - three per hand. The biggest draw is probably the ornate clock lashed to her belt, dials and hands spinning wildly one moment before slamming to a halt, and... Reversing? Oh, looks like there's some dust or sand on that- you know what? I'm not going to touch this broken clock.",
