			["about"] = {
				["v"] = 6,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n\n\n\n{h1:c}Appearance{/h1}\nIn further details of his body, he's clearly one of the older zandalari. An elder, and at that, a highly esteemed and renowned man. With his appearance it crosses people with handsomeness to an extent.\n\n\n{h1:c}History{/h1}\nHis history remains rather simple. He was meant at birth to reach higher ranks and high esteem, and so he did. His childhood and life was devoted to understand all the magic he could possibly gather, is it from books, other arcanitals, other families and even the loas. He grew to be an asshole and so he remained, taking advantage of anyone and anything to get what he wants; Power.\n\n\n{h1:c}Personality{/h1}\nIncredibly narrowminded and prideful, he looks down upon the weak people that surround him, anyone who laughs is counted as pure death to him. There's nothing fun in his eyes, expect others struggle to deal with him. Lesser races, aka, all other races expect pure bred zandalari trolls, would more than never ever see him look upon them with a slight hint of appreciation, and if he does, he wants to learn something from them and dump them right after in like the trash they are.",
