					["2"] = {
						["AC"] = true,
						["TI"] = "Old yet Young",
						["TX"] = "Vul'zons skin seems to be in a constant cycle of regeneration and decay.\n\nHis skin is sligtly sagging, he has sunken eyes and on some parts of his body you can sometimes see small bits of muscle poking out. However these wounds seem to close up almost as quicly as they came.\n\nThis, plus his stark white hair, usually gives the illusion that he is much older than he really is.",
