			["about"] = {
				["v"] = 3,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Vul'zon is a death knight of the ebon blade, and former follower of bwonsamdi. He was born and raised in Zuldazar along with his brother Jarzac before dying in the battle of Dazar'alore and later being raised as a death knight.\n\nVul'zon may be a death knight but his personality is anything but dead. He isn't the most clever when it comes to social situations and sometimes let's his mind wander, usually leading to him just staring at watevers around, including people, which has gotten him in some awkward situations. He isn't above some friendly banter but tries his best as to not go to far. He has always been impulsive, to the point that his brother has had to hold him back from escalating the situation if he lost his cool. Though his temper has improved a lot, he is still pretty impulsive.\nVul'zon has a tendency to get pretty protective of his friends should he feel the need arise. If there is one thing that Vul cannot stand, it's troublemakers. The people who pick on others for being different, and can get pretty violent should someone push him over the edge. His temper has gotten better over the years but he still isn't above losing it every once in a while.\n\nVul spends most of his time in Acherus, helping his fellow knights on their missions or if not helping wherever he can. If he isn't on duty, he can usually be found in either Orgrimmar, Dalaran or in zuldazar with his pet raptor Skully.\n{img:Interface\\TALENTFRAME\\bg-deathknight-unholy:512:512}\n",
