					["TX"] = "{col:d6ff2e}{/col}An orphan brought through Black Portal  as infant to be raise as savge warrior like the rest of my race. However, the convoy i was in got attcked by Alliance battalion and everyone got  either killed or captured. Then, i got sold to old dwarves couples who thier kids abandoned them but riased me as thier own in the small shack in Coldridge Valley , my adopted father was member of Explorers' League who was crazy about Azeroth and its treasures and my adopted mother was a baker in Ironforge , we been traveling all around Azeroth due to my father been member of the Explorers' League. Traveling since young age made explore new lands and exposed to the world history, new races and cultures. Then, I know why my father was in love with Azeroth which made me apply to the same guild when I reached to the required age.\nAfter, number of years of serving the guild  I got bored of my duty because I want to live free and see every part of this world and share this experience with others, so I quite working for Explorers' League and opened my own business which will help me to achieve this dream!!\n\n\n{h1:c}{col:3816ff}***Viko’s Tours Agency ***{/col}{/h1}  \n\n{col:2b79ff}{/col}{h2}Our Agency will provide you a personal Tour around Azeroth for you or for your party which can provide with any of:\n-Checking old and intersecting places.\n-Historic and lore heavy spots.\n-Riding long for chat and good laugh.\nNote: our services are free of charge, but we accept tips.\n{/h2}\n",
