					[1600510621] = 1,
					[1362779315] = -1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-TyrandesFavoriteDoll:512:256}Lady Hollowheart formerly known as Lady Andaline Songheart served as a Mage-Priest of the High Kingdom. She was stationed within the realm of Startholme and witnessed the Purge of Stratholme. The young Priestess eventually herself suffered the Black Curse and rised as one of the many members of the Scourge.\n\nDuring the freeing of the enslaved Undeads under the Dark Lady's command Hollowheart was one of the first to regain control of her own mind. Due to her new appearance and the lack of empathy for the rest of the living world she found that the former Priestess of the Light no longer existed, she were now merely a vessle filled with the High Elf's memories. The bright colores that once played over her regalia were no longer suited for the dark twisted woman. She began to shroud herself in grey, gloomy and often darker patterns. Her holy tomes were replaced by those that whispered of the darker paths. She shooned everything that recalled of the Holy Light, yet her knowledge for its powers never leaved her. The Darkness and the Light must remain in balance!\n\nShe quickly gained new strenght and power within the Cult of the Shadow and soon became one of the Dark Sisters within the order. However, at the time of the rebellion against the Lich King and his Scourge the Priestess found her former close ally Robert Livingstone, a human hunter which she had befriended during their time in Stratholme. Yet, the thing before her was no longer her friend nor could she feel anything for him, only the memories of him. They fought and Robert eventually fell down. But, the sinister and twisted thoughts that lured within Hollowheart's mind did not prevent her from accomplish another deed up on the man's corpse. Not only did she still her hunger for flesh but she also kept a little \"souvenir\". His right eye.\n\nThe very eye now rests in a pendent and allows the Priestess to see things that are out of reach for the normal human sight. However, the amount of time during her schoolaring within the Dark Arts manifested a part of power within the eye, which now grants her the ability to forsee glimps of the future!{img:Interface\\Pictures\\artifactbook-priest-cover:256:256}",
