						["IC"] = "artifactability_balancedruid_moonandstars",
						["TX"] = "Like many of the Nightborne of Suramar, Sylineth's form is covered in arcane baced Tattoo work, however each of Sylineth's tattoo's are designed as an outline to a star constellation, and none are identical. ",
