				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Personality",
						["TX"] = "Angel is kind, calm and a bit shy. She is always happy and trying to make her friends happy. If someone has some problem with something or someone Angel is the first person who want to help. Sometimes she is a little bit childish, but she is just trying to enjoy her life. A happy little elf.",
						["IC"] = "ability_paladin_blindinglight2",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Features",
						["TX"] = "Angel has an angelic face. Golden, shiny eyes. Pretty freckles. A scar across her right eye (Sight still perfect). She has really light coloured blonde hair, almost white and really long, of course well cared. Under her right eye the people can find a black feather tattoo. She has a golden highlight in her hair on the right side. Of course she has piercing in her tongue, eyebrows, has a septum and both ears pierced. She has shiny golden runes on her right upper arm. She has a light vanilla scent. Next to all this she has really kind calm and soft voice.\n\nMakeup:\nAngel uses some makeup like every girl. She has black and gold eyeshadow, cattish eyelinder and long eyelashes. Her lips has a light pink colour, shiny lip gloss.\n\nNails:\nAngel has not too long gold and black fake nails. Her ring fingers are black, they has a golden feather decoration. Every other finger are golden coloured.\n\nHey.. She is a fighter, but still a woman.",
						["IC"] = "inv_legion_faction_valarjar",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["TX"] = "Angel has a massive Holy aura. Everyone who is closer to her can feel this. If an undead, death knight, demon hunter or void elf standing next to her they can feel it and it can affect them. (If the person agrees with this.)",
						["IC"] = "spell_holy_healingaura",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Skills",
						["TX"] = "Angle is a skilled Crusader. She is experienced swordwoman and shieldmaiden. She also really good at using the Light. A strong battle medic.",
						["IC"] = "spell_priest_divinestar_holy",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Armour and weapon",
						["TX"] = "Angel prefet the heavy, but pretty armour. Her main colours are the black, gold, silver. The heavy armour made from iron, leather, bones and cloth. Of course because of the weight she always walking with loud, rattling noise.\n\nHer ,,best friend'' is her long sword on her back. The same golden, black and silver colours. If she is without the sword the people can find a shorter, one handed weapon on her waist and a heavy shield on her back.\n\nOf course both weapon is ,,sleeping'' in a black leather scabbard. The shield has a strap from the same black leather.",
						["IC"] = "inv_belt_plate_raidpaladinmythic_q_01",
					},
				},
				["v"] = 30,
			},
			["time"] = 1603307382,
			["link"] = {
				["Alirah-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n{p:c}Still WiP{/p}\n\n\n{h1:c}{col:fffa00}Alirah ,,Angel'' Crimsonflame{/col}{/h1}\n\n{h1:c}{col:ff0800}Life in the hell{/col}{/h1}\n\n{p:c}{col:fffa00}Alirah was born is Quel'Thalas like every other elf. She had a perfect family. Her father named {col:ff0200}Thal'Rael Crimsonflame{/col}{col:fffa00}, a strong and brave warrior, her mother was {col:ff0200}Shel'arah Dawnfeather{/col}{col:fffa00}, she was a priest. Angel had a sibling, an older brother named {col:ff0200}Etheral Crimsonflame{/col}{col:fffa00}, the family's ranger. She was the youngest, a beginner priest. Her mother always teached her something new. The whole family was close to each other. They lived happily in the city until the day when Arthas payed a visit to the city. Everyone fought for their home. The father and brother was in different divisions, only Alirah's mother was with her to help her through in this. The two healed the injured elves day and night without any rest. They was so tired in the end. Those who came out alive went back to the city. Angel and her mother found {col:ff0200}Thal'Real{/col}{col:fffa00} and healed him. Now the three tried to find the lost child. So many days passed, so many dead elf came back to the families to take the last goodbye. {col:ff0200}Etheral{/col}{col:fffa00}'s body came on the last day. A raised, dead death knight. Arthas killed him, raised him and then he died again. The whole family lost the will to live. The sorrow took over their days and nights. They moved to Dalaran with hope in their heart for a better life. But... It never came...{/col}{/p}",
				},
