			["character"] = {
				["CU"] = "Bloody three fingered handprint covering her mask",
				["CO"] = "HP: 9/10\n\nRecruiting for Blood Howl!! If you're interested in fighting for the Horde and doing event based RP throw me a whisper.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 58,
			},
			["time"] = 1603307114,
			["link"] = {
				["Cacklespine-ArgentDawn"] = 1,
			},
			["about"] = {
				["vote"] = {
					[1066531366] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://78.media.tumblr.com/23eac045c2d563505d045ac3da93f244/tumblr_p2pkkfn3zz1ufc8slo1_1280.jpg*Character art by Fabcrabby on Tumblr!}\n{link*https://www.deviantart.com/forgedfromvhs/art/Cacklespine-777916697*Cacklespine art by ForgedfromVHS}\n\n{h1:c}Appearance{/h1}\nCacklespine is a grey skinned Orc and her body type is musculuar and well-built. Standing upright at 6'1\", she stands to a rather average height for an Orc. \n\nHer skull mask is chipped and damaged in various places, having been repaired numerous times over and has clearly visible cracks and stitches across the surface of the skull to keep it held together.\n\nShe often covers up with leathers and armor made of chainmail and bones. But when her arms and legs are visible, they are covered in scars and have an assortment of piercings made of bone running up her limbs.\n\n{h1:c}Personality{/h1}\nCacklespine is a chaotic individual, she often does as she pleases and her loyalty is hard to earn. But, once earned, she becomes a steadfast friend and companion through thick and thin. More than willing to lay down her life for those she considers close to her.\n\nBeing someone who grew up in Gorgrond Jungle, she has become quite jaded to the idea of death and thinks little of it. It's just a natural part of life and could happen at any time, but it's more important that you live your life now to the fullest instead of worrying about tomorrows disasters.\n\nReady to laugh in the face of danger and tackle any threat, she still views fighting as a pragmatic solution. Thinking little of glory or honor, Cacklespine will gladly fight dirty or use guerilla and ambush tactics to get the upper hand without fighting fair. A product of living in Gorgrond where everything is bigger than you and much more dangerous than their Azerothian counterparts.\n\n{h1:c}History{/h1}\nGrowing up in Gorgrond Jungle sure makes for an interesting childhood. Dodging and skirmishing botani and her rivals from the Blackrock Clan of the first twenty years of her life.\n\nDuring her earlier years, she quickly learned that she had a talent for managing and 'taming' insects. Even the giant ones of Gorgrond. And so, she would often grab a giant wasp or ravager companion for a few years until it died. Either in battle or of old age, as they often only lived for a few years at most.\n\nWhen the Iron Horde came and the Laughing Skull refused to join them, what was once simple territorial disputes between the two clans became a war. Regular skirmishes and life or death brawls shaped Cacklespine quickly. Learning to distrust and even fear the tech and weapons of the Iron Horde as she went. Which carries on today with her and Goblin technology.\n\nOnce the adventurers of the Alliance and Horde travelled to Draenor, she eagerly joined the comeback by aiding the Horde where she could to fight back the Iron Horde, and eventually the Demons trying to usurp Grom's rule of the Iron Horde.\n\nWhen that amtter was concluded, Cacklespine looked out at the world of Azeroth. A brand new world, unexplored to her Draenor people? She was thrilled, and filled with wanderlust. She came back through to Azeroth with the rest of the Horde expedition and began to travel.\n\nHaving fought for the Horde for a few years now, she considers herself one of them. Although that the Laughing Skull only worked with the Horde and never fully joined them weighs on her mind, but who knows what the future holds.\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-AmberFly:512:256}",
