						["AC"] = true,
						["TI"] = "Old Warrior",
						["TX"] = "You gaze upon an orc who looks visibly aged, though despite such he sports an impressive bulked mass of muscle decorating his body, along with scarifications.\n\nThe most standing out scar is the one on his face.\n",
						["IC"] = "ability_warrior_strengthofarms",
					},
					["2"] = {
						["IC"] = "inv_axe_2h_artifactarathor_d_06",
						["TI"] = "Kosh-Gar'mak",
						["TX"] = "An axe crafted within the Blackrock clan from the famous blackrock material. It appears old yet as deadly as ever. \n",
						["AC"] = false,
