				["v"] = 22,
			},
			["time"] = 1603410703,
			["link"] = {
				["Gardar-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 15,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Calendar\\UI-Calendar-Event-PVP01:128:128}\n\n\n{h1:c}{icon:pvpcurrency-conquest-horde:25}{icon:warrior_talent_icon_ravager:25}{icon:pvpcurrency-conquest-horde:25}{/h1}\n\n{h1:c}{icon:ui_horde_honorboundmedal:25}{col:97020b}GARDAR ORKENFANG{/col}{icon:ui_horde_honorboundmedal:25}{/h1}\n{h3}\n{col:97020b}\nGazing upon this orc you may first notice the visible aging however, it is clear that the decades of a warrior's harsh life has left him with an impressive yet roughly carved build.  He stands 7,5 feet tall, with a tremendous and powerful build, standing the most true of testimony in regards to living by the axe his whole life. \n\nHis chest region being a near impervious and impressive broadness with visible fibers of pure muscle tissue underneath the thick green leathery skin, his back is like so broad while both shoulders are equally as broad with displays of muscle fibers being visible upon movement.  Attached to his shoulders, the arms are as thick as tree-stumps with muscle, with visible veins. \n\nA powerful abdomen with four visible abdominals bulking forth just beneath the thick leathery green skin. Both legs easily match his arms. \n\nScarring decorates this old veteran’s body, some look more grim than others while the most noticeable scar decorates his face as a cruel reminder to never repeat whatever mistake this old orc made in his more primed time. \n\n\nGardar’s hair and beard is thick and rough in texture, a resemblance equal to that of horse hair while it's also a shade of grey-white, standing the most true of testimony toward his old age.  Both eyes are a shade of fiery-yellow with piercing black pupils. \n\nThe hair is a mohawk like styled ponytail, with the ponytail itself having length reaching to the middle of his back having leather and steel bands keeping it together. \nThe beard itself is a wild growth, with a few small braids within it too, held together by leather bands and decorated with steel bands.\n \nBoth ears are an average size and length like most orcs decorated with a pair of steel plugs each. The brows are hairless and very thick while his jaw is quite square and strong looking. \n\nGardar’s tusks are both impressive in their length with an average thickness, one of them is decorated with an iron band.  An iron ring septum piercing decorates the nose as well. \n\nLooking close enough, the orcish word “Gora” has been engraved on to the iron band decorating one of his tusks.\n\n{col:fff8e3}(Gora means \"honor\" in orcish){/col}{/h3}\n\n{h1:c}{icon:achievement_pvp_h_08:25}{icon:inv_shield_1h_warfrontshorde_c_01:25}{icon:achievement_pvp_h_08:25}{/h1}\n\n\n",
