						["IC"] = "achievement_character_bloodelf_female",
						["TX"] = "This High elf seemingly puts a lot of effort into her beauty, her hair is always styled perfectly, her clothes are perfectly fitting, as well as her face is having some make up on it, to make her look even better. \n\nHer clothes are very expensive and beautiful too. They must be elven and very expensive. You can see they are very finely crafted, and have runes woven into them. \n\nAdditionally, she does smell after rose parfume, and her hair seems to be dyed in a beautiful wine red, or purple.",
