						["IC"] = "spell_holy_improvedresistanceauras",
						["TX"] = "The High elf has a very very powerful arcane Aura, even detectable to less skilled mages, even though she tries to hide it as good as she can. If she however does try to completely hide it, it is only lightly feelable, and does not seem much above average. \n\nAdditionally she is usually surrounded by a invisible magical Barrier, as well as having protective runes on her clothing as well as her staff.\n\nThe barrier also works as a kind of ward, blocking most detection spells and things like that, also true sight is hindered, but not completely blocked.",
