			["about"] = {
				["v"] = 4,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:f7ff99}Kaelira is a young Sin'dorei, carrying herself around with grace and beauty, as is standard for her kin. Every step filled with pride yet caution, a reflection of her personality, no doubt.\n\nRegularly clad in various leathery attires that hug up to her feminine shapes - hand-made and tailored specifically for her- there is little to no doubt that Kaelira is a toned woman. Not overly muscular, yet certainly able to put her strength to use.\n\nHer perfectly tan skin is soft to touch, littered with various scars from a past era. The most prominent being the one situated on her left cheek, starting just above the corner of her lip and ending just below her vividly glowing eyes.\nAdorned by long, thick lashes, Kaelira's emerald green optics make sure to take note of everything surrounding her. Within reason, of course. Caution and curiosity combined make for a keen eye.\n\nKaelira's plump, peach coloured lips are more often than not curled into a playful smile. Regularly gracing people with a full-fledged smile, the elven woman is keen to reveal her pristine white teeth and the unforgettable dimples in each cheek. Furthermore she has been honoured with high cheekbones and a button nose, ensuing for her to have an overall cute look over her. Which can easily be used to hr advantage.\n\nA certain air of mystery hangs around this alluring woman, likely the result of her abundantly raven coloured strands, which enhance her beauty even more. The thick wavy locks glisten slightly, curling around her features and falling just below her shoulderblades. These silky strands bounce around with any erratic movements made by the young lady and are clearly well taken care of. However, due to them frequently obscurring the woman's sight, this beautiful mane is often captured by a golden band.{/col}\n\n{img:Interface\\LFGFRAME\\LFGICON-MAGISTERSTERRACE:256:256}\n",
