						["BK"] = 1,
						["TX"] = "Her hair lays gently upon her head, as if flows backwards to be tied into a soft bun. Its colour so golden, if it were anymore it would gleam in the light, two short curls of hair, free from the bun fall softly down her face and past her eyes, even more aureate then her hair. They twinkle more than the gold tiara gently nestled in her hair or the matching earrings that dangle from her ears, all the jewelry decorated with green gems that dance in the light. \n\nA sweet smile adorns her face, it's warming and inviting however  still feels stern and commands respect, it's hard to work out why as you are transfixed by the beauty of her face, skin so clear and smooth it could be made of porcelain, it is as though she was created to be perfect, no blemish would ever dare appear on her skin. Her large almond shaped eyes adorn her face, glistening, drawing your attention. She stands at 5'4\", a fairly average height for her race and gender. Her body just as beautiful as the rest of her, she is slim but still has a good shape to her body, whether she's standing or sitting her posture is perfect, as she was taught as a child. She adorns herself with jewelry, gold, always gold, her necklace, arm bracelet, and chain bracelet all encrusted with green gems. ",
