				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h3:c}Weaponary{/h3}\n\nOn her back is her quiver and bow blade. the bow blade is a unique weapon. it can be a bow but it can detatch itself to become a pair of blades\n\n{h3:c}Apperance{/h3}\n\nShe has shor white hair that goes to her shoulders. under her eyes are two tattoos then flow down to under her cheeks. her arms also have tattoos on them these have a run pattern look. \n\nshe has a more simple attire. some light armour with a hood and cape. mostly to keep her face in secret so she can't be noticed\n\n\n{h3:c}Backstory{/h3}\nHer parents made sure to teach her at a very young age how to fight with blades and a bow. she would practice every day to make herself the best she can be. over time she was also taught to never fear death. so when you are at the end or you have to do something that will kill you, you won't be scared. after years she got sent on her first mission to kill a king of a small kingdom that had some issues with another kingdom for some time. so her and a few other assassins left to do it. most of them died but she lived. after that she became one of the assassins sent the most on a mission. now she just walks around orgimar just waiting for something to happen.. seeing as her few friends and family all died on missions. or at least they are dead to her\n",
