				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n\n\n{p:c}{col:f1d374}Caldaer stands tall at his height of 6'11\", he is a broad shouldered Sin'dorei in visible good physical health as a result to the relentless exercise that are one of his many daily routines.\n\nThe male's hair is dyed raven black, aside from his natural silver - the hair is long, usually rather uncared for and reaches down below his shoulders, a matching set of thick raven black eyebrows aswell as a trimmed goatee adorns his features, he doesn't completely acknowledge his outward appearance afterall and keeps himself as presentable as he himself sees fit.\n\nHis face supports high cheekbones, a cheeky and charming smile for whenever the occassion calls for it, his eyes almond shaped and the right carries the typical intense fel green colour to it while his left eye has been blinded, now completely white in colour while the area over his eye and temple is deeply scarred.\n\nMoving further on towards Cal's body, his skin is scarred here and there, most notable being the deep lash scars going down from his shoulders and further down his whole back. The man has also gathered a couple of tattoos throughout the years, wild black tribal patterns stretches from both his wrists all the way up to his pectoral muscles. He also has a black and grey large tattoo on the back of his right leg in form of a lioness with the singular letter \"Z\" seen in the tattoo, this symbolises his wife-to-be Izilya.\n\nWhenever he speaks to you, the tone in his voice is lowered and has a gruff sound to it.{/col}{/p}",
