			["about"] = {
				["BK"] = 7,
				["T3"] = {
					["PH"] = {
						["IC"] = "Achievement_Character_Bloodelf_Female",
						["BK"] = 1,
						["TX"] = "Before you stands a very beautiful, strong-willed military woman with delicate, yet strong features. Her golden eyes emit a very trustworthy, comforting gaze that bestows faith and determination upon those in her presence. Her delicate nose and lips ornament her round, pristine face while her very long hair flows behind her, reaching all the way below her back like a waterfall.\n\nThe dignified looking elf is always seen in a highly groomed, taken care of state. From her facial makeup and nail polish, to her scented perfume and groomed hair; it is common to see her often fixing her make up after performing her battle duties and taking care of her injured comrades, constantly making sure that she, an already natural embodiment of beauty and grace, is even more presentable. Somewhat average in stature, she compensates by wearing high heels even to battle - almost always seen wearing them.",
					},
					["PS"] = {
						["IC"] = "70_inscription_vantus_rune_odyn",
						["BK"] = 1,
						["TX"] = "Once a knight, the now battle priestess carries herself with an everlasting confidence and an aura of certainty that befits both her status of nobelty, and her current position as a high ranked official within the Sunfury Spire.\n\nDahlia is known (and even famous in some circles) for her phenomenal, beautiful singing voice. Her songs inspired comrades and allies not only in battles, but during the darkest of times as well. She uses her talent as a Songstress to inspire and entertain loved ones alike.\n",
					},
					["HI"] = {
						["TX"] = "A Former Knight of the Silver Hand and the Argent Crusade since Northrend before it, as well as a Veteran of the Seven Major Campaigns with varied ranks and accolades, Dahlia was born into the renowned Dawnseeker Noble House from the marriage of her noble father to a commoner. As a result, both her and her younger sister Nyssa were always treated with varying degrees of scepticism and wariness.\n\n \n\nDespite being a loyal and caring family person first and foremost who held the utmost pride in the name of her Household, the somewhat aloof Dahlia took interest in her tutoring and training above all else during her youth, focusing on the law aspects in her studies, and eventually serving her nation as a prosecutor in the Thalassian Supreme Court, in addition to her duties as the first retainer to her father, Lord Lo'Ramus Dawnseeker. Dahlia's contributions alongside her father's forces in the defense of Silvermoon against the Amani Invasion during the Second War were notable and acknowledged among her peers.\n\n \n\nHer contributions to the Thalassian military under the Dawnseeker banner didn't stop with the conclusion of the Second War. When Arthas lead the Scourge Invasion of Quel'Thalas as the Lich King, Dahlia was tasked by Lo'Ramus with the ensuring of civilian security, successfully protecting those she was entrusted with, and proving once more her unmatched sense of duty and responsibility.\n\n \n\nUnfortunately, in the meanwhile on the Quel'Danas battlefront, the disaster hit in the form of Lo'Ramus' desmie. Soon afterwards and with barely any chance for Dahlia to mourn the tragic loss, the Dawnseeker Noble House saw to the opportunity of denouncing Lo'Ramus' widow, the common born Lady Mira Dawnseeker alongside her two daughters Dahlia & Nyssa as the majority of the Thalassian nobles houses fell from grace. However, one of Lo'Ramus' most faithful followers -in love with Lady Mira Dawnseeker- took the three as his own family, swearing himself as the first retainer to Mira and pledging aliegance to her discord branch, and treating her daughters as if they were his own. Soon, more faithfuls followed, leading to the establishment of the Dawnseeker Branch House.\n\n \n\nAfter Mira's unfortunate succumbing to terminal illness and her eventual passing, the now adoptive father sent both Dahlia and Nyssa to the Isle of Seclusion; a small island on the northern boarders of Eversong, where they lived under the care of his friend - a master of arms and former gladiator to train in the arts of arms mastery, and the principles of battle. Dahlia and Nyssa remained on the Isle of Seclusion under the care of their mentor Dor'ann for many years, training and living the life of discipline.\n\n \n\nUntil one fateful day, only six months before the Outland Campaign, agents of the Sunstrider Forces came to the Isle of Seclusion, battling and injuring the three before abducting Nyssa for an unknown purpose. After brief recuperation, Dahlia took her short sword and iron buckler, donned her simple chainmail armor and enlisted in the forces of Silvermoon, later to join the Horde and head to Outland, with a prime objective in mind: Finding Nyssa...",
