			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Zeanne is a small elf, smaller than most of her race, she has a delicate-featured though there is a curious style, a great sense of high voltage about her.  Pretty in a flawed, accessible way, pale almost milky in complexion but she has scars hidden by her hair and are very rarely shown. Her green eyes look too big for her face and are framed by long dark eyelashes that emposised all her emotions. Her lips are beautiful, pale pink that reminds people of a rosebud, the top lip is thinner, but not too thin, and it has a natural cupid's bow, the bottom is larger and more plush that curls when speaking.\n\nHer body has changed a lot over the last few years due to her excessive exercise, She used to be slim and busty looking like most of her race but these days on a good day her clothes would look loose on her and on a bad they would look like they hang off a skeleton. Her blonde hair is almost white which is often seen in a tight ponytail with a long fringe which frames her face, when down it falls straight midway down her back and is absolutely flat.\n\nShe wears no jewellery except for two plain golden hoops in the ears, She keeps her hands hidden most of the time with the sleeves of her clothes or gloves when she is on duty but when they are seen they would be small and dainty, the nails would be clean and well maintained. She walks slowly most of the time, often in a daydream even when she is on active duty.\n",
						["BK"] = 5,
					},
					["PS"] = {
						["TX"] = "Her choices to not make friends are due to the fact she watched her closest friends fall to the scourge and vowed never to watch that happen again. Those who have managed to grow close to Zeeanne often say she is caring, cheerful, clever, and colourful, with an honest personality and the ability to take responsibility for her own actions. She is humble, creative, and enthusiastic, but also has her shortfalls too. She can be seen to be impulsive, impatient, and even clumsy, not to mention sometimes absentminded with her head always in the clouds. At times she has been known to be quite gluttonous, particularly regarding anything sweet. Only in private does she let the mask she hides behind fall, her true love in life is art, creating something out of nothing and bringing it to life is magic in itself and nothing can compare to it.",
						["BK"] = 5,
					},
					["HI"] = {
						["TX"] = "Zeanne was born in Suncrown village, Ghostlands to her mother Feyna who is a baker and her father Noash who was a soldier in the Thalassian Army, Her childhood was happy until they were forced to leave when the Ghostlands were destroyed and they settled in Fairbreeze where she was taught basic numeracy, literacy and history. At the time she came of age she showed magical abilities but decided to follow her father’s footsteps  and became a foot soldier in the Thalassian Army out of admiration for her dad and the other soldiers who were protecting the kingdom.\n \nDuring her time in the army she fought in the 3rd war, where she watched her father fall and the scourge attack where she watched her closest friends fall. She continued to train and be the best fighter that she can be until after the Sunwell was restored she started to notice changes in herself and slowly gained more magical skill and along with her sword knowledge she was sent to be tested as a Blood knight.\n\nUnlike many other blood knights she had faith before and after the sunwell was restored something her father always said to her “For every negative there is a possible, for every failure there is success and for every broken heart there is someone out there to help you mend it, you just have to have faith and believe that even though the clouds are out, the sun will shine on your life again .\n\nA question she was asked, “Why do you wish to be a blood knight.” Her answer was simple but came from the heart, because she watched her father fall in the 3rd war, and if she can help, she wishes to try and prevent others from feeling what she did, She wants to help protect and serve them physically and emotionally. Some would say she has a realistic drive to complete the task of becoming the best blood knight possible.\n",
						["BK"] = 5,
					},
				},
