			["about"] = {
				["v"] = 30,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-Nagrand-SunspringWatchpost:512:256}\n{h2:c}Backstory{/h2} \n\n{p:c}Thel was born in Sunpring post in Nagrand, It was hard for her mother, Orza, to explain her family that the father was a blood elf. The father was one of Kael'thas follower, strolling in Nagrand in search for supply until he met Orza. As the days passed their feeling grew even stronger for each other. Thus her mother, uncle and grandmother raised Thel together in their home.\n\nOrza knew the risk of Thel for being a so different than the other children in Nagrand, it was hard for her to make friends, but at least she had a family who loved her. She was alway well behaved around them. On day Orza decided to search for anyone who could help her little one if she has been gifted my magic, since Thel's bloodline have elven ancestry.\n\nOrza met an blood elf magus who prefered to remain unkown by wearing a mask in the broken world of Outland. The magus would accept to help in exhange of supply for him and his people. Thel met the Magus as she was strolling the meadow of Nagrand. the magus explained to her he will push to the limit for her magic to manifest. Thel being pretty excited about it, began to start learning from the masked man!\n\n3 weeks passed, after facing an ogre, exploring a cave and swining underwater for any emotional reaction of her magic to manifest yet nothing happened. As Thel get out of the lake, her uncle came by to see is everything was alright. As he see his niece's state, he told the magus that it was enough for the day as she needed rest. Putting your hand on a magus's shoulder was a mistake! The masked elf casted an arcan spell on the orc's chest, saying he didn't take orders from a savage. Thel saw what was going on and rush to stop the fight. Her eyes began to shine so brightly they become white, her hand glowing has a light bolt hit the ground, pushing the magus away as her uncle felt something embracing his wounded chest.\n\nThel rush to her uncle while the magus stared at them shoked ''This wasn't magic...'' the magus said, he rush over to the orc inspecting his now healed chest. The magus looked troubled and stared at Thel mumbling lots of questions. The elf attempted to kill her but her uncle stopped him by snapping his neck with one of his bare hand...and that is how Thel discovered she bared the light.{/p}\n{img:Interface\\QuestionFrame\\answer-zone-BurningCrusade:512:256}\n{h2:c}The Burning Crusade{/h2}\n\n{p:c}When the portal as been openedfrom the Blasted Land, Thel, now old enough to live on her own, traveled alone in Shattrath city hoping to find someone or something to help her go further with her mending magic\n\nThel never seen such a vast city with so many differents race living as one. She was amazed by that. As she wander around she discover the Scryers. Hearing the remaining of the blood elves in Outland were once Kael'thas's followers, Thel went there and meet them hoping to find someone that could teach her, at least better than the last magus.\n\n(STILL A WIP CUZ TRP WIPED IT RIP))\n\n{/p}\n\n{h2:c}{link*https://imgur.com/a/2QhfJaQ*Art Gallery, By me}{/h2}\n\n",
