						["IC"] = "INV_Knife_1H_ArtifactSkullofEredar_D_03",
						["TX"] = "She wields twin daggers kept in sheaths upon her hips. As well as this her thighs each have a bandolier of throwing daggers wrapped around them.\n\nSpite is held in her right hand, a viciously serrated blade with a handguard. The weapon is designed to tear flesh from bone.\n\nSuffering, the dagger in her left, is of a more elegant design. Smoothly curved and wickedly sharp and often posioned as well.",
