					[751271162] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Appearance{/h1}\n\n{h2:c}{link*https://imgur.com/a/YuwJ6po*Art Folder}{/h2}\n\n{col:ffffff}Just like most of her species Selanese is possessed of a near-otherworldly grace and beauty, an air of elegance exudes from every step she takes - highlighted by the well practiced sway of her flared hips. A medium height but still perfectly slender her body has little in the way of excess fat, the only deposits of the stuff being in the appropriate feminine places. Her body is a generous, hourglass form, with her heavy bust giving her a distinct \"top heavy\" appearance. Thicker thighs that are often left on show reveal her athletic background, powerful but not sculpted with muscle either.\n\nAs one's eyes travel up her body the face matches the rest of her - the girl being a picture of elven beauty. High cheek bones give her the appearance of more nobler genetics but the plump, glossy lips defy that look. Emerald eyes burn brightly and sit comfortably in their sockets, framed always by long lashes covered in just a tad too much mascara, and eyebrows that have been plucked and trimmed into perfect lines. Teeth as white as pristine marble shine when the woman smiles in stark contrast to the aforementioned painted lips, as well as her ever-present golden tan. The skin is flawless and utterly without blemish as if she were an artist's impression of purity.\n\nIndeed the only real marks upon her flesh are the tattoos and piercings she wears that serve to only compliment her chosen style as opposed to being opposed to it. A pair of emerald studs with a gold loop nestled between them adorn the blade of her ears, mirrored so both match. The ink upon her body is expertly done, with the most prominent being the tribalistic crescent around the outside of her left eye. Thalassian runes also wind their way up her left arm from her wrist to her shoulder. Her third and final bit of bodyart is on her lowerback, framed by her Venusian dimples: a phoenix perched atop a crystal with it's thin and elongated wings stretched around to the top of her hip bones.\n{/col}\n\n{h1:c}History{/h1}\n\n{col:ffffff}Selanese is a sanctioned assassin, an operative of the government of Quel'thalas and a servant to the Horde and her Warchief. Cloaked in red she is a crimson blur, a shadow in the night, a blade in the back of her enemies. Her work is her art. But it was not always so...\n\nShe was supposed to become a mage - a far cry from what she is today. She took to books and study and learning but in truth it was never her forte. In time she simply used her magic for entertainment but soon enough things began to spiral out of control. What started as harmless tricks became petty theft. Then burglary. And then, at last, murder. Paid by the political elite to dispatch rivals, to enact vengeance on a cheating spouse... A blade for hire through and through.\n\nBut it did not last and her criminal activities caught up with her in the end and she spent many a year in prison – even remaining locked away as her people fought off their own extinction at the hands of the Scourge. Soon enough, however, as the pangs of magical addiction tore at her mind she was given an offer. Evidently one of her clients had rose through the ranksof the government in the wake of her killings and she was given a choice. Freedom, for servitude. The Sunfury had need of those with her skillset on Outland. She made the deal without hesitation.\n\nArriving upon Outland amongst the many pilgrims she met up with the Sunfury as intended to serve her beloved Prince and ensure a future for her people. Yet as time went on the madness of Kael'thas became clear. As his true allegiances were made known she slipped into the shadows and distanced herself from such things. Her sponsor died defending the Sunwell Plateu, loyal to his death, but Selanese was nowhere to be seen.\n\nShe now continues to fulfil her obligations to her people, having returned home a free woman with a slight addiction to bloodthistle. An asset of the High Kingdom sent to dispatch the foes of the Horde.{/col}",
