			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Light Watch Order{/h1}\nOur order is selling various goods from our expeditions and our finest craftsmen. Below you can find examples of our wares.\n \n{h2:c}Gems{/h2}\nAll our gems can be cut in different shapes on site. Labour is paid extra.\nShapes avaliable: Round, Oval, Marquise, Heart, Pear, Cushion, Trillion, Radiant.\n{link*https://tinyurl.com/GemShapesLWO*Shape examples}\n \nAvaliable hues/colours:\n{icon:inv_misc_gem_ruby_03:25}{col:ff0100}Red: Ruby, Garnet, Crimson Spinel{/col}\n{icon:inv_misc_gem_sapphire_03:25}    {col:0036ff}Blue: Turquoise,  Sapphire, Lapis Lazuli{/col}\n{icon:inv_misc_gem_emerald_03:25} {col:14b200}Green: Jade, Emerald, Talasite{/col}\n{icon:inv_misc_gem_flamespessarite_01:25}{col:ffd100}Yellow/Orange: Topaz, Dawnstone{/col}\n{icon:inv_misc_gem_amethyst_03:25}{col:7f00ff}Violet/Purple: Nightseye, Amethyst{/col}\n{icon:inv_misc_gem_diamond_03:25}{col:ffffff}White: Diamond, Quartz{/col}\n \n{h2:c}Jewellery{/h2}\n{h3}Rings{/h3}\n{icon:inv_jewelry_ring_23:25}8g -- Gem Inlaid Silver Ring <colours avaliable>\n{icon:inv_ringwod_d_2:25}4g -- Ring with gem cut in shape. <shapes/colours avaliable>\n{icon:inv_ringwod_2:25}50s --  Simple Silver Ring\n{icon:inv_ring_80_03c:25}70s -- Simple Golden Ring \n{icon:inv_ringwod_2c:25}2g -- Wooden Ring - A simple, smooth ring carved from hearthwood. It is strangely warm to the touch.\n\n\n \n{h3}Necklaces{/h3}\n{icon:inv_jewelry_necklace_01:25}48g -- Living Emerald Pendant: Highly enchanted emerald encrusted in golden case, on a silver chain. Enchantments on this gem allows it to slightly change shape, according to wearrer mood. <Limited avaliability>\n{icon:inv_jewelry_necklace_107:25} 10g -- Dragon Pendant: Oval in dragon-shaped encrust. Enchanted to give bearer fire resistance.\n{icon:inv_jewelcrafting_necklace1_red:25} 3g -- Twine necklace with gem. <shapes and colours avaliable>\n{icon:inv_jewelry_necklace_06:25}8g -- Stormcharged Choker - Five different gems, on a silver choker.\n\n\n \n{h3}Earrings{/h3} (all piercing are avaliable for ears, tongue, nose, and other body parts)\n{icon:inv_enchant_essencecosmicgreater:25}32g -- Living Ruby: Enchantments on this gem allows it to slightly change shape, according to wearer mood.\n{icon:inv_trinket_80_titan01c:25} 3g -- Pair of gold encrusted earrings.\n{icon:inv_trinket_80_kultiras01e:25} 75s -- Marine Earrings\n \n \n{h2:c}Figurines{/h2}\n(Figurines look like real miniature animals)\n \n{icon:ability_mount_hordescorpionamber:25}25g -- Black Diamond Scorpid\n{icon:inv_jewelcrafting_purpleowl:25}12g -- Emerald Lion / Owl / Rat / Turtle / Cat\n{icon:inv_jewelcrafting_blackpearlpanther:25}14g -- Black Pearl Panther\n{icon:inv_jewelcrafting_jadepanther:25}4g -- Jade Cat / Owl / Fox / Rabbit / Monkey / Panda\n{icon:inv_pandarenserpentgodmount_red:25}6g -- Crimson Serpent\n \n \n{h2:c}Potions{/h2}\n \n{icon:inv_alchemy_71_potion4:25}20s -- Lucid dream - After using the potion, a strong sleep follows. Sleep is accompanied by the regeneration of body and mind. The mind is completely calmed in this state.\n{icon:trade_alchemy_dpotion_a14:25}15s -- Potion of regeneration - It slowly heals wounds, thanks to which the body is not exposed to a strong attack and better tolerates the course of treatment. It is often used for low toxicity\n{icon:inv_potion_54:25}10s -- Healing elixir - A powerful healing potion. It can heal even more serious injuries. However, it is more toxic than a normal regenerative elixir. In many uses, toxic shock can also follow\n{icon:inv_misc_potionsetc:25}10s -- Potion of mana regeneration - A stronger elixir that regenerates mana at a faster rate. It still belongs to low-toxic elixirs. Overdose can cause nausea and vomiting\n{icon:inv_misc_potiona2:25}18s -- Shu´halo´s water - If your partner wants to have a long and passionate night. It's time to awaken the majestic Shu´halo inside you and show what the gift of Mulgore can do. Works only on males.\n{icon:inv_potion_115:25}20s -- Hair tonic - Special water intended for fur and hair. (DO NOT DRINK!!) Hair is fine but strong after application. It helps their growth and their healthy well-being. Apply for 5 minutes and then wash thoroughly\n{icon:inv_potion_166:25}10s -- Black oil - Protects armor and weapons from water and acid. The oil needs to be applied to the gun and then allowed to dry.\n{icon:inv_potion_156:25}13s -- Crystal water - Crystal water, which helps the skin, hydrates it and then replenishes the nutrients. Thanks to this, the skin looks younger and wrinkles slowly disappear..\n \n \n{h2:c}Other Items{/h2}\n \n{icon:inv_misc_trailofflowers:25}2/5/8g for 1/3/5 - -Gem bouquet (flowers). Gems cut into shapes of flowers.\n{icon:inv_alchemy_endlessflask_05:25}12g -- Amethyst Goblet - drinking wine with this goblet prevented the drinker from getting drunk.\n{icon:spell_nature_crystalball:25} 5g -- Crystal Ball - The sphere's surface swirls and shifts, showing different images for brief moments, never long enough to see what they actually are.\n \n{icon:inv_misc_monsterscales_07:25} 5000g -- Scale of Deathwing. Scale of Earthwarden himself. Acquired during the times of Cataclysm, during the defense of Azeroth. <Currently out of stock>\n \n \n{h2:c}Additional Informations{/h2}\n \nEnchanting a living gem requires a living essence, which can be extracted only from alchemical transmutation: Transmuting Earth essence to Living Essence. It is not possible to create Living Essence from any kind of soul capture, or fel magic.\nNote about figurines: Under any circumstance do not put figurines in hot water! Refunds are not avaliable after breaking the terms of use.\n",
