				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{icon:ability_druid_demoralizingroar:25} {col:9acd32}Hulumon{/col} {icon:ability_druid_demoralizingroar:25}{/h1}\n\n{h3}{col:9acd32}Hulumon{/col} is an average jungle troll who has followed plenty, lesser loas up until his tribe's arrival in {col:9acd32}Kalimdor{/col}. There, after the {col:9acd32}Horde{/col} slowly began expanding on the {col:9acd32}Eastern Kingdoms{/col} also, he would start making contact with the trolls from the {col:9acd32}Revantusk{/col} tribe, eventually learning more about {col:9acd32}Nalorakk{/col}, deciding to become his follower after {col:9acd32}Hulumon{/col} believed that he would be the {col:9acd32}Loa{/col} that would suit him the most.{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-99:64:64}\n\n{h3}{col:9acd32}Hulumon{/col}'s body would be that of most average jungle trolls. He presents himself rather slender due to his long limbs. His droop shoulders make him look almost lanky while having slight, lean and long arm and leg muscles.\n\nHis only exception would be his wide chest, his pectorals being well defined and his abdomen showing light outlines of his muscles there.\n\nJust like any other fighter, he has his shares of scars that did not across his entire body. None of them stand out in particular, but it is clear that this troll has been through quiet a few battles, both large and small.\n\nHe presents himself with a tall, green-yellow mohawk that looks well kempt, an uncommon color among his kind, but natural.{/h3}\n\n{img:Interface\\DRESSUPFRAME\\DRESSUPBACKGROUND-TROLL1:256:256}",
				},
