			["about"] = {
				["v"] = 22,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{icon:trade_engineering:25}OOC Information{icon:trade_engineering:25}{/h1}\n\nCould be open to student rp, as she is always looking to become more powerful and is still a novice, although you might find her a pain in the ass to deal with most of the time, so beware.\n\nPossibly recruitable, although activity varies.\n\nMore will be added eventually.\n\n\n\n{h1:c}{icon:inv_misc_book_09:25}Background{icon:inv_misc_book_09:25}{/h1}\n\nNobility. Pride. Grace. Essential values according to the Mirthstar household, despite not being a noble house. A system of upbringing enforced upon a young Anya and perhaps the sternest treatment between she and her siblings. Indeed, she seemed to have drawn the short straw in what could be considered a nurturing experiment. \n \nIt began during the early years of Anya’s life, just before her thirteenth birthday. All of a sudden, an otherwise cheerful and curious little girl was subject to scolding and correction by her parents in an attempt to develop what they saw as respectable and highborn behavioural traits. All things childish in her were subdued and a failure to abide by these new rules would often result in merciless punishment, physically and mentally. Whatever affection was shown her seemed hollow and meaningless, as if it was simply a professional courtesy.  \nIn order to make the experiment authentic, she was also treated like a princess in terms of clothes, food and servants. The family fortune was being spent to fulfil this fantasy that Anya was of noble birth, yet this had little effect in stifling the harsh treatment she underwent. Furthermore, the zealous use of coin only worsened the conditions for her siblings, as they were not treated to any of the luxuries.  \n \nBy the time she reached late adolescence, Anya was a completely different person to the gleeful child before the experiment. Not only had the Scourge devastated her homeland, the traits enforced upon her had stuck and nurtured their own side-effects; narcissism, a hunger for power and a lack of both sympathy and empathy – at least as far as one can tell. With most of her family gone, there was no one left to analyse the results of her nurture and nothing was published of the experiment. Anya was left with her nasty attitude and heart of stone. The death of many family members bothered her none. It only served to strengthen her own superiority complex.  \n \nIn her pursuit of power, she sought out the knowledge of mages, training herself to become a sorceress with a deadly determination to achieve power. This pursuit is still ongoing, and these pages will continue to grow. More than a hundred years marks the development of her character, which is still a short time for a blood elf – she may yet manage to transform into a different person but approach this task at your own peril. ",
				},
