				["T3"] = {
					["PH"] = {
						["TX"] = "Shrunken Heads, trinkets and beads litter this Trolls body. Evidence of her Loa worship in paramount.\n\nShe stands at roughly average height and weight.\n\nOverall she's very clearly a healthy Troll",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Religious, loyal, doesn't like your wine list.\n\n\"I had a plan, a good one, well thought out. Then I got bored.\"",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Born on the Darkspear Isle many years ago, her early life was not overly different from most of her tribe.\n\nOutside this given fact she keeps her past close to her chest, with the only given that she once past through First Home for her training.\n\nDespite her shady nature regarding her past, there's evidence enough to suggest some form of service to the Horde, specificly a snake wrapping itself the Horde symbol branded on her left hand.\n\n\"The elves got uppity and a demon humped a tree\" - the 3rd war.\n\n\"We burned a tree and the elves got uppity\" - the 4th war.\n\n- Born on the Darkspear Isles\n- Trained with her father, mother made baskets.\n- Entered Fist Home to walk the path of a Shadow Hunter.\n- Orcs came, Sen'jin dies, go to Kalimdor.\n- Fought with her tribe and the Horde during the Thrd War events of Kalimdor.\n- Was at Hyjal. \n- Served the Horde in a largely Troll unit nicknamed \"the heroes of Hethiss\", the origin of her tattoo.\n- Left the Horde army and spent some time in Booty Bay (Late Vanilla to late TBC period)\n- Joined the Cult of the Raptor (Late TBC)\n- Returned, briefly, to Horde service before joining in the rebellion (Cataclysm)(MoP) \n- (WoD) Did her own thing. Didn't go the broken isles, still hasn't.\n- (Legion,BFA) Sisterhood. \n- Late BFA Paw\n- Shadowlands, Sisterhood",
						["BK"] = 1,
					},
