				["CU"] = "\nDemon hunters (perhaps warlocks) could perhaps see a faded Fel taint on her.\n",
			},
			["characteristics"] = {
				["RA"] = "Darkspear Troll",
				["CH"] = "780067",
				["MI"] = {
					{
