				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://www.youtube.com/watch?v=ZwjrHGd4YzE*Theme}\n{link*https://imgur.com/gallery/hFLTg6e*Char art}\n{link*https://prnt.sc/pbfcdo*Shield Art}\n{link*https://www.youtube.com/watch?v=2HRCBsgTpt4*Voice Ref.}\n\n{h1:c}The Midnight Grin{/h1}\n\n{h2:c}From the lands to the east comes Tohga'jin, a fiercely proud Forest Troll. Eager to prove to the world that the descendants of the Amani are still very much alive and kicking. This Revantusk troll will have none stand in his way as his ever-curious mind yearns to discover and explore.\n\nA cunning and devious hunter of Akil'darah, \"Tohga\" always adorns an evil grin and is almost always up to no good. Tohga'jin is an exceptional marksman and naturally strong as any Forest Troll in his prime would be.{/h2}",
