				["Goresong-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h3}Physical Description{/h3}\nResha Goresong would be slightly shorter than the average female, standing at 5’9” (1.75m). She would be fairly muscular, her pale brown skin covered in white brush-stroked tattoos from head to toe. Her dark brown hair would be in small tightly braided rows of hair that hug the scalp, revealing her most noticeable feature of her face: an empty left socket where she would be missing eye, although this would almost always be covered up by a linen bandage or a mask.\n\nShe also has hairy armpits.\n{link*https://media.discordapp.net/attachments/654653756293644288/704040347268808945/resha_portrait.jpg?width=475&height=475*Resha's Appearance}\n",
						["BK"] = 1,
						["IC"] = "achievement_character_orc_female_brn",
					}, -- [1]
					{
						["TX"] = "{h3}Personality Traits{/h3}\n\n“Honour, little one. An orc without honour has no life worth living.”\n\nResha would hold these words heavily on her shoulders throughout her life. Having strong traditional orcish ideology, this makes her very kind towards others and hospitable to strangers and will help any in need. She would be extremely faithful to the ancestors, regularly meditating to try gain her connection to the spirits and muttering prayers before battling. She is pretty fierce when it comes to fighting, through glimpses of her death through a ritual and sacrificing her eye means she does not fear dying.\n",
						["BK"] = 1,
						["IC"] = "spell_misc_emotionhappy",
					}, -- [2]
					{
						["TX"] = "{h3}History{/h3}\nBound by the legacy of her clan, and ruled by ancient tradition, those who followed in their Cheftain’s example, performed the most sacred of rituals. They would sacrifice an eye for a vision of their own death. Sometimes, the vision would show much more. Resha saw herself not as she was, but what she could be - someone who followed in the elemental magics and teachings, an excellent warrior, bold, unwavering. Even when Death finally would come for her, she did not fear what she saw. Though like most who would know of their ultimate demise, this would reflect much on how she interacts with certain people over the years.\nAs a Shaman, she would mostly honour the spirits of the ancestors and the elemental forces. Though she is not yet imbued with the ascendency of the spirits, she would rather use enchanted weapons - namely her axe, Goresong, which was given to her through her family inheritance. This artifact would be carved from sacrificed animals or prized bones, tusks and teeth from great hunts and later used by powerful Shaman from which they draw power, and it is within these weapons, acting as totems that Resha’s true potency of a shaman lies.\n \nAs a Shaman, she would mostly honor the spirits of her own ancestors and the elemental forces. Though she is not yet imbued with the ascendency of the spirits, she would rather use enchanted weapons - namely her axe, Goresong, which was given to her through her family inheritance. These weapons would be carved from sacrificed animals or prized bones, tusks and teeth from great hunts and later used by powerful Shaman from which they draw power, and it is within these weapons, acting as totems that Resha’s true potency of a shaman lies.\n{img:Interface\\QuestionFrame\\answer-Tanaan-ZethGol:500:250}\n\n",
						["BK"] = 1,
						["IC"] = "trade_archaeology_highborne_scroll",
					}, -- [3]
					{
						["TX"] = "{h3}Goresong, Blessed Axe of the Flame Keeper{/h3}\nLittle stories are known about the shaman artifact, however rumour claims that the first orc to come across the weapon found it whilst searching for great power and stumbled across a dark cave that seemed to vibrate with sinister, shadowy power. There he found a corrupt elemental fury of fire by the name of Azazel, who offered it’s powers in return for the shaman’s service.  (See about)\n\nThe orc agreed, receiving the elemental trust and blessing and working side by side for some time. However, fueled with the power of the Flame Keeper, the greedy shaman began asking too much, and when he was denied more power, the orc turned on Azazel who attempted to banish him to the elemental plane. His attempt failed, and instead of attacking the shaman, swore to take pleasure in seeing his subject suffer. Back at the shaman’s home, the air howled through the open chimney causing an eerie hollow tone. Upon the fourth note, the elemental kills the shaman’s mate by casting her to his flames.\n\nHer death inspires the shaman to dedicate his life to hunting down Azazel, who is also joined by his young son who joins the hunt.\n\nIt would take the mastery of the other elements to confront Azazel who is eventually defeated. However, the corrupt fire elemental simply returns to recover to the elemental plane.\n\nAnd so, with the shaman nearing his old age, the son took up the quest to defeat Azazel, handing down the artifact that was used to strike Azazel down.\n\nThe axe ‘Goresong’ is named after the tune that is heard before Azazel strikes as a warning to all who hear it. It is said that when the powers of Goresong artifact amplify the shaman’s powers two-fold, the sky burning red with the flames of Azazel.\n",
						["BK"] = 1,
						["IC"] = "spell_fire_elemental_totem",
					}, -- [4]
				},
				["BK"] = 8,
				["TE"] = 2,
				["v"] = 24,
			},
			["msp"] = true,
			["mspver"] = {
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Mechanical Right Eye",
						["TX"] = "As per tradition in the Bleeding Hollow clan, the chieftain, Killrogg Deadeye removed one of his eyes to receive a vision of his own death, and therefore did not have to fear it. Many of the clansmen followed in his example, including Resha. \n\nRecently, however! Resha has been given a working mechanical eye as a gift from a close friend in the clan, Mazork Wolfheart. A few scars are the only evidence that any sort of previous damage was there before.",
						["IC"] = "inv_fishing_innards_eye",
					},
					["3"] = {
						["IC"] = "ability_shaman_totemrelocation",
						["TI"] = "Totems!",
						["TX"] = "This person seems to have a few totems on her person at any one time. She usually carries four small totems that would hang down by her belt downwards where her robes are. These totems include:\n\nResonance Totem - Allows the user to commune with the Earth elements a lot easier, being able to hear the vibrations of the earth into words. Since she has passed her earth shaman trial, her knowledge of this element isn’t unknown to her, only making her spells stronger.\n\nTailwind Totem - Allows the user to commune with Water elements a lot easier, every ripple of water like a song. This totem would also be very helpful for sailing on her raft which Resha can be seen doing sometimes.\n\nEmber Totem - Allows the user to commune with Fire elementals a lot easier, the flickers in the flames like a soft whisper. Having passed her Fire shaman trial, Resha already has a few tricks up her sleeve and has gained the trust of the elements of fire which only makes her stronger.\n\nStorm Totem - Allows the user to commune with Wind elements a lot easier, however, this is an element that Resha has not explored in depth yet and is still considered to be an adept at it.\n",
						["AC"] = true,
					},
