						["TX"] = "Little stories are known about the shaman artifact, however rumour claims that the first orc to come across the weapon found it whilst searching for great power and stumbled across a dark cave that seemed to vibrate with sinister, shadowy power. There he found a corrupt elemental fury of fire by the name of Azazel, who offered it’s powers in return for the shaman’s service. (See about)",
