			["msp"] = true,
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{col:ff0015}Physical Appearance{/col}\n\nAzra stands an impressive six feet and eleven inches tall meaning many of the other Horde races have to look up to see her face. She’s of average height for a female Darkspear and like all of her tribe carries the thin layer of fur over her slim yet muscled body which is rather defined in character when not hidden under her robes. She’s built like this due to her years as a huntress and excessive raptor training, combined with the high metabolism and general build of the Darkspear Trolls.  As a young woman, she’s undergone physical changes all do through the years and whilst she carries feminine traits she’s rather flat chested and small hipped. There’s very little fat on her body but that is to be expected. Her most prominent facial feature is the large amber eyes that seem to express her spirit and to those who know her well her current emotionally state. They change to a dark almost blood red colour upon berserk, and depending on her mood they can appear brighter or darker, but always have the spark there that is full of life and adventure yet more recently taken on a determined focus that seems to almost consume her in a good way.\n\nHer face is scarred quite heavily around the left eye, the burn travelling from her forehead to her neck. The eye itself is a dark amber colour with a slight white pigment to it where it was intensively healed. Her other eye is a dark amber. Her tusks are still small but unobtrusive in her day to day life and she seems quite content with how she looks now. Before, she hid her face due to the embarrassment caused by the scar but she now wears her hair tied back in many braids which are sometimes kept tied together by a strip of leather and a hairpin shaped like a voodoo doll. Her mane has been many colours but upon rediscovering herself she’s gone back to the natural blue, green hues and grown it out long again. \n\n{col:ff0015}Scars{/col}\n\nHer body itself is not without scars, the most prominent an axe wound down her back and four claw like scratches down her face. The remnants of various other nicks and grazes from injuries sustained over her life remain as usual. None of these seem to bother her. She also has the fel burn scar over her left eye as mentioned above. \nAround her left leg is a thick scar that gives the impression the leg was detached and reattached at some point but it appears to be more magical then physical.\n  \n{col:ff0015}Tattoos{/col}\n\nAlong her right arm is a tattoo of a bloodtalon raptor, the head on the back of her hand whilst the neck moves up her body and the tail ends on her upper arm with the forearm containing the legs and arms. It’s her pride and joy and seems to have a significant meaning to her. \n\nHer left arm also contains a protection symbol with a large B drawn around an intricate A. This tattoo represents her bond with her former Elder Bovath Earthshaker and has much sentimental meaning. \n\nUpon her back is a tattoo dedicated to the elements whilst she carries a religious symbol to Bwonsamdi on her upper left shoulder. \n\n{col:ff0015}Armour{/col}\n\nAzra’s armour appears to be old in appearance and adjusted to fit her frame. It’s well worn and well repaired but is a gift from her elder as she passed her training. The armour is a simple blue colour indicating her alignment to air and water primarily as a shaman. Her robe is tight fitted and held in place by her belt which contains a multitude of pouches holding totems, herbs and other things. It’s coupled with a satchel that she carries over one shoulder. Her cloak is decorated in a basic tauren artwork a gift from those who helped her and she wears a simple cloth hood when the time calls for it.\n\nAround her neck she wears a multitude of necklaces. One is an idol to her chosen Loa Bwonsamdi which she uses when praying, another is a raptor tooth necklace and finally she carries a handmade trinket of Tauren design gifted to her. In her hair she also wears small feather trinkets around the bindings of her braids which were also done by taurens. \n\n{col:ff0015}Totems{/col}\nAzra’s belt pouch contains her totems and these remain with her at all times. They are of Tauren design but modified to give them a troll twist. As the last present she was given by her Elder, she is highly careful with them and seems to take better care of them then she does herself. She doesn’t like to let others touch them and she keeps them with her at all times. \n\n{col:ff0015}Weapons{/col}\nAzra’s weapons are simple but effective. She carries an axe crafted for her by her elven brother Sylvarys Sunglance, enchanted to make it sharp enough it cuts through almost anything with ease. She’s protective of this axe and when she fights keeps it attached to her by a strap so there’s no chance of losing it. Her shield is a simple troll design with a voodoo doll pinned to it to scare her enemies. The tusks are sharpened to spear any who get close but it protects enough to allow her to cast. ",
						["BK"] = 9,
					},
					["PS"] = {
						["TX"] = "Azra these days is a far cry from the excitable individual from her younger days. She’s grown from a terrorising teenager into a rather calm and reserved young adult with all the savageness of a Darkspear Troll. She can come across as serious yet she’s young and still prone to bouts of excitement. Her aura is relatively calm and almost inviting, mostly due to the amount of time spent with the Tauren people in recent times. She’s managed to curb the anger that she could turn on so easily but is still prone to berserk if and when she’s pushed to her limits. \n\nThose who may have noticed her darker side during the events of the siege and whatnot may notice that as a person she is brighter and more active than before. However, the mention of the war and the events surrounding the siege still send her into a quiet response for whilst the memories are mostly dealt with the pain of losing so many still affects her. \n\nFamily is important and whilst she has lived with Tauren, she has endeavoured to continue in the traditional aspects of her people. She has adopted many of the old ways and customs and is known to dabble in light voodoo usually in the form of trying to make potions to help mend wounds or fix illnesses. She’s no witch doctor however so won’t openly offer help where others would be better expert.\nAs a fighter, she is still ruthless, brutal and downright dangerous. She’ll fight from the off and won’t yield until she goes down or she wins. Her love of raptors is still as strong as ever and still yearns for the companionship of Kazruki who she left to return to the Isles upon her disappearance. \n\nAs far as religion goes, Azra is highly devoted to trying to do the Loa’s will and has a strong spiritual connection to her deceased brother. She sometimes still mutters to herself, seemingly asking for advice and trying to work things out. She takes her responsibility to the Loa seriously and if something offends her she will speak out about it. In relation to members of the Horde, she feels strong bonds between all of the races though like many has some unease around the Forsaken. She finds strong connections with the Tauren and Elves in particular as well as her own people. With regards to others, her Elder’s teachings mean she is neutral to those she meets for she is still undecided about a future in the Earthen Ring and so does not wish to jeopardise her chances. \n\nShe has language skills in Zandali and Orcish able to read and write both. She is able to read, write and speak Taurahe to an extent but she isn't an expert. She's learned what she needs to get by and so as not to offend those who have granted her permission to stay. She doesn't let onto this fact though so as not to seem big headed or rude. In fact it makes her feel very humbled. ",
						["BK"] = 9,
					},
					["HI"] = {
						["TX"] = "Azra’s life has been a rollercoaster. Born within the safety of the Echo Isles, she led a peaceful existence with her brother Jalei, having never known her parents or what happened to them. This didn’t set her back however and she grew up to be a rather energetic and positive soul. Her life changed however the day the Kor’kron came.\n\nThey came without warning, occupying the isles, rounding up the individuals who resided there and killing any who opposed. Jalei was one of those who fell leaving Azra orphaned. She witnessed the entire scene from the safety of a tree on Bloodtalon Shore which left her with a rather deep wound on her spirit, a wound that would take time to heal. It was at this time she made a promise to her brother using her blood as the seal that she would avenge his murderers and kill every Kor’kron that got in her way. However for now she was alone.\n\nDuring her time alone she found solice in a bloodtalon raptor she named Kazruki; a friendship forged that even to this day is unbreakable. They lived and hunted together, kept each other company and survived alone on the various isles never settling for long in fear the Kor’kron would return and get her.\n\nShe had been alone for about a month before she met the first troll who would try to influence her life. A hunter named Va’guin. He taught her the basics of hunting, how to shoot straight and how to be a better huntress for at that time her skills were lacking. But when trouble threatened to strike again, he sent her away to Silvermoon, forcing her to leave the home of the Echo Isles and venture into the big bad world. She spent time with an elf, Alandriel Hawkwind known effectively as Zizu and her father, before rejoining the members of the Collective after a time. She had once again faced death having believed her troll friend had perished during the second invasion of the Isles. She would later find however he was very much alive.\n\nTime passed and as she ventured around Azeroth with the Collective her abilities grew. She became a stronger huntress and a stronger troll advancing into adolescence where the fun began.She continued to train beside the troll she now knew as Tilrazi or father, having been adopted after his return, and began completing her life mission of revenge. A child in a warzone was not an easy life and she struggled with the turmoils of war in particular death. Her father later abandoned her to follow her path not before trying to sell her out to an elf for mating to which she disowned him.\n\nThe apparent death of her close friend Sylvarys however was the tipping point in her life. Until then she clung to the grips of childhood teetering in between, lost in a void. The loss hit her unnaturally hard, to the point blind rage took over. Her thirst for revenge turned to the one she believed to be the murderer. It took time for the rage to subside and it was then she took solace in her own people. She returned to Sen’jin village all be it broken at least in spirit. She found comfort in an elderly troll witch doctor that helped begin the process of mending her wounds and helping her move into adulthood. It was this time Azra once more found comfort in the Loa. The starting point for her considerations for the future, the first time she thought about becoming a Shadow Hunter.\n\nAs the end of the war came, she took time alone once free of her duties to tie up the loose ends. She made peace with her brother's spirit for she felt responsibility for his death. It was then she began her travels. She began to try and find ways to commune with the Loa in an attempt to start her path to becoming a Shadow Hunter however those she took refuge with were not kind or helpful. One day Shadra's webs began to weave into play and she found herself with a choice. She chose an entirely different path and began on the road to Shamanism, training under a kind Tauren named Bovath. He suggested she had potential to become a seer for her people.\n\nHer training was tough and she found it hard yet exciting. Her mind however struggled to keep up with the rate at which she was developing and she found herself back into a dark cataclysm of thoughts and depression. She did everything she could to try and combat this including helping an unlikely source on a mission to Draenor. Her powers failed her when she needed them most which only made her feel worse. It was at this time she received her fel burn scar and lost the sight in her left eye. Once again she turned for help from her people but found none until she met Dun'jai a Shadow Hunter of the Horde. He gave her an escape, allowing her to travel to Thunder Bluff where she became almost reclusive with the wise Elders of the city. She trained with them, learnt how to find herself and face her demons. She began to find her old self again and made friends with a tauren druid, talking with him and exchanging stories. During this time, the extensive healing she received helped to recover some sight in her blind eye. ",
