				["T1"] = {
					["TX"] = "Vol as his friends know him is a humble summoner, usually friendly and aproachable but shy at first, well mannered when not drunk and will help those in need if posible.\n{icon:ability_racial_childofthesea:25}\nHis childhood was not the best not having his bilogical parents around as they mysteriously disappear when he was only a baby, he was found and raised by a family of orcs in Orgrimmar that help him develop a love for the horde and colaboration between races as something necessary for survival, he does not feel superior to other races and treats them with respect.\n{icon:ability_monk_counteractmagic:25}\nHe found magic fascinating from a young age and started to mess around with demons by accident, that moment when hei first summoned an imp changed his whole life, that imp would have killed him if one of the troll warlocks hadn,t shown up just in time to subjugate it, he knew then that he wanted to be able to do just that, control demons.\n{icon:spell_shadow_demoniccirclesummon:25}\nAs time went on he lost interest in the art of summoning demons and he focused his efforts in summoning others instead, becoming a bodyguard to those in need and a useful tool for others looking to reach places that without his help would be imposible.\n{icon:inv_staff_2h_artifactheartofkure_d_06:25}\nHe recently found someone he really cares for and even tho their time together has been sort, for them it was love at first sight, they care deeply for each other and even tho they  are unable to see each other due to unavoidable circumstances, they write letters whenever they have the chance  reminding them of their sweet moments togueter.",
