				["T1"] = {
					["TX"] = "A Tauren whose body and spirit bears testimony to life's hardships, made manifest through an imposing muscularity on his mesomorphic figure. Whereas his spirit is scarred and hardened, his hide bears few mars. \n\nWith broad shoulders, a powerful visage and a towering height the shaman has a naturally commanding demeanor, however tempered by a sober mind. \n\nA handsome face, with strong features such as a wide snout, sturdy brow bones and striking eyes of mismatched colors of chestnut and a vernal forest green, is framed with a remarkably long mane. It is of a deeper brown than his fur, which is a faded chestnut hue. \n\nGracing him is exotic feathers in his horns and wristbands, as well as clay tokens and crystals of tribal roots. Embellishing his fur and horns, on ceremonial or martial occasions, is a deep green paint that dons him with curving lines and markings, giving him a fierce appearance.\n\n\n\n{link*https://imgur.com/a/ZB9ySPr*Heart of the Kodo} \n— Tand Kodoheart staring into the eyes of the enemy\n\n{link*https://imgur.com/DI9gcnD*Nomadic Spirit} \n— A free spirit of the Earth Mother's lands\n\n{link*https://imgur.com/a/Igda6d4*Shaman's Purpose}\n— Duties to nature fulfilled with a friend\n\n{link*https://imgur.com/ECYik0e*Lifting Rocks}\n— Finding spiritual guidance in meditation \n\n{link*https://imgur.com/a/PwF2ix6*Tarot Card: Kodoheart}                    <---- New!\n— Kodoheart depicted in a tarot card\n\n \n\n\n",
