			["about"] = {
				["v"] = 6,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://i.imgur.com/VDVIvUY.jpg*Art Commission}\n\nThe first thing one usually notices when they lay their eyes upon Vaniera, is her current state. Her body clearly rotting and Undead, yet still kept alive by Unholy forces. Her skin is a very monotone grey, it having begun rotting, though kept in a rather surprisingly pristine condition on the surface by strange forces.\n\nHer hair, black as the night sky, is left to flow down the side of her head and behind it, reaching just about to her shoulders. It, to no big surprise, is incredibly  dry and lifeless if one were to touch it, as probably expected from one of the living dead.\n\nVaniera is almost never seen without her suit of Saronite armour, the entire suit coloured dark blue or a very dark grey, with some fur showing on the gauntlets. The suit has bright blue runes decorating it in many places, although without a shadow of a doubt serving other purposes as well.\n\nShe is usually seen also wearing a cloak to go with her attire, it having been fashioned out of some kind tough skin of an animal, carrying a dark purple, almost black colourization. It doesn't seem to serve much purpose other than make her look slightly more intimidating, as if it was necessary. She didn't exactly need the protection from the cold or the weather.\n\nOne thing she is definitely never seen without, or kept very close to her, is her runeblade. It is also crafted from Saronite, shaped with a fairly significant curve and very broad blade, especially near the tip of it. The entire blade carries the same colour as her armour, with the same bright blue runes running down the middle of it on either side. Near the hilt of the blade seems to be something fashioned to look like a dragons claw, or beasts claw.\n\nHer body is quite muscular, only enhanced by the Unholy forces surging through her body at all times. She kept herself very well trained, even before her reanimation as a knight of the Scourge.",
				},
