			["about"] = {
				["v"] = 13,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Zeb'aki, Follower of Shadra{/h1}\n\n{link*https://cdn.discordapp.com/attachments/720988553647095888/725132339490979860/zebz.png*Art of Zeb'aki}\n\n{link*https://cdn.discordapp.com/attachments/718562862729003112/736965496758337566/Zeb_stoned.png*Zeb art 2}\n\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-TrollVoodooDoll:512:256}\n\nBefore you stands a Jungle Troll who towers above the smaller races at an imposing 7'3\", but compared to his own kin, he does not stand out that much in terms of height. Often always haunched over, his stature is reduced to below 7 feet, however he is certainly far from small. His body is slender and not very broad, however he is not skinny and his body is toned with no bones showing.\n\nHanging from his head, making him stand out extremely amongst his kin, are his dreadlocks. They are extremely, ridiculously long, reaching all the way down to his upper-legs. They are often decorated with beads and he also has a few pet spiders that he lets crawl freely upon his dreadlocks. His dreadlocks also have a few grey bits in them due to his age.\n\nFramed by his dreadlocks is his face which features a long, pointy, dagger-like nose. There is a bone piercing that goes through his septum. His eyes are crimson and piercing, looking into them is like staring at blood.  He looks to still have features of his youth despite his middle-age, but there are a few lines here and there, showing that he is no longer young. His long pointed ears are decorated by several piercings. His lobes are stretched and have wide holes in them, his ears have several sharp tooth and bone piercings in them all the way along the rest of their length, up to the pointy tips of them.",
