				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:f798ff}Raela Violetspring{/col}{/h1}\n\n{col:f798ff}If spring, pink and flowers could be a person, they would be Raela.\nShe is often seen smiling ear to ear, laughing happily and just loving life. Pure joy often showing across her face.{/col}\n\n{col:f798ff}Shoulder length platinum waves frame this young womans oval face.\nThick but tamed brows accentuate her deep set molten Ice blue eyes. Long mascara coated eyelashes brush against her plump cheeks that are dusted in a light coat of pink blush. \nHer jawline is well defined, the sharp yet feminine structure adding to her beauty.\nShe appears to love highlighter, as her cheekbones, brow bones and tip of her nose shine like a discoball.\nHer lips are coated in a bright pink matt lipstick.\n\nTucked behind her left ear would be a beautiful pink and white ombre peony.\n\nRaela sticks to long, flowy almost princess like dresses. Decorated in gold and silver thread with embroidered flowers and butterflies. Her colour palette for clothes is almost identical to the choices in makeup and accessories. Pink, white and light purple. Pairing said dresses with heels.\n\nRaela would never leave her house without her nails painted bright pink. \nHer perfume would smells like hints of vanilla with a touch of floral - Smelling like a fresh spring day.\nRaela has several piercings, the most obvious being her septum, a silver metal ring with small pink gemstones. Her ears are pierced with light pink pearled earings.\n\nLastly is her tongue, another pink piercing.\nRaela has a large butterfly tattoed on her bank, adorned with pink, lilac and light blue swirls to add dimention.\nA peony tattoo on her right wrist- Also pink with light blue ombre petals.\n\nA light pink sachel hangs from her right shoulder, crammed with flowers, makeup and her comb.\n {/col}\n\n\n",
