					["TX"] = "An outcast of darkspear took refuge in zandalar, he was shoved away for his power and for his condition.\n\nThere is many story´s of how Zal´tul was cast out of the darkspear, but no one knew the true reason.\n\nIt began with at an young age in his life, on day dark spots started to apear on his body. At the time the local priest couldn´t identify his condition so they just prayed to the loa that it wasn´t anything serius. A year after the spot started appearing he was a natural in fire magic, but the fire he used was no ordinary fire. It had no life, the fire wouldn´t spread like an ordinary fire and it would neither be put out by water. When Zal´tul was in his teenage years his parents started to feel sick. The priest who had watched him grow up had blaimed him for the sickness spreading in Darkspear. so he ran away and snucked upon a tradeship. First he didn´t knew where it was heading but when he arrived, He belived that he would only bring sickness to Zandalar. So he ran away as long as he could from the pyramids and in to the deep jungle. \n\nAnd when he returned from the jungle he was no longer the same boy since he arrived to Zandalar, now he had found his loa, Bwoamsamdi.",
