			["about"] = {
				["T2"] = {
					{
						["TX"] = "{col:ffffff}Ehka’ra is by all accounts an orc, almost stereotypically so. She is imposing, intimidating, loud, quick to anger, overly muscular and probably wouldn’t say no to a nice haunch of mutton. In cities, however, she seems much more reserved and introverted than her typical self, hardly speaking to anyone unless one approaches her first. Which by all accounts is best to be done with caution, for even as much as she tries, she still manages to give off a ‘pissed off cat who’s being led to water’ vibe.\n\nAshen grey skin stands in contrast to her dark plate armor, although due to the sheer amount of it it is difficult to see any distinguishing features on the orc, aside from her hair. Shaved on the sides and fashioned into a short mohawk on top, the rest of her hair leads down into a very long braid, stopping only at her lower back. The armor itself is plated in varying hues of grays, browns and blacks and a matching plate face mask keeps a majority of her face hidden from view. A thick dragon scale leather belt keeps a Dragonmaw tabard against her torso, both worn and slightly faded from time and repeated battles. Two medium satchels hang from her belt on her left side, seemingly made from the same type of material and sharing similar wear. A heavy cloak completes her look while she is visiting cities, completely made of black dragon scales and reinforced with a thin sheet of iron. While outside she carries a pair of two handed blades, made from iron and the lower jawbone of a dragon split in two. {/col}",
