			["about"] = {
				["T2"] = {
					{
						["TX"] = "\n{h3:c}{col:ffd100}Traits{/col}{/h3}\n{col:ffffff}Shalanaria is an easy-going, joyful woman with a desire to make a living far from Suramar City, where she has been forced to stay in for many years.\n\nHaving spent most of her time by herself, she has grown into a reclusive person but she never lacks a smile on her face while making new acquaintances. She loves to help those in need and feels fulfillment when she succeeds in making people relieved of their stress and problems. \n\nHowever, she is ruthless against threats. She might be prejudical or discontented against strangers that have certain attitudes. Shalanaria gets confused easily when she feels under pressure and for this, she can act aggresive untimely.{/col}",
