						["TX"] = "\"Why are you eyes blue!?\"\n\nHis eyes reflect a minty hue, which may be mistaken quite easily for one declared as a Quel'dorei.\n\nDue to presumably less exposure to fel than most of the blood elves in their most dire times and other factors coming to play, his eyes are neither radiating a potent fel green, nor a gleaming gold.",
