			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{link*https://www.argentarchives.org/node/247144*Argent Tournament Page}{/h1}\n\n\n\n{h1:c}{col:64ffff}O{/col}{col:57dbdb}l{/col}{col:38bbcc}y{/col}{col:48b8b8}e{/col}{col:399494}r{/col}{col:296c6c}o{/col}{col:1c4949}n{/col}{/h1}\n{p:c}... \"but please, call me 'Oly'. Friends and foes alike use it\" ...{/p}\n\n{p:c}{col:48b8b8}\nThis elf is most likely searching for something to ease\nhim from his nervous state, peering around with an odd\nfixation on his eyes that can be pinned at just about\nanything he gazes at. Mumbling repetitive words may\nensure and soothe him, as he makes his way to feed\nhis obsessions, his thirst and {col:d9ffff}hunger to feed an addiction.{/col}{/col}{/p}\n\n{h3:c}\"I need another way to hold on.\nFind another way to shut the dark side out.\"{/h3}\n\n{p:c}{img:Interface\\PVPFrame\\Icons\\prestige-icon-4-3:128:128}{/p}\n{p:c}{col:38bbcc}\nAn elf of {col:d9ffff}dainty height{/col}{col:38bbcc} and blending into the {col:d9ffff}arbitrary\nlines of external gender perception{/col}{col:38bbcc}, Olyeron appears quite\nunassuming, with an ominous touch. The elf's face is\nprimarily oval and stretches near his cheeks, rounding\nit off nicely while still giving it a drawn-out shape, aided\nby thickened lips and intricate eyes. Freckles are as if\n\"sparked by the dust of coal\", covering his dark skin.\nHis right ear is shortened by a third of its original length,\npresumably due to the slice of a sword, the wound having\nhealed long since.\n\nOlyeron bears two minty and almost purely by {col:d9ffff}arcane\naffected eyes{/col}{col:38bbcc}, strongly hinting at intense usage of the\narcane despite him not being an expert wielder and utiliser\nof mage. Upon further inspection, possibly to detect the elf's\ntrue heritage, one sees into a layer of arcane mint that covers\nthe underlying {col:d9ffff}fel energy{/col}{col:38bbcc} in his eyes. His face is finitely\nshaped by his hair, which seems to have undergone one too\nmany hair dyes, subsequently being weakened and shortened\ntremendously, now showing off in dark, coal-inspired fashion.\nHe trims the only spot at which hair outside of his upper head\nseems to grow with great care, his chin on occasion sporting\na small strip of hair.\n\nBearing his tabard in duty, as well as his official armour representing\nthe {col:d9ffff}Light Watch Order{/col}{col:38bbcc}, one sees a robust, though meagre in quality\narmour set that seeks to mostly represent and make the best\nimpression possible. On top of the silver armor rest golden\nsparks and ornaments, reflecting the Order's official colours.\nAlternatively, this armour may be exchanged with a comfortable,\nsilver-to-golden robe, which seems to not fit him too well as\nhis shoulders are constricted by his leather satchel. At all times\ndoes Olyeron occupy himself with a small knife, brocaded with\na golden circle on its hilt. The hilt sits neatly and secured on\nhis belt. During important events and in representation of his\nOrder is he also showing off a silvery-white bow, which in\ncomparison to his body is rather broad.{/col}{/p}\n\n{h2:c}\"I want to treat you better.\nI want to {link*https://www.youtube.com/watch?v=al_ifxhmkJ4*love you sober}.\"{/h2}\n\n{p:c}{col:d9ffff}In civil,{/col}{col:399494} Olyeron is donning firm clothes,\nhighlighting his elven heritage with frills originating\nthrough fine-woven cloth, by no means of the best\nquality but still taken care of.{/col}{/p}\n\n{p:c}{link*https://www.argentarchives.org/node/245138*AA Profile (WIP!)}{/p}\n",
