		["0811130022CuTkv"] = {
			["character"] = {
				["CU"] = "Recuperating",
				["CO"] = "\nIC is IC etc\n\nThe Ravensun, the Inquisition, is a guild for undead roleplayers who dabble in the occult and the shadow primarily. /w for further info.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 68,
			},
			["time"] = 1603147738,
			["link"] = {
				["Alexarius-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 5,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-70:64:64}\n{p:c}{link*https://www.argentarchives.org/node/92509*AA Profile}{/p}\n{h2:c}{col:508283}Appearance{/col}{/h2}\n{p:c}{link*https://i.gyazo.com/7f99a08a964261e97b2ccc7bc5350c26.jpg*Image by Lyna}{/p}\n{p:c}{link*https://i.gyazo.com/3ae2c2098df958d82659625c906f7021.png*Face referance, by Bee}{/p}\n{p:c}{link*https://www.youtube.com/watch?v=bxuoEiDwiAs*Kakio Video featured}{/p}\n{icon:INV_Misc_GroupLooking:25}{col:2a9ab6}This forsaken, unlike others of his kind, carries a less hunched apperance. He attempts to keep himself straight at all times. His elbows and knees, while suffering from some degrading, is far from as rotten as most of his kin.\n\nWhere he lacks the most flesh would be his hands, his fingers like claws and his hands are clearly made for the task of the tinker and stalker.\n\nHe appears very sickly thin, another indication of his body still in the proccess of slow decay where lack of food has brought him down to a minimal weight that doesnt seem to hinder him, just work in his advantage with a more agile figure.\n\nHis usual leather grab is that of the Deathstalker, tight light leather with a cloak that seems to defy the very basics of gravity; floating around behind him as he moves. \n\nHis face still appears like that of a young adult. A teenager at death, and his hair was once a darker golden blonde but has ever since his death started to lose its color and now is more of a sicked mix of blonde and white.\n\nBeneath his armor, Alexarius carry the signs of one who practiced the arts of the Lightslayer. Multiple scars and charred skin, dark in its appearance, fills his entire body from neckline to his feet. Most seems to been inflicted by light based weaponry and, indeed, a way for him to build up his impressive resitance to the light and its effects on the Undead.\nAs a result of this, his head seems almost not to belong to his body what with the contrasts of the charred blackened skin against his more pale skin upon his head.\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-12:64:64}\n{h2:c}{col:675d93}Personality{/col}{/h2}\n{icon:INV_Icon_Trait_Retraining:25}{col:2a9ab6} Alexarius, a man of the virtues of the Shadow with the mind of a teenager. \nReflecting his zealous belief and that of his mentor, Alexarius sees himself as a prodigy of the Shadow and as such will see others as means to an end, as well as seeing the light for the evil it has become.\nHe does mantain a hard belief of chivalry, however, and will usually be misstaken for flirting when merely expressing his chivalrious upbringing's teachings.\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-58:64:64}\n{h2:c}{col:805899}History{/col}{/h2}\n{icon:INV_Misc_Book_11:25}{col:2a9ab6}Alexarius hails from Stromgarde and was born the twin of Varissa Arrian, both children to notorious bastard son Zeth (today known as Akru) Arrian.\nAt early age, Alexarius was abandoned and spent much of his upbringing alongside his uncle Kazeon, a traveling monk.\nTogether with his uncle, Alexarius learned much of the world through first hand experience and spent many nights under a bare sky or under deck of cargo ships. As a result of his diverse upbringing, Alexarius was a sort of jack of all trades, but master of none, when he enlisted with the SI 7 of Stromwind at the age of 13.\nFrom here, Alexarius spent a few years in training as both a tinkerer and a scout for Stormwind, seperated from his adoptive father figure completely. \nAt the age of 19, Alexarius faced his demise alongside his Squadron wihin Gilneas, having been dispatched to aid the Worgen against the Forsaken onslaught.\nRaised into Undeath, Alexarius was quickly roped into an apprenticeship under Abbess Andaline Hollowheart and learned the ways of the Shadow quickly. Alexarius has served in orders such as the Moklohn Command, the Collective espionage, the Deathstalker elite Squadron and the formerly Forsaken order Hand of Agony.\nAlexarius, alongside his mentor, reformed, refined and revived the Shadow Inquisition alongside members of the Assembly of Shadow upon the arrival of the Legion.\nDuring the aftermath of the Legion's defeat, Alexarius partook in each campaign from Silithus, to Ashenvale and eventually the burning of Darnassus. Later he partook in the battle of Lordaeron but refused to retreat and was missing in action for months as a result of his reluctancy to give up the homelead, chosing instead to partake in hundreds of hit and run tactics across Lordaeron and Arathi until he eventually resurfaced in the Warrior city some half year after the fall.{/col}",
				},
			},
