				["T1"] = {
					["TX"] = "It is well known that where the body may cease, the soul will persist forever. A tragedy in the north had brought the promising young Bathory to a swift end and thus started a sorrowful fate of many regrets for the things she had never done and will never do again - or so she thought before her last breath. The curse of undeath had opened Regina's eyes to a new spectrum of studies - the philosophy of life, how little it is prized by those who savour it at its fullest and how deep is the yearning for it by those who partake in it no longer. The gnawing thought she would never feel and delight in life again, the sorrow of the lost loved ones, the hatred for those who have unjustly claimed her life and the torment of an eternity spent roaming the lands - those are but a few echoed feelings that persist within, and yet the soul carries on, always burdened and never at peace. For her, the only thing left to do is seek answers, whenever they will come.",
