				["TE"] = 1,
				["T1"] = {
					["TX"] = "He is a rather clumsy guy who often takes on tasks too difficult for him, believing it will be fine. Usually thinks of himself as very deep and mysterious, but truth be told: he is the exact opposite. \n\nLanthorin was born in Thunderbluff, Mulgore, to a pair of hunters. Having never been familiar with the ways of the blood elf, due to the fact that he was never really involved with them, he grew up to look upon himself as more of a tauren. \n\nHis parents left Silvermoon years ago due to how unwelcoming the people of the blood elf capital were to those who chose to walk the path of nature, and growing a special bond with the creatures who called it their home. They settled down in Thunderbluff where they met a tauren named Chayton Stonemane, who quickly became their dear beloved, and most trusted friend. So much so that once they found out that they were awaiting a child, they asked Chayton to be their child's godfather. \n{col:ffffff}{/col}\nLanthorin grew up growing a strong connection to nature and would often join his family when they were out hunting, but at some point his parents were sent out on a mission to winterspring, where his parents were ambushed and tragically passed away. \n\nBeing left with no parents, Chayton took the orphan under his wing, figuring it would be his responsibility to take care of him. He raised the boy into the young man he has become today, where he travels the world to connect with all kinds of beasts and people along the way. ",
