				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Scars",
						["TX"] = "Upon many areas of the man's body, one could find several deformations within his skin, such in the fashion of scars.\n\nUndoubtably extremely difficult to look past would be his heavily scarred left cheek, a spell having landed upon the area and through such, created a gruesome marking for the rest of the man's life.\n\nWere he to not wear a shirt with a long neck, one could also easily take notice to his throat, where several lacerations appear to have taken place, the tissue now being bumpy and heavily deformed.",
						["IC"] = "Ability_Fixated_State_Red",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Stare",
						["TX"] = "Were it due to skepticism, lack of sleep or pure disinterest, the man's eyelids seem to loom over their respective golden orbs in a hollow stare, rarely fixating upon a specific point for too long before their focus were to be drawn elsewhere.",
						["IC"] = "Ability_Fixated_State_Green",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Ink",
						["TX"] = "Aside from scars, a wide variety of permanent ink could be found adorning the man's muscular frame, the vast majority of such coiling across his limbs in the form of floral patterns and vines, before the ink came to connect upon his chest where the vines coiled, forming his surname in cursive.\n\nLeading up from his broad shoulders, the ink continued, stretching on to his throat, where the ink had come to be nothing but a mess, due to the heavy scarring which now adorned the tissue after several lacerations had landed upon the area.",
						["IC"] = "Ability_Fixated_State_Purple",
					},
					["5"] = {
						["IC"] = "INV_Legendary_FistWeapon",
						["TI"] = "Weaponry",
						["AC"] = false,
						["TX"] = "Concealed by suited leather, one could more often than not find a large piece of metal hanging upon the right male's back, this being one of his more trusted pieces to wield, be it in attacking nature or defensive. \n\nWith the steel extending far upon his forearm, were it to be carried with malicious intent, it could with ease stop incoming blows, but also deliver them with the aid of the blades which protrude at both the front and the sides.\n\nThere would be another piece, a long dagger, tightly strapped to his right flank where it would be easily grasped and used in his left hand, if need be.",
					},
					["4"] = {
						["IC"] = "Ability_Fixated_State_Yellow",
						["TI"] = "Form",
						["AC"] = true,
						["TX"] = "Having served several years within the military, and now as a blacksmith, it would hardly be surprising that the male's form would be in close to prime condition, if not perhaps too muscular for many people's liking.\n\nHis frame would be bulging with clear signs of prominent musculature in more places than not, resulting in his appearance usually being seen as quite peculiar from the elven standard's natural grace and beauty.",
					},
				},
				["v"] = 71,
			},
			["time"] = 1603408410,
			["link"] = {
				["Zaerathian-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 92,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{h1:c}{col:7d8dff}Zaerathian Vor'el{/col}{/h1}\n\n\n{h3:c}{col:7d8dff}A visage usually dorning little to no expression marks the presence of Zaerathian Vor'el, often found either blossoming and charading in a social gathering, or quietly stashed away on his lonesome, somewhere behind the scenes.\n{/col}{/h3}\n\n{h3:c}{col:7d8dff}\" My Perfection\"\n\nPerhaps an intimidating sight at first, the able-bodied elf stands at a height of six feet and five inches, towering above many of his kin, male as well as female. His frame, albeit usually covered with thick layers of leathered fabrics, sports several protrusions where the more substantial muscle groups of his body would reside, evidently one to keep himself in a shape which he himself deemed to be nothing but perfection.\n\nHis musculature could only be described as excessive for an elf, the man having grown awfully robust for his race, this thanks to his current profession as a smith, added to a healthy amount of exercising, a routine which appears to have stuck with him since his days within military service.\n\n\n\"The Reminders\"\nThe naturally tanned skin of the male would be found littered by a wide array of permanent reminders, these in the form of scars and inked adornments, his neck and left cheek sporting the most prominent of the aforementioned scars. The tissue of his throat had now been reduced to a rocky valley of scars, such being due to the area having been the recipient of several attacks. His cheek meanwhile only sported one scar, this however being the one which is the most difficult to look past, the origin of the disrupted tissue being an attack of magic nature, now having left a constant mark upon his previously unblemished visage, spreading from about an inch below his eye, to just before his jawline.\n\nDue to an odd occurence, the male's left ear appears badly scarred, a large portion of such seemingly having been severed before being somehow placed back, leaving permanent, grim marks where the flesh was initially torn, before being placed back together.{/col}{/h3}\n\n\n{h3:c}{col:7d8dff}\"The Masterpieces\"\n\nWith nothing but pride blossoming in regards to his physical appearance, the young man had deemed it fit to use his frame as a canvas of sorts, rendering it the home for many of his self-proclaimed masterpieces, such coming in both inked form, several done by himself, as well as metallic adornments, done by acquaintances.\n\nPiercings could be found mainly in his visage, these being a thick, black nosering, hanging from his septum, within the black-coated steel there would be the inscription of the male's surname. A small steel sphere could to the keen eye be distinguishable, imbedded within the tissue of his tongue and finally a small silvery hoop, located in the left corner of his bottom lip.\n\nCrawling across his thick arms, one could see large, thorn-clad vines, inked in a coiling pattern across the muscular limbs. As a background forthe vines, a floral pattern would be distinguishable, looking much like his limbs previously were completely covered by a floral canvas, which then has been overgrown by the vines, which would soon break out in to roses upon the back of his hands. Upon his chest, the inked vines would form and mold in to his surname: \"Vor'el\", written in cursive, connecting the ink from his arms.\n\nAside from his limbs, his back would also carry one large piece of ink, this being the emblem of the city from which he originates, Silvermoon. {/col}{/h3}\n\n\n{h3:c}{col:7d8dff}\"The Mixture\"\n\nOften described as a pleasant view, he stands there, pride and kind intent to be found within his heart, however molded in to a mixture with the torment of his past. Encased in a protective shroud of lies and secrets, his darkest demons reside, such being the actions in his past, and the fear of future actions of the same, devestating nature.{/col}{/h3}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n\n\n",
				},
