			},
			["about"] = {
				["v"] = 4,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Virtues{/h1}\n\n{img:Interface\\Pictures\\artifactbook-priest-cover:256:256}\n\n{h3:c}\"The philosophy of the Holy Light boils down to the three teachings, called the Three Virtues. These virtues—respect, tenacity, and compassion—are each defined into a principle and a lesson. Acting on these three tenets helps make the world a place everyone can appreciate; a world of honor and justice.{/h3}\n\n{h2:c}Respect{/h2}\n\nRespect is the first virtue taught to those joining the path of the Light. When looking at an enemy, one must look past the hatred that separates. There are qualities to respect and prowess to be acknowledged. Conducting oneself with honor and treating one's opponent as one wishes to be treated shows respect. Respecting one's opponents on the field is acknowledging a connection, which brings one closer to the Light.\n\n{h2:c}Tenacity{/h2}\n\nTenacity is the second virtue. This is the virtue of persevering through troubling times and painful experiences. In the face of despair and hatred, one must continue to stand true to their beliefs and fight on.\n\n{h2:c}Compassion{/h2}\n\nCompassion is the last step on the path of the Light. In times of rivalries, it is easy to see differences at every turn. The challenge is in looking beyond appearances and understanding the similarities. Through this understanding, one can feel compassion for the losses others have suffered, even if the victim bears another banner. By feeling and understanding compassion in enemy and ally alike, one reaffirms his or her connection with the world.\n\n{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n\n{h1:c}The Cult of Forgotten Shadow preaches three virtues: respect, tenacity, and power.{/h1}\n\n{h2:c}Respect{/h2}\n\nThe universe is the physical manifestation of other's wills. Thus, for a person to denigrate the universe is to ignore the personal power of those around them. This is not only disrespectful, it is dangerous. A follower of the Forgotten Shadow must develop his personal power in order to exert his will on the universe, but seeking too much power too quickly puts him in conflict with other, stronger beings. Only a foolish follower seeks to challenge his superiors right away. Showing respect ensures a measure of self-protection.\n\n{h2:c}Tenacity{/h2}\n\nFollowers of the Forgotten Shadow put even greater stock in the virtue of tenacity. It may at first seem impossible for a person to change the universe when countless others seeking to do the same surround him. Through unwavering perseverance and tenacity though, they may triumph.\n\n{h3:c}Power{/h3}\n\nPower is the third virtue of the Forgotten Shadow, and the most difficult to attain. A Forsaken who grabs greedily for power might encounter power too great for him or her to handle, and die in their attempt to master it. A Forsaken who succumbs to despair and seeks no personal power has no reason to exist; he craves nothing, desires nothing, he sits alone and pines for his old life. To the cult, Forsaken who do not seek to better themselves might as well still be part of the Scourge. The quest for power requires caution, forethought, and a subtle touch.\n\n{h1:c}Balance between Light and Shadow{/h1}",
