		["03052035074qzc0"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Silver Throwing Knives/Needles",
						["IC"] = "INV_ThrowingKnife_03",
						["TX"] = "Most of the knives and needles are hidden, but some of them can usually be seen attached to her belt, shoulderpads, thighs and legs with the help of straps and small pockets.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Eyes",
						["TX"] = "Her eyes seem somewhat damaged. Her pupils and iris have a more grey/silver color, looking a bit damaged, while her sclera stil has a fel green color to it. Though the fel green glow is barely noticable, and not very prominent. Her eyes do not seem to always follow what happens around her.",
