					["5"] = {
						["IC"] = "Spell_Shadow_Shadesofdarkness",
						["TI"] = "Dark aura",
						["TX"] = "Faint black/purple energy seems to appear occasionally, dancing along her body, only to fade soon after, giving off a ratehr uncomfortable aura.",
