				["v"] = 69,
			},
			["time"] = 1603291315,
			["link"] = {
				["Valencía-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n{h1:c}{col:ffffff}~ DESCRIPTION ~{/col}{/h1}\n\n{col:ffffff}PHYSICAL DESCRIPTION:{/col} \n\nShe stands 6 feet tall with a slim, athletic and agile build. She neither looks or is very physically strong, but her piercing gaze, agility and mastery over the void and shadow more than makes up for her lack of physical strength.\n\n{col:ffffff}EYE COLOR:{/col} \n\nHer eyes seem somewhat damaged, her pupils and iris have a more grey/silver color, though the fel green is stil somewhat visible, while her sclera stil has a prominent fel green color to it, although the glow itself is rather weak. Her eyes do not seem to always follow what happens around her, as well as usually covering her eyes from bright sources of light.\n\n{col:ffffff}FACE/HAIR:{/col} \nHer face is usually blank and emotionless, carrying no particular expression at all. Her hair matches her nickname, having having a mix of silver and white straws of hair, mostly always tied up as a ponytail, reaching just a bit past her shoulder blades. She has a few freckles underneath her eyes which also crosses the bridge of her nose. She has two silver rings in her left ear and one silver ring in her right ear, all of them near the tip of her ears. \n\n{col:ffffff}BODY:{/col} \nShe stands 6 feet tall with a slim, athletic and agile build. Her bust is smaller than avarage, though this helps with her agility. She neither looks or is very strong physically, but her hatefull gaze, angry mood and stares of death makes up for that.\n\n{col:ffffff}JEWELRY/SCARS::{/col} \n\nShe has two silver rings in her left ear and one silver ring in her right ear, all of them near the tip of her ears. She has a single scar over her left eye, but it has done no damage to her eye at all.\n\nShould her clothes be removed, her back would be filled with scars from lashings and cuts. On her left shoulder there is an scar from a bullet entry wound on the front and an exit wound on the back.\n\nShe has a long scar from having been burnt with light magic, the scar going from midway up her right arm and travels up to her neck.\n\n{col:ffffff}CLOTHES AND WEAPONS::{/col}\n\nShe usually wears tight leather outfits for agility, being very fond of black, red and white and silver colors. She often uses some sort of face cover or hood to hide her identity when she is in crowded places. Her armors can for the most part be seen having throwing daggers and needles hidden everywhere, always prepared.\n\nA black leather holster is attached to her right thigh, holding a pistol with elven design, made out of enchanted silver and truesilver components.\n\n\n\n{col:ffffff}PERSONALITY:{/col} \n\nShe has a very cute and beautiful face, not fitting her personality at all. Her face is mostly always blank, expressionless and emotionless. A sadistic grin will spread across her face from cheek to cheek when she is torturing, getting fired up in combat or just being condescending towards others.\n\nEven though she is quite sadistic, finding satisfaction in seeing others suffer, she does have her \"soft\" side. At times, especially when she is not working,  she can be seen blushing when reading one of her many romance novels, sneezing which makes her sound like a kitten and can acting quite childishly.\n\nDue to her childhood, Silver has developed extreme social anxieties as well as a fear of being touched. Large groups makes her uncomfortable and nervous. She tends to not talk much to others, using as few words as possible.\n\n\n{col:ffffff}BACKGROUND:{/col}\n\n{col:ffffff}Telogrus Rift:{/col}\n\nHaving studied shadow/void magic for many decades, the exile of Magister Umbric and his followers did not go unnoticed, neither the information about a powerfull artifact residing in the Telogrus Rift. Following the other pilgrims who wish to furtther their studies in this 'forbidden magic', she managed to secure a passage to Telogrus Rift. As she arrived after the event with Nether Prince Durzaan, she was spared the fate that befell Umbric and his followers. For months she studied further into inproving and mastering her grasp of the void, fueled by her own selfish desires and lust for power.\n\n\n----------------RPBR---------------\n\nSpecialization: Damage\nRP level: 20\nXP: 1290/3000\nBattle Bond: Valdris x3 damage\nGold: 10g, 69s 83c\n\n\n{col:ffffff}Items:{/col}\n\n- Pistol ammunition: 13/15\n\n\n{col:ffffff}Chosen Perks:{/col}\n- Zealous - 3AP\n- Flexible IV -1AP\n- Critical III - Passive\n- Dual-Strike -1AP\n- Smack IV -2AP\n- Reroll - 2AP\n- Instant Luck - 1AP\n- Desolator - 2AP\n\n{col:ffffff}Unique Perks:{/col}\n\"Ambush\" - Spend 1AP to deal 2 damage (need to be stealthed and at the start of a combat round)\n\n\"Master of Shadows\" - Bonus to using shadow and void magic out of combat.\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}",
				},
