		["1014132940j9mes"] = {
			["zone"] = "Silvermoon City - Walk of Elders",
			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "achievement_character_bloodelf_female",
						["TI"] = "Appearance",
						["AC"] = true,
						["TX"] = "Despite lacking the wealth of the upper classes in Quel'thalas, Eleyira still does her best to care for her appearance, though her work and long journeys into the woods often leave her looking a bit rugged or rough, at least in terms of her clothes.\n\nShe has no visible scars, which coupled with her lithe build does provide her with a fairly attractive appearance, at least by average Sin'dorei standards.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Scent",
						["IC"] = "inv_helm_flowercrown_a_01_pink",
						["TX"] = "Most of the time she'll have the scent of the forest or flowers around her. Most of the time it's probably just simple perfume, but sometimes the scents of the woods rub off on her.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 0,
				},
				["v"] = 15,
			},
			["time"] = 1603409697,
			["link"] = {
				["Eleyira-ArgentDawn"] = 1,
			},
			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["IC"] = "inv_misc_herb_arrowbloom",
						["BK"] = 1,
						["TX"] = "{col:14b200}Bright and innocent, Eleyira's glowing blue eyes are the features that stand out the most at first glance, contrasting brightly against her otherwise dark brown skin. She stands somewhat shorter than the average Sin'dorei but she seems no less prideful of her heritage despite that fact, always carrying herself with her head held high.\n\nLike so many blood elves, Eleyira is gifted with what most people would consider natural beauty, her body having a traditional elven hourglass form, while still being somewhat toned, displaying her athletic prowess.\n\nHer natural, midnight black hair is often kept in a ponytail or a braid hanging off her shoulder, but when released it quite easily reaches almost all the way to her waist.{/col}",
					},
					["PS"] = {
