					[2162909016] = 1,
					[2293848791] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Quexie Fizzlepix{/h1}\n\n{h2}Gear{/h2}\n\nQuexie is often found wearing her personal equipment, which consists of a somewhat unsubtle set of mail armour, a large custom rifle and a pouch around her waist containing various smaller tools.  Hidden in her boot is a smaller dagger (although the trained eye might be able to notice it).\n\nCan at times also be seen in more leasurous clothing, at that point more aimed at drawing attention with flashy jewelry to accompany her extravagant dresses.\n\n{h2}Behaviour{/h2}\n\nNot uncommon for her kin, Quexie is sassy, outgoing and definately not shy to tell her mind.  At times she can be experienced as pushy, and seemingly willing to go to much length to manipulate others to bend to her will.  Other ways of getting her way includes being flirty, deceptive or even threathening.\n\n{h2}Looks{/h2}\n\nQuexie is certainly a good looking Goblin lady, and she knows it.  It's clear she spends a lot of attention to her image,  Her lusheous green hair is always neatly in order, and she makes sure her jewelry is polished and shining.  Even her gear seems to be pristine, and her gun shows signs of great care and maintenance.\n\n{h2}History / Meta info{/h2}\n\nQuexie spent most of her youth growing up in Gadgetstan, living a fairly common (for Goblins) life.  A while after the cataclysm had struck, she decided it was time to leave her hometown to travel into the wide world, and get rich doing it.  It did not take long for her to end up among the horde, yet her motivations might be slightly different from the common horde grunts.\n\nSome may recognize her as miss May from a goblin pin-up calendar from a while ago.",
				},
