						["TX"] = "Gazing at the face of death is far from a pleasant experience. Two eyes burn in a bright blue flame as they stare at whatever might catch their attention. Two pointy ears twitch at any and each surprising or irregular sound within the vicinity. A stitched scar travels through the entirety of the left side of the face. \n\nThe Death Knight stands at ten feet of height. His body scarred and battered, however still largely intact and in one piece. A clear telling of the countless battles the walking corpse has seen through.\n\nThe Troll always covers himself in thick plate armor, heavy enough to slow down even a creature of Unholy strength. Topping his appereance off with always wielding the largest, most brutal looking weapon imagineable. \n\nClearly he's someone who is quite fond of showing off his disposition.",
