						["TX"] = "Garrinda is a fairly typical looking orc: she does not stand particularly tall nor does she look particularly unusual in body type. Like most her kind she is fairly athletic looking, perhaps a little on the leaner side suggesting she's not had an easy time of it. Her features are most times drawn in a neutral expression, while in quiet moments her hazel eyes convey a sadness that goes down to her soul.\nGarrinda usually wears a robe of some description, tribal looking and usually in earthtones. Her hair is adorned with a few clasps to keep it put up while a few smaller fangs pierce her ears. A snug choker sits around her neck, a single fang from what appears to be a small feline creature hanging from it.",
