						["TX"] = "{h2}Appearance{/h2}\n{link*https://imgur.com/a/9QWJv0o*Joris'ba by Kira Kalon}\n{link*https://www.youtube.com/watch?v=jE0o06py_sg*Voice refference: Batrider W3}\n{h2}Armor{/h2}\nThough a smith, Joris'ba personally chooses not to wear too much metal on his person. Though wristguards and shoulderpads consist of steel which he occasionally uses to protect himself from attacks he's not fast enough to avoid, most of his armor is made of sturdy leather allowing him to move around with more ease while still functioning somewhat as protection.",
