			["time"] = 1603230773,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1} {col:ff2856}Appearance{/col} {/h1}\n\nHe's a tall, burly hunk of a Troll, standing around 8'5, not the tallest but still quite large. From his appearance you might think he's quite the gentle giant, but don't let that fool you, he can still turn back into a savage when he needs to.\n\nStarting from his head, he sprouts a long mane of black sleek hair with a short hairline, being one-hundred and twenty-one does take a toll on your body. Both his ears are pierced at the ends, ringed fitted to stretch the hole in his lobes as a sign of wisdom and power. His face is a rugged sorts, pleasing to look at in an admirable sense but the more you look, the more wear and tear you can see, but through all that you somehow sense a calming and friendly presence from it all. His eyes shine a deep sea blue with a large cascading nose to stare down in pride, golden plated tusk bringing attention to his prominent lips and chin, gliding down to his strong neck tendons and powerful jawline, taking away attention from his scaly brows and forehead.\n\nPhysically his condition is fit, having struggled from a young age, the paladin you see before you is strong, brawny and powerful, his movements are slow and calculated but he is no stranger to speeding up when conditions demand it. His prominent chest boasts a traditional Zandalari golden tattoo which circles and wraps around his forearms and abdomen, the plating glistening with each second the light beams onto it. The troll boasts two medium-sized rings piercing each nipple, within the jungles of Nazmir, body modification is quite the rage, so he presents it not as a shameful flaw, but for pride in getting to where he is now.\n\nHis arms ridge with slight veins which wrap down to his worn and weathered hands which have seen hard-fought battles, both hands leathery and damaged. From the waist down, the tattoos seem to stop, as the mark of a paladin has been burned into his pelvis, a faintly glowing sygil of the order of the silver hand, a pleasant reminder of his past indoctrination. The troll, even with his unmentionables not displayed seems to be quite well endowed, perhaps blessed by the loa if you were to mention it to him. Lastly are the strong legs which trolls take pride in, as you can clearly see, each hamstring has been worked rigorously and is tough to touch.\n",
						["BK"] = 5,
						["IC"] = "inv__blood troll male head",
					}, -- [1]
					{
						["TX"] = "{h1:c}{col:ffb532}Personality{/col}{/h1}\n\nPel has a somewhat kind personality, he aims to make those around him feel safe and welcome with the aura he emits. Yet, he does not shy away from using sarcasm to poke fun at well mannered induviduals for slight fun and games. He's an all around \"good guy\" but likes to present himself as a hulking foe that others have to battle to talk to, when in reality he's a softie.",
						["BK"] = 8,
						["IC"] = "inv_helm_laughingskull_01",
					}, -- [2]
					{
						["TX"] = "{h1:c}{col:2753ff}History{/col}{/h1}\n\n\nPelge'ra is a Zandalari Troll of Nazmir, naturally that would turn people off with what the current residents have turned into, but that doesn't mean that every troll is like that. It was once a lush rainforest like Zuldazar but after the cataclysm it turned into the swamp it is now. Pelge'ra struggles from time to time to cope with his past as a Blood Troll but dreams to be a paragon of a prelate in the eyes of his peers and earn their respect. \n\nDuring the time of the Cataclysm there were slight Alliance and Horde incursions into the isles surrounding Zandalar which led to a handful being shipwrecked off the coast of Nazmir. Pel, still in his youth at this point, investigated the wreck and found it to be a holy envoy to spread the light to savage uncivilized peoples across the isles. Interested by this \"Light\" he sat down and listened to their gospel, both sides of the coin, the Human side with their churches and devotion along with Draenei, Blood elf and Tauren. With this knowledge he found something within him, he knew that the calling of the light was his purpose in life, so he made a commitment there, to be branded a holy crusader in order to discard his past and be proud of the markings on his body.\n",
						["BK"] = 15,
						["IC"] = "inv_misc_book_02",
					}, -- [3]
