				["BK"] = 2,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "DISCLAIMER:\nIn character is in character.\nIf you feel like my character is crossing a line and is making you uncomfortable, please let me know, RP is supposed to be fun.\n\n{link*https://cdn.discordapp.com/attachments/694118471268827268/706608547420569740/Vitsaus_undead_1_filtered.png*Vitsaus doodle}\n{link*https://i.imgur.com/CxRFW8t.png*\"Get off my lawn!\"}\n\nI enjoy a bit of improv and I have left some things from Vitsaus' past to fate (i.e. feel free to tell him you recognize/remember him and that you may in fact know what happened to this or that. Vitsaus has spent time being dead after all, he can't keep up with everything that has happened while he was out).\n\nEstablished facts:\n\nIn life, Vitsaus Bjork lived on the outskirts of Stratholme, taking on the odd craftsman jobs such as roofer, netmaker, or parchmenter.\n\nHe was an old grouch who always seemed to keep to himself and only ever left his run-down cabin to go to the market.\n\nHe was a frequent customer at various breweries near/in Stratholme.\n\nTowards his latter years, he was never seen together with his wife or (adult) son. It appeared that they had fallen completely out of touch. His son may have been in Stratholme during the culling. Maybe he is dead, undead, or even alive.",
