					["TX"] = "{h1:c}Eilyne Vadra{/h1}\n{img:Interface\\ARCHEOLOGY\\ArchRare-HighborneNightElves:512:256}\n\nAs the elder daughter of the Vadra family, Eilyne carries herself with much decorum as is expected of her. While the Vadra family is not a noble one yet, their wealth from owning one of the larger vineyards in Suramar has granted them a limited position in Shal'dorei high society, but wealth can only carry one so far. Eilyne sees it as a point of pride to find a noble suitor to marry, to bring the recognition she believes her family deserves.\n\nGrowng up she seemed to have a natural affinity for the Arcane, Often being ahead of the others students her own age, gifting her (or cursing her) with lavish praise and attention from her family and peers alike that has moulded her haughty attitude.\n\nEilyne is a lover of music, but will find it hard to admit that she enjoys songs not from Suramar.",
