				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Physical Flaws:",
						["TX"] = "Most noteworthy about Vel'tharon is his size and height.\n\nHe stands 7'5ft tall and bulking, yet refined like any elf, his muscles are lean and nearly no fat, which in turn has his veins pop alittle more than usual.\n\nHe lacks most of his left ear and the tip of his right, clearly cut by a blade several years back!\n\nAround his right eyesocket you can see several scars running outwards with several smaller ones out from the bigger ones, in a lightning/cracking effect.\nThis was due to high pressure against his skull, which had his skull crack and cut open the flesh and his eye squished.\n\nHe lacks several fingers, he only has three fingers on his right, lacking his pinky and ring-finger and on his left hand he lacks his pinky.\n\nHe also lost a few toes during his years of service in the military, either from frostbite or amputation due to injuries.\n\nHis face is somewhat still intact, except the missing eye, most noteworthy is the several scars made from cuts or the continued broken nose which has the bridge of his nose, quite tough, round and scarred looking.\n\nHe has huge round scars on his back and front from a dragon chewing down on him, from right to left, which also seems to be suffering from a mild burn from a dragon aswell.\n\nHis right leg also has teeth marks, but these are from a crocolisk and there's some tear around them, as if the crocolisk thrashed as it grabbed his leg.\n\n(Picture in About)",
						["IC"] = "Ability_Warrior_IntensifyRage",
					},
					["3"] = {
						["AC"] = false,
						["TI"] = "Elven Sabre: Flamewalker",
						["TX"] = "On his back sits an elven blade, forged in mithril and enchanted with a Fire Enchantments that allows for two extra uses:\n\n(The orb dosen't glow as long as it isen't charged, but glows blue or green, depending on which type of fire that has been absorbed, fel, arcane etc.)\n\n\n- Flame-Caller: \nWaves of flames that travels like a small wave where it it swung.\n\n-Extinguisher:\nDraws in all nearby flames to empower the next swing of the blade with a blast on impact.\n\nThese extra additions make this blade quite the melee and ranged weapon.",
						["IC"] = "Spell_Frostfire Orb",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Quiver and Satchels:",
						["TX"] = "The Quiver itself is made from dyed lynx leather, tough and firm and the satchel is made from a much tougher kodo leather, hardened.\n\n------     Content    ------\n\nSatchels:\n\n-Several vials with pheromones, all labled with different tags that only Velth knows the meaning of.\n\n-Two grenades of gnomish origin.\n\n-Med-Kit for combat medical care with all the neccesary items needed for stopping bleeding, cleaning and closing wounds etc.\n\n-Dagger and smaller knife for skinning, cutting and other things.\n\n-Flintlocke pistol with 20 extra bullets and gunpowder to match.\n\n-Hook and chain for climbing or fightning.\n\n\n\nQuiver:\n(All arrows are made of light wood)\n\n-Broad-headed arrowheads.\n-Armour piercing arrowheads.\n-Barbed arrowheads.\n-Swallowtail arrowheads.\n-Needle bodkin arrowheads.\n-Hooked arrowheads.",
						["IC"] = "INV_Misc_Quiver_03",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Armour:",
						["IC"] = "INV_Chest_Mail_12",
						["TX"] = "The first layer of armour is a patted vest of cloth that protects from both cold but also softens blunt force trauma.\n\nSecondary layer is elven mithril chain-mail, light and strong which will catch stabs and slashes made towards it, but also it will not break, rather curve to the weapons's tip/edge.\n\nThird layer of armour is dyed hardened kodo hide that will absorb most blunt force and catch slashes and stabs, but it can be destroyed much easier than the chainmail, this being the main patting that protects Vel'tharon from attacks.\n\nHe also wears a cup to protect his crown jewels, made from leather and cloth.",
					},
					["4"] = {
						["AC"] = false,
						["TI"] = "Bow: Wind-Shrieker",
						["TX"] = "This bow is of elven creation and it has quite the history within the Redhawk family, but it holds no supernatural powers others than being quite precise, but that's likely the wielder.\n\nThe bow itself is a recurved bow, made from a strong yet bendy elven wood with a mithril inlaid core to make it even stronger.\n\nBoth ends of the bow is adorned with battle steel for both balance but also sharpened for melee combat.",
