					["TX"] = "\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Blizzard:512:10}\n{p:c}A Hero of the Frostwolf Orcs and the Mag'har people, Gaerah defended their people as the Lighbound on many occasions, though ultimately their forces were taking more and more losses than could ever be sustained.\n\nThe ultimate retreat of their people fleeing from Draenor to the safety of Azeroth cost Gaerah the life of her frost wolf companion, Gar'maw. The safety of the city and comfort of being surrounded by new allies reassured Gaerah, that their people would survive and build themselves a new future through the kinship of their allies.\n\nSince then the Frostwolf has travelled as an adventurer, aiding Horde and Alliance alike in their hours of need, upholding the honour of her clan no matter the circumstance.\n\nTraining under the Monk Masters upon The Wandering Isle helped quell the soul of the Frostwolf, being stricken with deep strife since the death of her life companion, ultimately finding enlightenment and a state of zen through her training, her now balanced spirit acting as her guide in times of trouble, and a great source of inner strength.\n{/p}\n{img:Interface\\PETBATTLES\\Weather-Blizzard:512:10}",
