						["IC"] = "ability_deathknight_reanimation",
						["BK"] = 1,
						["TX"] = "Deinhardt wears a heavy looking suit of full plate armor made by what seems to be an alloy from a few other metals. Not saronite as others of his kind often dons, it has a thicknessto admire with the battleworn signs to show for it's effectiveness aswell as runes etched into the metal itself at key places like joints.\n\nShould he be seen without his armor, or without some pieces of it his stature would be quite impressive for an undead, his time among the living alowed him to keep somewhat of a physique and a small hint of style, apparent in the simple clothing he usually wears when not in armor. Although countless repairs and reanimations of his flesh and bone has given his skin quiet the dried look sadly, nevertheless he seems to be without any rot or decomposition present and should he be seen in regular clothes his status of one of the dead would only be really visible should his face be seen, as it is a half sunken affair that at first glance looks a tad stretched in the skin due to reanimation repairs. Despite that he has a slight beard with a greywhite tint, it is cold and bushy with a hint of frost upon it. Joining this display of a remarkably okay face and  barely visible greywhite bushy eyebrows and beard is his hair, same tint has his beard it is oddly enough very soft and flowing, a complete contrast to the dry and sunken manner of the rest of his body.\n\nShould one ever get the chance to get a closer look on his bare hands it would be apparent that they are a little bigger than those of a human, seemingly closer to that of a kaldorei in a strange manner. The dry and sunken flesh and skin makes it hard to really know unless you where a kaldorei yourself.\n\nOn his neck a pendant sits, oddly enough made of iron with a symbol of two clasped hands joining together in brotherhood.\n\nHe has a pouch on his belt, sitting tightly on his left side that contains a random assortment of items.\n\nLastly he often wears a long large and flowing dark cape, similar to that of the kaldorei Wardens. It is woven in a rough material with suprising toughness to it and has seen many repairs. If one where to be very perceptive a stack of daggers sheathed horizontally underneath it could be seen with the right angle.",
