					["PS"] = {
						["TX"] = "Deinhardt is a peculiar undead as he shares some of the traits often seen by his kin although not as severely as anyone would notice or think, a low hollow snicker could at rare times be heard from within his helmet in the right situations, and many that know him has seen a side very much capable of anger and empathy, aswell as remorse and care, these feelings however dont manifest that easily and not just for anyone considering what he is.\n\nHe could at times be seen smiling with a small encouraging demeanour when speaking to people, although if this is theatrics or dulled feelings or maybe both no one really knows, Social games and false masks? for what purpouse who knows for sure.",
