		["[MSP]Domineer-ArgentDawn"] = {
			["about"] = {
				["T1"] = {
					["TX"] = "Character list: \n\n{icon:ability_racial_holyresistance:25}{col:fff300}Yuri Ann (Yuriann):{/col} Switch\n\nA warm, radiant paladin and a passionate devotee to the Light and the Alliance, willing to do anything for her people. Though rumors do get around about her dubious activities, she would adamantly defend her honour. \n\n{icon:INV_Misc_Herb_FireLeaf_Bramble:25}{col:ff0082}Alestrea Redleaf (Alestrea):{/col} Dom-switch\n\nA local human villager, known troublemaker and despised by the husbands and fathers of Elwynn for serial seduction of wives and daughters. She's bold, rebelious and definitely going through her attention seeking phase.\n\n{icon:achievement_FemaleGoblinhead:25}{col:ffe500}Assizi Boombust (Assizi):{/col} Dom-switch\n\nA goblin sapper for the Horde, famed for her tasteful photography of all denizens of Azeroth and ability to extort gold from her 'models'. \n\n{icon:ability_paladin_empoweredsealsjustice:25}{col:ff1600}Esilda Yae'fre (Esiyae):{/col} Switch\n\nA prideful Blood Knight dedicated deeply to her people. She crushes all her enemies beneath her metal boots and forces them to beg for forgiveness, though she reserves a softer touch for her allies. The elf looks like she belongs on a propaganda poster.\n\n{icon:ability_hunter_beasttaming:25}{col:ff8800}Trixi the Domineer (Domineer):{/col} Pure dom\n\n An ex-bruiser who has become a trader and bodyguard, what some might call a 'pimp', focusing on preparing 'guests' to go and visit her rich clients to fulfill their needs. She is sttill an active adventurer who likes to 'break in' her guests through hard work. ",
