				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "'Ahh, the great outdoors!'",
						["TX"] = "A scent of the forest surrounds her; Bark, leaves, flowers, grass and mud. All the scents and smells that tell of a lifetime in the wilds. It seems to easily encourage animals to seek her company.",
						["IC"] = "ui_darkshore_warfront_alliance_dryad",
					},
					["3"] = {
						["AC"] = false,
						["TI"] = "Au natural, baby.",
						["TX"] = "Florien looks quite different from most of her kin, from her white hair streaked with bright green tones to her nature-themed outfit of choice and even her magical aura. Everything about her screams \"NATURE!!\" She dresses in druidic garbs, with many charms hanging from her belt and her blossoming staff.\n\nThe strange sin'dorei's form is lithe - petite. She doesn't boast much in the form of curves, but is clearly still a woman under all those robes and leaves. Even so, her face IS quite feminine with soft skin, and a more rounded shape. Her white hair is streaked with green and decorated with both leaves and flowers, along with some colourful beads and feathers. Her skin is tan, slightly darker than you'd expect on one of her kin, and her shoulders are peppered with light freckles. A swirling, creeping vine is tattooed onto her entire back, along with blossoming flowers, and flower buds.\n\nAll in all.. Florien seems accustomed to living in nature, rather than the city.",
						["IC"] = "ability_monk_dragonkick",
