				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:bfff49}{icon:spell_druid_germination_rejuvenation:25}\n< Botanist Florien Autumnden >{/col}{/h2}\n{h3:c}{col:bfff49}Florien looks quite different from most of her kin, from her leafy hair to her nature-themed outfit of choice and even her magical aura. Everything about her screams \"NATURE!!\" She dresses in druidic garbs, with many charms hanging from her belt and her blossoming staff.\n\nThe strange sin'dorei's form is lithe - petite. She doesn't boast much in the form of curves, but is clearly still a woman under all those robes and leaves. Even so, her face is quite feminine with soft skin, and a more rounded shape. Her white hair is streaked with green and decorated with both leaves and flowers, along with some colourful beads and feathers. Her skin is much darker than you'd expect of one of her kin, and her shoulders are peppered with light freckles. A swirling, creeping vine is tattooed onto her entire back, along with blossoming flowers, and flower buds.\n\nAll in all.. Florien seems accustomed to living in nature, rather than the city.{/col}{/h3}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{h3:c}• Approachable for RP anywhere if I'm marked IC. If you want to interact but are shy, just whisper me and I can initiate RP with you.\n• Attackable, at own risk, I accept both emote and /roll battles. Not ingame duels, however. Only powerplayers do that shite!\n• Need a mender, herb enthusiast or an alchemist? Feel free to ask her!{/h3}\n\n\n{img:Interface\\QuestionFrame\\answer-warboard-bfa-Drustvar:512:256}",
