						["TX"] = "Arro's sporting a new look, his chocolate brown hair has grown all the way to below his breast and shoulderblades, it's been messily tied up into a half-bun.\nHis chops are clean shaven whilst he's left a chunk of beard on chin and mustache, a red band has been tied on the beard.",
