			["about"] = {
				["v"] = 36,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://www.argentarchives.org/node/154038*Argent Archives}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-58:200:200}\n\n{col:ffb548}Arrorin{/col} {col:878787}stands tall at his height of 6'6\", appearing to be the typical guy that stands out from the rest, not only because of the notable deep scar over his right eye in shape of a cross which briefly cuts through his eyebrow, but he also stands out because of his piercingly dark moss green eyes, always seeming alert and observant of what's going around of him.\n\nThe male's hair is of a dark brown colour and seems to be rather uncared for, usually kept slightly messy and as it is, except for the colour itself which is dyed from his natural silver-white.\nHis eyebrows are thick and has the same colour as his hair, which appears to go almost perfectly together with the moss green eyes.\nThe jaw and all appears shaved clean from beard, sometimes carrying a stubble whenever he hasn't been bothered to shave for a while, he does however always leave his chin bearded.\n\nHis body built isn't extraordinary at all, however he is visibly greatly well-trained, exercise obviously being a part of the man's daily routine which are the result of his muscular body.\nThe muscles are long rather then thick, seeing Arrorin is clearly trained in agility rather then strength.\nHis most notable muscles would be found upon his legs which are thick and muscular, built for running long distances, climbing but could also be used to his advantage in form of a weapon in close combat.{/col}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-47:100:100}\n\n {p:c}Tattoos & Scars{/p}\n\n\n{col:878787}* A pattern of black tribal tattoos decorates his left breast pad and travels across his shoulder and down his entire left arm, stopping just before reaching his wrist, into some of the tribals upon his bicep are some deep scarring; left-overs of what used to be a different tattoo.\n* Upon the sides of his hands towards his pinky fingers he has two small black tattoos, the right one saying 'Zeith' while the left one says 'Laeran'; the texts are of a simple, edgy style.\n* The name 'Kimyra' upon the side of his right bicep.\n* A sword going through a dragon skull on his right upperarm, all going in black and grey colours.\n* Rising ocean wave in a realism styled manner going purely in black and grey adorning his whole right inner forearm.\n\n\n* His whole back cloaked in deep, long scars, some being deep enough to miss-shape the flesh somewhat, in overall it looking like a massive web of nothing but scars. This being done after rechieving countless of lashes upon his back, a few of the scars slightly splitting his tattoos by his left shoulder.\n* Below his left breast pad a circular faint scar would be spotted, old bullet wound most likely.\n* Faint vertical scar across across his stomach and at the same area upon his back - which is however hard to notice due to the cloak of scars, seeming to be from being impaled by something.\n* Faint - but obvious if looked upon close - \"dotted\" scarring along the elbow crease upon both his arms.\n* A deep scar going across his right palm.\n* Gentle scarring over the left side of his neck, the result after having a tattoo removed.\n* Deep cross-shaped (X) scar across his right eye, splitting his eyebrow some which prevents hair from growing there.{col:878787}\n\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-47:100:100}\n\n{p:c}Armor & Weaponary{/p}\n\n{col:878787}Arrorin is usually always seen clad in a dark brown and silver leather armor, it appears professionally hand-made and made completely for his use.\n\nSeeming to form by his muscles and built nearly perfectly, allowing him to be as flexible as he chooses to be.\nTwo daggers are almost always strapped to each side of his belt, it being of a black steel material, the blades decorated in details of some sort.\nIf looked upon closely, his gloves and boots have hidden small \"pockets\" inside of them, where he always keeps a thin razor-sharp knife, one in each piece.\n\nIf wearing said armor one would notice small spikes decorating the front and back of his boots, they appear small and few in numbers however, obviously not put there to create actual impacts - although enough to rip and pierce skin.\n\nA holster-like strap of leather have been wrapped around of his left thigh, on the outside of his legguards - this always holding atleast five or more simple throwing knives.\n\nSimilar holster-like strap of leather on the right thigh, however this hanging lower and more side-ways then the other - this one always holding a heavy looking old pistol and a dagger with details on the blade, the handle being made out of some sort of bone, having red and golden bands wrapped around of it.{col:878787}\n\n\n\n{col:00ff20}OOC good to knows:{/col} \nArrorin can be recognised by city guards and/or Blood Knights for several crimes and for having spent 13+ years behind bars.\nCan be recognised within' the black market and the drug business.\nCan be hired as a bounty hunter.\n",
				},
