						["TX"] = "Of pale complexion and wavy platinum-blonde hair, Raendil's features are adorned with the endearingness of youth. Raendil's features appear well-defined for his age; possessing a prominent jawline, a dimple tucking into the left side of his smile, adding to his often sprightly expression. \n\nHis golden-tinted eyes glimmer with vast curiosity, resting above a set of high cheekbones. ",
