				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:797979}< {icon:trade_archaeology_trollbatidol:25}Raz 'da Butchah{icon:trade_archaeology_trollbatscepter:25} >{/h1}\n\n{col:797979}\"When Raz goes chop chop chop,\n'de 'eads go off, off, off,\n'de axe goes swing swing swing,\nblood be spillin' 'lin 'lin,\ndeath be kickin' in,\nRaz be singin',\n'de 'eads go off.\"\n\n\n\n{h3}{col:797979}{icon:achievement_character_troll_male:25}Appearance{/h3}\n{col:797979} Looking at Raz, one can see a muscular troll, almost as muscular as an ice troll and around as tall as a forest troll, he has dark skin covered in white war paint and mysterious, crude, trinkets, which are partially worked into his skin. Some might mistake him for a dark troll at first glance, which really is just caused by the dark skin, the messy, thick, dirty hair which is colored in a rather unhealthy looking gray tone, and his muscular and big stature. Though in reality, he isn't a dark troll, most likely, it could be that he partially is one, though that isn't confirmed by anyone.\n\n{h3}{col:797979}{icon:inv_inscription_80_scroll:25}Raz' Story{/h3}\n{col:797979}Once, in a night of a distant past, loud yelling could be heard. Fear, hatred and sorrow, spoken in the Zandali language. Then there were battlecries in an elven tongue, arrows raining down from the skies, trollish huts burning, Troll women, children and men taking their last breath alike. \"Fastah, everyone into 'de cave, 'de cave!\" a voice said, the probably most fearless one out of all, the renown protector of that small village upon the coast of an night elven forest. But it was to late, as just moments after he yelled, trying to get his friends and family to safety, the loud noises fell silent, nothing but darnassian cheering could be heard. Every single Troll had been shot, stabbed, beheaded or burnt. This caused the single survivor to grow mad with hatred, him taking up the weapons of his fallen brethren and in turn butchering every single one of the night elven raiders, that night lead to the new dawn of him, who earned himself the name of \"Raz the Butcher\".\n\n{img:Interface\\ARCHEOLOGY\\Arch-Race-TrollBIG:256:512}",
				},
			},
