						["TI"] = "A warrior in training:",
						["TX"] = "Not having any connection to the leylines or other magical attributes. She has decided that picking up the mantle of a warrior would suit her just fine. Putting her metallic carbon claws to good use while learning the ropes.\n\nShe has yet to work up the strength or picked out any plate to wear nor has she had any weapons made. That will be a journey all to itself.",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Items in bag:",
						["TX"] = "The backpack is enchanted to be more of a pocket dimension. It's not tied to the bag exclusively which means if the bag is lost. her items can still be retrieved with a new enchant.\n\nWeapons:\n- A jagged rune enchanted dagger.\nHer main weapon. The enchant can vary greatly depending on need and what she has on hand.\n\nStuff from others:\n- Two necklaces made of ice infused with dark magic. One has a crossed moon on it.\nFrom: Enzio.\n\n- A straw doll trinket.\nMakes your love interest more interested in you[?].\nFrom: Cha'ja for 1 silver.\n\n- A sheep plushy.\nAbout the size of a gnome, looks like a popcorn.\nFrom: Nep'tone.\n\n- A book of memories.\nHandwritten by Nep'tone for Ems old life. \nFrom: Nep'tone.\n\n- Ruby colored gem.\nOn her front, a red ruby colored gem is hanging from a small chain.\nFrom: Marik.\n\n- A ice vase.\nFrom: Enzio.\n\n- Troll arm.\nA whole troll arm.\nFrom: Laz'zazze.\n\n- A pet cockroach.\nA cockroach named 'Cocker'.\nFrom: Farkhan.\n\n- Black Rose.\nAlongside a concerning letter.\nFrom: Kha'gash.",
