						["AC"] = true,
						["TX"] = "Both she and her bag can smell of freshly milled herbs and spices.\n\nUsing her knowledge of alchemy, she has started making potions using flowers, roots among other things she can gather. Focusing on the healing aspects.\n\nShe uses her notebook to sketch down plants and write recipes.\n\nKeeping small samples to either grow or mix later, always at hand.",
