			["about"] = {
				["v"] = 80,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h3:c}{link*https://www.youtube.com/watch?v=_UkLmpeLz-I*Theme}{/h3}\n{h3:c}{link*https://imgur.com/a/gBzmqxL*Art Human form}{/h3}\n{h3:c}{link*https://imgur.com/a/WTAcAYm*Art Human form: Happy Halloween!}{/h3}\n{h3:c}{link*https://imgur.com/a/BzxshoF*Commissions: Open}{/h3}\n{h3:c}{link*https://wow.gamepedia.com/Homunculus*Homunculus][Read the trp for my own changes}{/h3}\n\n{h1:c}{icon:inv_alchemy_80_alchemiststone02:25}{/h1}\n{h2:c}______________{/h2}\n{h1:c}{col:2a26b6}Chapters{/col}{/h1}\n{h2:c}_______________{/h2}\n\n{h3:c}{col:2a26b6}¤{/col}1: Homunculus{col:2a26b6}¤{/col}{/h3}\n{h3:c}{col:2a26b6}¤{/col}2: Shape shifter{col:2a26b6}¤{/col}{/h3}\n{h3:c}{col:2a26b6}¤{/col}3: Heart and soul{col:2a26b6}¤{/col}{/h3}\n{h3:c}{col:2a26b6}¤{/col}4: Identity disorder{col:2a26b6}¤{/col}{/h3}\n{h3:c}{col:2a26b6}¤{/col}5: Roleplay mechanics{col:2a26b6}¤{/col}{/h3}\n\n{h1:c}{col:511c77}¤-¤-¤-¤{/col}{/h1}\n{h2:c}______________{/h2}\n{h3:c}{col:2a26b6}Introduction{/col}{/h3}\n{h2:c}_______________{/h2}\n{h3:c}{col:ffffff}This character will take on a lot of shapes, backstories and personalities that's not always what's written here. So read this as the -basic-.{/col}{/h3}\n\n{h1:c}{col:511c77}¤-¤-¤-¤{/col}{/h1}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-74:64:64}\n{h1:c}1{/h1}\n{h2:c}______________{/h2}\n{h3:c}{col:2a26b6}A homunculus, a creature born out of Alchemy{/col}{/h3}\n{h2:c}_______________{/h2}\n{h3:c}{col:ffffff}Created roughly around may 28. 2 weeks in and her body would have fully developed and taken the shape of a fallen friend of her creator. A young human female going by the name Em.\n\nBeing told she was suffering from amnesia caused from a recent accident has left the original body in such a bad state that hardly anything could have been done. She had to learn how to walk, talk, act and pretend. Em takes the life presented to her at first, not questioning the people who greeted her as an old friend.\n\nSoon she discovered more faults in the diaries and notes given to her for studies of her supposed previous life. Digging deeper by doing her own solo missions. Discovering that she is not actually Em but a whole new person forced to pretend to be someone else by a grieving creator.\n\nEm would start to falter only 3 weeks in on her own created life as a puppet. Questioning herself and the people around her while still remaining a impersonator of the original.\n\n5 weeks in and the creator has come to terms with his griefs and allowed her to grow as her own individual. Her new given name is Sarah.\n\n3 months have currently left its fair share of interesting encounters. She no longer attempts to hide her nature as hard as she done before. Making it not uncommon for her to have changed shape in public or speaking openly about it. Setting her mark as a social butterfly.\n\nDeciding to make a soft reset and change her name again. It seems some stuff should be left buried.{/col}{/h3}\n{h1:c}{col:511c77}¤-¤-¤-¤{/col}{/h1}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-93:64:64}\n{h1:c}2{/h1}\n{h2:c}_______________{/h2}\n{h3:c}{col:2a26b6}Shape shifter among us{/col}{/h3}\n{h2:c}_______________{/h2}\n{h3:c}{col:ffffff}Her skin if studied closely would be of silky smooth scales acting as skin. This would be the reason for her shape shifting ability. When transforming, they would restructure her appearance even growing in size and expanding to fit bigger shapes. Her ability is not constricted to her outwards appearance. Changing her vocal cords to suit the race or creature if needed. This however lies with the container driving her life source.\n\nWhen in base form -Em- would resemble a 23 year old human woman. Her body would adore a hourglass shape with a lean muscular frame.\n\nHer facial features a slight roundish form but more so feminine and gracefully framed by her hair. A gothish set of makeup further enchants her features by outlining her big green eyes with eyeliner and smokey eyeshadow as well as plumping out her lips with black lipstick.\n\nThis is the woman she was created to replace.\n{link*https://imgur.com/ASmPtMy*Art}{/col}{/h3}\n{h1:c}{col:511c77}¤-¤-¤-¤{/col}{/h1}\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-73:64:64}\n{h1:c}3{/h1}\n{h2:c}_______________{/h2}\n{h3:c}{col:2a26b6}Rare body{/col}{/h3}\n{h2:c}_______________{/h2}\n{h3:c}{col:ffffff}She has all the working parts of a normal living body. The body still needs their necessary needs met to work which means she can't survive without food, water or sleep. Keeping her undetectable as nothing is out of place. Her mind works on its own accord, allowing her to view the world as any other living creature. Having dreams and goals. Even if her mind tends to be racing at times.\n\nHer heart would be one of a soul container from which her very being derives from, holding a fractured soul. It's attached the same way as a heart, pumping the green liquid that keeps her system going. The green blood like liquid being the driving force of her rapid regeneration and shape shifting.{/col}{/h3}\n{h1:c}{col:511c77}¤-¤-¤-¤{/col}{/h1}\n{h1:c}4{/h1}\n{h2:c}______________{/h2}\n{h3:c}{col:2a26b6}Identity, A variety of problems{/col}{/h3}\n{h2:c}_______________{/h2}\n{h3:c}{col:ffffff}As an individual with only a short time being alive; where majority of it was spent being the way someone wanted and play pretend was normality at the start of it. She has problems deciding what and who she is. \n\nFlipping between personality is a daily occurrences along with all the shapes she has to remember. Taking the appearance of someone is not the same as being them and leaving a lot of things to be desired. She can come off as cruel or numb to a normal person as she has a hard time processing emotions. Not understanding facial expression or tone of voice to the full extence as someone who grown up and had the chance to experience and experiment with. But she will learn over time as finding things out is a good start.\n\nAt the end of the day, all she has to do is just smile and be happy. It's the easiest thing to fake. Just be hyper and jolly and no one will question a thing but even she can get frustrated with everything.{/col}{/h3}\n{h1:c}{col:511c77}¤-¤-¤-¤{/col}{/h1}\n{h1:c}5{/h1}\n{h2:c}______________{/h2}\n{h3:c}{col:2a26b6}Roleplay mechanics [may change as it's a wip to write out exactly what i mean]{/col}{/h3}\n{h2:c}_______________{/h2}\n{h3:c}{col:ffffff}- Any wound even if lethal will be regenerated but shortens out the supplies her body is build out of. This material is regained through eating.\n\n- Over eating will lead to material being gathered like extra weight seen as 'fat'. She can control where it goes unlike actual fat.\n\n- She is not immortal. She can be killed up to 5 times before she ends up in a coma for 2 more deaths while reverting back to a blob and finally fade into her soul container heart.\n\n- Her deaths has to be repeated over a short time for it to work. You can't kill her once and think the next time is the second. She will regain herself from eating, resting and through alchemy.\n\n- How clothing and armor works. While being able to mimic wearing armor and clothing; It would still be the same material as her skin. The only way to actually wear anything is if she puts normal clothing or armor on. \n\n- As her body was never completed. She can sometimes have major problems with her regeneration and shapeshifting. Getting stuck regenerating or in between shapes. This occurs more often when her resources are low.\n\n- Any form of deep healing by someone unfamiliar with the crystal may lead to problems and harmful outcomes for both sides. Skin deep healing is fine.{/col}{/h3}\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-WaycrestManor:256:128}",
				},
			},
