				["CU"] = "Mood: Content. In everyday clothes.\n- Fake sword and plank shield but real armor. Tabard is for color.\n[5/5]-[2/2] - [100/100 % Material]",
				["CO"] = "I recommend reading the 'about'. Yes, This does exist in lore. Just never seen anyone try it or expand it. :>\n#\n\n- Yes, this character has character development. Exmple: If you act like a cunt or tells her something and lie. She will mostliky not like or trust you for the rest of the time.\n\n- Yes, she will learn or pick up on things over time.\n\n- Yes, she can be kidnapped, attempted murder, raped or corrupt. You name it. But it's not just to walk up and pick her up. It's a play on trust and naivety. Which people forget to build.\n\n- Since she isn't shy about suddenly shapeshift. That means If you wanna studie her, ask her.\n\n- Yes, i let most things happen to her as it leads to very interesting encounters.\n\n- No, I don't like it when a guy on female characters fetishes the lesbian sexuality and force it on others ic. That's why i don't trust talking to female characters. Easy peasy.",
