				["Ríko-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}Riko the Fool{/h2}\n\n{h3}Riko was born in Vol'dun, just like the most of his kin, from a union of his vulperan parents who were specialists in digging and creating burrows. The idea of the burrow was for the vulperan race to settle for good one day, and so his parents wanted to realise that project.\n\nFrom his kit years, Riko helped his parents to the extent of his capabilities in digging around or landing a paw here and there, learning the hard trade of creating a home for future generations. Besides hard work, Vol'dun was a place of harsh conditions with disasters sweeping across the desert such as occasional problems with snake people, sandstorms that were coming in least expected moments and crazed trolls that couldn't decide which loa to follow or followed them so zealously that they were nothing but trouble. All of those combined, Riko was forced to learn how to survive from his youngest years when his parents were not around.\n\nYears were passing in Vol'dun as Riko grew up as a vulpera who was finally able to take care of his own needs without further assistance from either his kin or his parents. His family never joined any caravan as they were always busy digging and searching for a place to dig. At that age, he was able to help them speed up the process of digging homes for others.\n\nAt days when there was nothing to dig, or at least Riko liked to think so, he travelled around Vol'dun, exploring vast deserts, caves, hidden passages and tunnels. He always found joy in being underground, perhaps because of his parents influence. Vol'dun was like a big sandpit for him, being able to dig wherever his soul wished to. Besides going deep under ground and squeezing into places that not many could, even normal vulpera, he found a hobby of collecting objects he found deep under the earth. Shiny stones, abandoned relics of the past, bones and... bugs. Collecting bugs and eating them was something that could cheer him up even during worse days.\n\nWith the time passing, things were looking worse as there was higher aggression from Sethrakk at vulperan caravans and burrows and in general fear of being invaded. One night, Riko's parents got into an argument so serious, that his father decided to storm off into the desert alone. His mother was a fierce one and didn't want to let him go that easily so she left Riko in charge of finishing the burrow they were working on and chased after her husband. Days were passing but his parents did not return back home. No caravan seen them anywhere so Riko decided to go and look for himself. He had no idea where to look or how to follow their tracks, they simply were swallowed by the dunes.\n\nRiko searched caves, burrows, tunnels, passages, oasis, even went all the way to Sethrakk's temple but to no avail. He was lost. Despite being taught how to survive on his own, the lingering feeling of his family being gone without a word turned a teenage vulpera into a mindless kit, lost in the open. He wandered the desert in circles. The searing sun and eye burning sky were like a slow creeping doom for wandering Riko, in hope of seeing his parents just behind the dune he swore he saw more than ten times. He grew weaker, without water and food he lost on weight turning even more skinny than he was already.\n\nDays and nights passed and Riko lost his mind not being able to tell anymore where he is. He felt like the sun and the sky became one, spitting fire into him. He lost all strength to continue walking and collapsed onto the ground with his face up. He saw that, he saw how the sun was getting closer. How its blazing fire wanted to sear away his flesh and burn him alive. He saw the giant ball of inferno that wanted to crush him and mill his bones into the dust and the sky was only watching how he is about to meet his demise. After, there was only darkness.\n\nNot being even aware of his state, Riko woke up in a cold, dark cave. He was a wreckage with no strength to even get up from the ground. In the darkness, he could notice a glimmer of fire that was dancing in reflection of the nearby tunnel accompanied by familliar hissing noises. Riko was rescued by a group of sethrakk that had to flee from the raising group of faithless in the region. They offered him food and water and gave general information of what is going on in Vol'dun. With that in his mind, he decided to step out in the open once more but then the visions of the sky and the sun trying to crush him froze him in place, forcing him to look away. He couldn't look at the sky and the sun anymore. The fear sunk so deep into his mind that he developed a phobia. Riko feared the sky and since then never wanted to look at it anymore, or stay out in the open for too long.\n\nRiko tried to find his way to live once again by trying various methods of travelling as it took him several years to finally be able to explore once more but this time, he always covered his head and his eyes. His gaze was always focused on the ground as he traversed the desert and soon after, he explored the entire Zandalar.\n\nOn his travels, Riko met many people, learned many stories and experienced many things as there are more yet to come as the war that came to Vol'dun was yet the biggest surprise in his life. He never joined any caravan before, he continued on his travels and exploration, returning to Vol'dun from time to time to stay in one of his many burrows, helping fellow kin or horde soldiers that were lost in the sands just as he was once. Untill the vulpera joined the Horde, he decided to explore even more of the unknown world, avoiding the open sky and searing sun that wanted to turn him into dust for the rest of his travels.\n\nHe never found his parents, and probably he never will. However, the memory that they left behind keeps him motivated that maybe they will be just behind the dune that he sees infront of him. {/h3}\n\n{h2:c}Appearance{/h2}\n{h3}In progress{/h3}\n\n{h3:r}Fun corner\n{link*https://www.youtube.com/watch?v=VE-FfL1qRZc*Ambience music}{/h3}\n",
				},
