			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c} {link*https://www.argentarchives.org/node/227152*ArgentArchives} {/h1}\n{h1:c} {link*https://www.deviantart.com/worlvius*DeviantArt} {/h1} \n\n{h2:c}Pre-Death Knight{/h2}\nWorlviuz Rays were a Warrior living in Menethil Harbor with his wife Angelica Rays and his son Theris Rays.\nThe Rays family lived i quite peaceful life, Angelica working at the Deepwater Tavern while Worlviuz were working as security\nat the harbor whenever trading supplies would come from either Theramore Isle or Daggercap Bay.\nOne day, the word of the scourge returning hit Menethil Harbor, and every suitable soldier were called to arms.\nThat included Worlviuz Rays of course.\nWorlviuz fell in battle against the scourge, and got resurrected as a Death Knight. As a weapon. As a Tool for the Lich King.\n\n{h2:c}Under the Lich Kings Control{/h2}\nNow as a Death Knight, Worlviuz were ordered to spread the scourge invasions disease with \"inconspicuous crates\".\nSending those \"inconspicuous crates\" to every major city to spread diseases to bolster our army of ghouls.\n\n{h2:c}The Shattering of Frostmourne{/h2}\nWhile sitting idle in a camp in Zuldrak. A group of adventures and Tirion Fordring managed to defeat the Lich King and shatter Frostmourne.\nThe current Death Knights, standing idle in the camp suddenly got the ability to think. The ability.. to question..\nNo one knew what happened, hardly anyone could remember who they were. Worlviuz couldn't remember his name, but he could remember his wife, his son and his home.\nThose that had slight memories, left the camp to investigate and figure out their purpose. Those that could remember nothing, stayed in Zuldrak.\nWorlviuz eventually made it to Menethil Harbor. And it was.. almost empty. He spotted some crates at the Harbor, \nand remembered that those were the same crates he used to send around the world to spread the disease.\nHe went on his way to find what he could remember as his old home, to find clues on what to do from here on out.\nOutside of Menethil Harbor in the Wetlands, he managed to find his old house, inside he found a ghoul around his size, and a smaller ghoul.\nThey started screaming and running towards him with bloodlust. Out of habbit or reflex, he struck them down without remorse.\nHe would continue his search in the house for clues and found a bedroom, with a bedside table beside it. Ontop of it was a family picture.\nThe picture contained 3 names, Worlviuz, Angelica and Theris. He now knew his name at least.\nHe could recognize himself as the man on the picture. While... the 2 others looked suspiciously a lot like those 2 ghouls who just tried to attack him.\nRealising what he had done, he set himself the goal to ressurect his former family.\nHe had been training and learning about the dark arts, the knowledge of ghouls and souls weren't too distant from him.\nAfter several years of one failed attempt after the other, he finally had a breakthrough.\nEverytime he tried to ressurect his family, he only accomplished to make a mindless carcas.\nBut at the time of his breakthrough the Cataclysm started, floding the wetlands and disrupting his research on souls.\nHe dragged the rotting corpses as far as he could, before coming to the conclusion that just their skulls would be enough, he could build them a new body, a better body.\nRealising how distant and cold he was compared to his former self, he decided to stop his research. And in their honor, forge an Axe out of their bones.\n\nWorlviuz would start his journey south and reached Loch Modan.\nStrange thoughts and whispers started to accour in his mind. He would see dark figures following him from time to time.\nIt appears that he had twisted and bend Angelica and Theris's souls so much in order to learn the structure of a soul. \nThat they started haunted him, which drove him insane.\nTo deal with his bloodlust and insanity he hid himself away in a Cave Between Thelsamar and Algaz Station.\nOutside of the cave were a road that connected Thelsamar and Algaz Station, and on that road were a couple of dwarfs.\nWho would daily travel from Algaz to Thelsamar, while playing music. \nWorlviuz found these sounds.. soothing. Almost relaxing.\nOne day, he would step out of the cave as he spotted one of the dwarfs alone and ask him about these sounds.\nScared, yet incredibly drunk, the dwarf followed him and explained how the use of strings could make different sounds.\nAfter a little talk the dwarf said he had to leave, because he was late to something in Thelsamar.\nForgetting his guitar in the cave, Worlviuz saw this as a good opportunity to attach the strings to his Axe.\nWhenever Worlviuz's bloodlust or insanity hits a vital point, he just have to hit a string or two. Granted.. he has no idea how to play, he just enjoys the sound.\n\nWorlviuz learned of the existance of the Ebon Blade, and that they were important for the two major factions to allow his existence.\nSo he joined the Ebon Blade out of pure convenience, so he wouldn't be hunted as a renegade death knight.\n\nTo this day, Worlviuz seeks out wars, events, people, places that can entertain him and keep his mind straight, so he wont turn into something he'll regret.",
