					["4"] = {
						["AC"] = true,
						["TI"] = "Spirit lantern",
						["IC"] = "inv_misc_trinket6oih_lanterna2",
						["TX"] = "An eerie light glows from within the caged lantern. It casts a dim light around its surroundings, with a ghastly pale hue.\nWhatever it contains isn't healthy.",
