					["2"] = {
						["AC"] = false,
						["TI"] = "Heavy Metal!",
						["IC"] = "inv_axe_2h_undeadguitar_c_01",
						["TX"] = "Veladori carries a well preserved looking guitar with her, with skulls and a black figure of a crow drawn onto it.\n\nThe guitar is protected into a black leather case.",
