					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-WispAmulet:512:256}\nTo most strangers, the Void elf would appear distant, almost forbidding, although his demeanour is softened by a polite smile usually lingering upon his face.\n\nOff-silver eyes survey his surroundings and people with quiet, patient interest, but are prone to flare up in ardent blue whenever he's agitated, even if his face rarely betrays his true  emotions.\n\n----\n\nVaguely recognisable from his Quel'dorei days by a number of veterans, mainly military. \nThat includes Northrend, the Shattered Sun Offensive, Second, Third and Fourth War veterans, Army of the Light as well the original Argent Dawn members. Participated in other conflicts, so if you're not sure, just ask.\nKnown as both a Quel'dorei and Rendorei to The Order of Embers agents and the Alliance Navy.\n\n\nVisible and lingering injuries:\nFaint diagonal scar above the right eyebrow. \nExposed to strong toxins, still recovering",
