				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Yatinka grew up in Bloodhoof village and lived a very simpel life. She helped her mother with chores. Cleaning, cooking and the like. Her childhood was great and she has many friends.\n\nHer mother never put any pressure onto her. Yatinka could be whatever she wanted but thats what Yatinka's mother pretended to be like. Yatinka was actually being prepared to become a mother and a good wife to her husband. A good mother she would be but Yatinka didn't want to be a mother yet let alone marry at such a young age. One night after having thought about her predicament for a long time Yatinka decided to leave her family behind and set out into the wide world ahead.\n\nYatinka wrote a letter before she left. The letter said that she was very gratefull for the life her family had previded but that she simply doesn't want to settle down yet. Yatinka is too young. Not ready to make such commitments. She needs to enjoy life, meet new people, experience new things, travel and fall in love. Thus she concludes the letter by saying that she will return one day with a family of her own like her mother wills it.\n\nLeaving the letter on the kitchen tabel she left Bloodhoof village in good sipirits and traveled to Orgrimmar. Yatinka lacks worldy experience and would love to find new friends that could tell her wild stories and take her on an adventure.",
