						["TX"] = "{h2:c}Backround{/h2}\n\n[PAST] \n\n- The oldest sibling out of three orphaned ones, Matoha hails from the Ragetotem tribe and has been trained for combat his entire life and knows little else.\n\n- Participated in every struggle since the Horde was founded.\n\n[PRESANT]\n\n - Distinguished himself as a capable Warrior in the Fourth War.\n\n- Now seeks a new cause to fit a Warrior without purpose.",
