						["AC"] = true,
						["TX"] = "Vam'mar stands at an average height, fairly dark brown skin with a faded black haircolour.\n\nSeveral iron rings, variating in thickness, decorate her braids and ponytails. Thinner rings can be spotted hanging at the end of locks as well.\n\nEven though her posture is straight, she tends to keep her head slightly lowered. A calm appearence, or perhaps not trying to be seen much.",
