			["time"] = 1602983687,
			["link"] = {
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-Zandalari:512:256}\n{p:c}{col:13afc7}\n{link*https://cdn.discordapp.com/attachments/491036293283971083/574985765797232672/YinSharkSD.png*Shark Form}\n\n\nBorn as a casteless child, Yin'tawa's childhood was spent within Dazar'alor around the docks and the water, occasionally joining others for fishing and playing traditional games. Though not orphaned, her parents were often absent in her life after her birth as they, also casteless, scraped a living outside the city by any meager means necessary. \n\nOften left in the care of other vagrants, Yin'tawa soon learnt the joys of spending her time around water, going swimming with other children and fishing in small boats they crafted. For the majority of her childhood this was a peaceful existance with little to no interference.\n\nEventually Yin'tawa's affinity for the water became noted by an Acolyte of Gral whom had often spent time at the docks blessing the ships which travelled to the port. Approaching the youngster, he spoke of the great shark Loa and asked that she might consider her future in the service of him. Deciding to undertake such a role, the young Yin'tawa soon joined the other followers at Atal'Gral to devote her service to the Loa. She developed her abilities and became a keen navigator and often joined her mentor in blessing the ships which left Zandalari.\n\nOnce a young adult, Yin'tawa alongside some others of her Loa's following were driven from their beloved temple by the Naga. Returning to the great city from where she was born, the next five years were spent with the young woman scraping together an existance via vagrancy and suffering constantly at the hands of brutality from the hired hands that roamed the docks.\n\nAfter a time spent under the guidance of a self-proclaimed Prophet and a group of Zulians, Yin'tawa found herself led along by their beliefs for several months until eventually finding that her Loa's needs were of more importance. Further months spent in Nazjatar fighting against the Naga threat led the woman away from the group she had affiliated herself with and back into a more neutral position.{/col}{/p}\n",
