			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGICON-ZULFARAK:256:256}\n\n{p:c}{icon:inv_alchemy_elixir_06:25}{icon:inv_alchemy_elixir_06:25}{icon:inv_alchemy_elixir_06:25}{icon:inv_alchemy_elixir_06:25}{icon:inv_alchemy_elixir_06:25}{icon:inv_alchemy_elixir_06:25}{col:d554ff}\"An' da sands kept stretchin' out in fronta meh, an' ah beg fo' someone ta take meh away from dis place.\"{/col}{icon:inv_alchemy_80_elixir01purple:25}{icon:inv_alchemy_80_elixir01purple:25}{icon:inv_alchemy_80_elixir01purple:25}{icon:inv_alchemy_80_elixir01purple:25}{icon:inv_alchemy_80_elixir01purple:25}{/p}\n\n\n{col:417e22}This young Farraki woman seems about the least productive and energetic person one might encounter. She may have spent an entire life on a beach the size of a desert with a never-used towel hanging around her hips. Even other trolls might wonder if she's anything more than a simple, lazy tribeswoman of a terribly unsuccessful tribe.\n\nThe troll moves slowly like she has all the time in the world. Nothing seems to phase her, no danger seems to truly upset her. Her gaze always passive. It's like she does not take reality very seriously. Each of her eyes change colour every half an hour or so, and sometimes a whirlpool of rainbow can be seen within each iris. Perhaps her vision is warped, perhaps her mind is addled. \n\nWhile wandering aimlessly she sports a lithe, tall figure that is unremarkable but sufficient. Her form is undeniably agile and athletic with a healthily above average profile of curves on sinewy muscles. Her skin is exceptionally light in its brown, bright and clean because of the woman's excessive bathing habits. She smells good, always, like the herbs she picks to make a living. Her hair is surprisingly well-tended for a troll, always sleek and smooth. The length of it is contained by putting it in a very long ponytail that hangs down to her hips and sways wildly.  It has perfectly retained the sunny, fully natural yellow hair colour. Her most important tattoo is a gold Zandalari set of markings that surrounds her neck, signifying that she is in fact a Zandalari ally and the Horde's by extension. Alike many trolls she has a fine pair of tusks poking out from her dried, soft lips that she keeps at a reasonable size, and some body paint of a purely pink colour that makes her stand out from the crowd, and indicate her status as some odd witch doctor type.\n\nAt any point in time she carries a few objects of note. A purple shoulderbag, a stave with a knapsack hanging off the far end, and most importantly -the- taowol. The towel's embroidery depicts a dozen of the most important events in troll history. It is an exceptional piece of tailoring. On her belt and in her shoulderbag are a collection of flasks with a mostly pink substance. Other trolls might recognize it as mojo; raw spirit's power turned into a liquid. No doubt, if this woman had a way to defend herself it would be a bunch of very potent drinks. The collection has many other potions as well, along with herbs gathered from travel. It might be safe to assume that she is an alchemist of the rare Farraki variety.\n\nTrying to trade with her might be difficult, though. She stares, mocks, probably will laugh at the idea that coins are worth anything at all. Her presence can cause unrest to those aligned with the spirits, as they understand that her voodoo practices of brewing are not entirely ethical.\n\n{img:Interface\\QuestionFrame\\answer-warboard-classic-Tanaris:512:256}\n",
				},
