					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-AncientShamanHeaddress:512:256}\nShe knows very little of heritage as her Mother has repeatedly refused to tell.\nThough what little she knows is that her Father, Dramar Rageblade remained loyal to his Clan even as they sided with the Burning Legion, he watched his Mate and Daugther leave Nagrand with the Horde in search of a new home.\n\nAs the Dark Portal had reopened she volunteered to travel to her ansetral home, until she reached Garadar to ask if anyone knew of her Father.\n\nWhat she learned was not what she expected;\nshe was told that her Father had a change of heart on the day he was to sacrifice a family like the one that left him, something had awoken within him, as he stood with his sword in hand about to cleave the family down, Rage, pure and primal rage erupted from within, he clenched onto his sword so hard that blood seeped from between his fingers and the blade ignited, instead of cutting down the family, he had begun slaying as many of his Clansmen was part of the sacrificing ritual and fled with the family, he defended them day and night with no rest, until he told them to run without him, that he will hold them back until the family send help for him,\nbut as all stories go, help was too late, and her Father's body was found gutted like a beast surrounded by dead Burning Blade orcs and demon lakeys.\nAll that could be salvaged was the charred hilt of his sword and a pouch with a horn wrapped in leather with the name \"Khazoth Rageblade\" carved into the leather.\n",
