						["TI"] = "Working Gear",
						["AC"] = true,
						["TX"] = "----------------------------------------\nUsually wearing rather expensive clothes, Shredderfuse can also often be seen in his working equipment, which is also his combat attire at the same time. Most of it is rather simple plate, but some pieces have special features.\n----------------------------------------\n• E.B.G™\n - The E.B.G™, which stands for \"Earthbreaking Gauntlets\" are the thick pieces of metal covering his hands and bits of his arms. The right gauntlet has a red button on the outter side, which makes a deadly drill extend from it, perfect for crafting but also destroying fools. The left side has a button in the inner side, which, when activated, makes a giant shield out of them. That one is also noticeably heavier than the right one.\n----------------------------------------\n• G.T.G.G™\n - The \"Got-To-Go-Greaves\" are, obviously, the thick, metal boots he's wearing, the soles having two holes on each side, small engines inside. Those engines, when activated through one of the buttons on his belt, boost him forward quite a bit through explosions, leaving dust where he jumped from and where he lands.\n----------------------------------------\n• X-57 Utility Belt™\n - The probably most useful thing of his whole gear, well, the thing that makes everything else works. The belt carries multiple buttons, small bombs and one built in feature. That feature is the \"Gun-In-A-Belt\", which, despite the name, is a turret that can extend from the belt, which places itself on the ground while being attached to the goblin. It's rather unstable and might explode, so the Siegecrafter only uses it in the worst of situations. It also is quite small for a turret, though has a rapid firing speed\n----------------------------------------",
					},
