			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Very tall, very strong and very muscular Blood elven male, his body clearly grown above the peak physical standard of a average Blood elven male. As he stands towering, tall above most of his kin as a \"newly\" appointed Blood Knight of Silvermoon from his days as a Adept within the order.\n\nHis hair jet-black would be seen as a tail that is usually slung behind him or over his shoulder, likely someone who do not care how orderly his hair is seen upon him.\n\nHis face, carry the rugged, yet handsome face of a usual Blood elf, often with a expression that almost show a uncaring nature to those that may wander past him as he stood sternly and prepared. Yet he'd not be without scarring as he'd carry a small scar that cut up from the right corner of his lip, likely either from a brawl or battlefield in his past.\n\nHis body clearly showing his \"above the peak\" physical condition, the frame very muscular, toned with bulging tensions of muscles if one would see him bare or with clothed attires upon him. His very tall frame carry a broad chest and shoulders muscles that occasionally bulge with each breath he'd inhale, while further down along his torso upon both his abdomen the outlines of a sixpack could be seen almost chiseled upon him. With arms which portrude from each side of him with like the rest of his body carry incredible muscles within their biceps and triceps likely making him able to almost carry a log by himself. While his legs themselves would also be quite strong, sluggering the male along any field he'd tread upon.\n\nHis body would not be free of scarring as upon the male scars of varying sorts could be seen dotting upon him both large and small likely from his many brawls. Yet the most prominent scarring upon him, would a long scar that stretch down from his chest, down his side in a long cut. While a another could be seen upon his right-upper arm as a cut that stretches up to just beneath his shoulder.\n\nHis body already quite the above muscularity of a Blood elf along with his tallness in his younger age, only honed from growing up with brawls, fights and whatnot during his years. Before further honed during his long-standing service in the Quel'thalas Military then after further during as a Initiate and Adept of the Blood Knight Order.\n\nHis personality would be quite rugged, with a almost uncaring expression upon him which help him little in a conversation. At most times he'd be unfazed about alot of things that he may spot on the road.\n\nHis equipment especially his armour would almost feel like ordinary clothes to him as he'd wander about unfazed by the weight he carry, yet his most used weapon, yet while able to wield most others would be his ordinary sword and shield which he honed during the time in the Quel'thalas Military.\n\nHis nicknamed \"Roughhead\" or \"Roughy\" As a friend of his usually tease him with, he'd earned due to his brutality upon a battlefield.\n\nHis name would be pronounced as \"T-ai-sen\" as the \"L's\" are silent.\n\n(( May add or rewrite bits in the future. ^^ ))",
