					},
					["HI"] = {
						["IC"] = "inv_tourofdutyvoldun",
						["BK"] = 1,
						["TX"] = "Sand, lots and lots of sand.\n\nAnd hunting, that too.\n\nIn her past, when Rihi was much younger, she didn't have much adventurous events happening in her life.\n\nRihi and her family had their own small caravan and lived quite happily even though they lived in the dangerous desert known as Vol'dun.\n\nOne day, her father went out to look for supplies... but never returned. She, along with her brother and mother, went on a search throughout the desert to find him, but with no success...\n\nFew days in the search they started to give up and returned to their travels, thinking he left them, or worse. That same day they stumbled upon another traveling caravan, and they were welcomed to join them, which they eventually did.\n\nMuch stuff happened since then. Good, but sadly also bad things… very bad things.\n\nRihi has now found a new Caravan to be with, with other, great people she can call family.",
