					["PH"] = {
						["TX"] = "He would have the average body of an orc. Not one that sits back in the city of course. One look and you could see he's not had an easy life. His arms scarred, mostly from battles and arrows nearly catcing him. His body was well toned, nothing massive but muscular for sure. He stood with a strong posture which would naturally give the impression that he knows how to handle himself and looks ready to move when needed.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "He tends to be a quiet type. Spends more time watching than speaking, specifically in cities or populated area's. His most comfortable place to hold a good conversation is in two place. One,  out in the wilds where one can sit on their own in the music of nature without having hundreds of eyes to track. The other, If it has to be in a city, it has to be behind a building or in a tavern. The booze, ale and mead causes many to become drunk and loud. Very easy to be hidden in such places.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Once a proud orc warrior of the Frostwolf clan, now a simple green skin. Tainted by Gul'dan and his fel magic, he was exiled from his clan as he could not be trusted unless he earned it. To find his place among his clan mates, he would spend alot of time in the wild alone doing tasks for the clan as an outsider, even attempting things that could kill him but could also strengthen him. It was a test but one that dragged on for weeks until one day he'd reached his wits end and almost gave up with his life. That was until the albino hyena that travels with him now, came to his side and showed him that it was not his time to give up yet. He strived to prove himself by honing his skills and completing any task until he had done them all. This would lead to his trust being earned and him becoming one of the frostwolves once more, even without a wolf.\n\nSince then he's practiced his skills and mastered the art of being a hunter. He can track most prey and hide from most until he strikes. He can land most shots without issue and has learned the art of taming beasts, even those that most wouldn't dare to approach. He now bides his time, taking jobs and bounties to earn his coin and enjoying his new life. The one thing that will never end for him ... is the hunt!\n\n",
